INSERT INTO `products` VALUES ('1', 'Bắp cải tím', 'Bap-cai-tim', '1', '/UploadedFiles/images/productImages/upload_3824b224dad84c3e9c9efd4935911e84_358685a7728246329c1ce444a01d5e91_large.jpg', '[\"/UploadedFiles/images/productImages/upload_3824b224dad84c3e9c9efd4935911e84_358685a7728246329c1ce444a01d5e91_master.jpg\",\"/UploadedFiles/images/productImages/upload_3824b224dad84c3e9c9efd4935911e84_master.jpg\",\"/UploadedFiles/images/productImages/upload_75cfa9c197884aa8809dc35dde93dcb8_a0226dcddf2a4d62bfc55a469d262f90_master.jpg\",\"/UploadedFiles/images/productImages/upload_2519bb01a686423b9e745457f3be8156_a29804b75ed5421983df1f7ed373352b_master.jpg\",\"/UploadedFiles/images/productImages/upload_a4891177954a42e78154d9c92e34307b_588db03b1a48465baa13c462c01eb959_master.jpg\"]', '56000.00', '49000.00', '30545.45', null, '<p><strong>Bắp cải t&iacute;m</strong> thường được d&ugrave;ng để trộn salad, kh&ocirc;ng chỉ m&agrave;u sắc bắt mắt m&agrave; c&ograve;n mang lại cho m&oacute;n ăn vị ngọt thanh, tươi m&aacute;t. C&aacute;c nghi&ecirc;n cứu đ&atilde; chỉ ra rằng đ&acirc;y l&agrave; thực phẩm rất tốt cho sức khỏe.</p>', '<p><strong>Bắp cải tím&nbsp;</strong>là thực phẩm rất tốt cho sức khỏe con người. Bên cạnh thành phần chứa nhiều vitamin C và K, <strong>Bắp cải tím&nbsp;</strong>rất giàu anthocyanin polyphenols - chất chống oxy hóa, các tính năng kháng viêm khác nhau. Một số nghiên cứu cho rằng, anthocyanin có thể giúp giảm nguy cơ tim mạch, tiểu đường và một số bệnh ung thư. Nhờ giàu chất chống oxy hóa, <strong>Bắp cải tím </strong>còn giúp làn da bạn mềm mại và sáng hơn.&nbsp;</p><p>Với <strong>Bắp cải tím</strong>, bạn có thể chế biến thành nhiều món ăn khác nhau. Loại bắp cải này được sử dụng phổ biến trong món salad trộn hay xào kèm với miến. Đặc điểm nổi bật của <strong>Bắp cải tím</strong>&nbsp;là độ tươi ngon, chất lượng được bảo đảm, không chứa hóa chất bảo quản. Với <strong>Bắp cải tím,</strong>&nbsp;món ăn của bạn sẽ trở nên ngon miệng hơn bao giờ hết. &nbsp;</p><hr><p><strong>Có thể bạn chưa biết - Lợi ích bất ngờ từ việc bổ sung bắp cải tím trong thực đơn&nbsp;</strong></p><p><strong>Bắp cải tím</strong> thường được dùng để trộn salad, không chỉ màu sắc bắt mắt mà còn mang lại cho món ăn vị ngọt thanh, tươi mát. Các nghiên cứu đã chỉ ra rằng đây là thực phẩm rất tốt cho sức khỏe. Một số công dụng của <strong>bắp cải tím</strong> có thể kể tới như:</p><ul><li>Giảm cân</li><li>Tăng cường hệ miễn dịch</li><li>Cải thiện bệnh viêm loét dạ dày</li><li>Ngăn ngừa loãng xương</li><li>Ngăn ngừa ung thư</li></ul>', '1', '0', '4764', 'nông sản sạch,thực phẩm tươi sống,hàng nội địa', '5', '2018-06-02 17:35:09', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('2', 'Bắp cải trắng', 'Bap-cai-trang', '1', '/UploadedFiles/images/productImages/bap-cai-trang3_3989abae014247fe88ad71b8bfe59cbf_a2794985e6a44cc29b5451bf398121af_large.jpg', '[\"/UploadedFiles/images/productImages/bap-cai-trang3_3989abae014247fe88ad71b8bfe59cbf_a2794985e6a44cc29b5451bf398121af_master.jpg\",\"/UploadedFiles/images/productImages/bap-cai-trang3_3989abae014247fe88ad71b8bfe59cbf_master.jpg\"]', '25000.00', '21875.00', '18181.81', null, '<p>Bắp cải trắng 1 loại rau củ c&oacute; vị ngọt t&iacute;nh h&agrave;n, kh&ocirc;ng độc, loại rau c&oacute; nguồn gốc từ c&aacute;c nước &ocirc;n đới, được gia nhập v&agrave;o nước ta từ l&acirc;u.</p>', '<p>Bắp cải trắng 1 loại rau củ có vị ngọt tính hàn, không độc, loại rau có nguồn gốc từ các nước ôn đới, được gia nhập vào nước ta từ lâu.</p><p>Thành phần: Giàu muối khoáng, nhất là canxi (48mg%) và lượng vitamin C trong cải bắp ít hơn cà chua nhưng nhiều gấp 4,5 lần cà rốt, 3,6 lần khoai tây, hành tây. Bởi vậy&nbsp;bắp cải trắng&nbsp;có rất nhiều công dụng: hòa huyết, thanh nhiệt, thanh phế, mát dạ dày, giải độc, lợi tiểu, &nbsp;hạ cholesterol trong máu, giảm rối loạn mỡ máu, chống khô da, chống lão hóa da, tốt cho bệnh nhân gout. &nbsp;Tuy nhiên, ai bị bệnh bướu giáp hay tăng kali máu không nên dùng nhé vì bắp cải chứa một hàm lượng nhỏ goitrin. Chất này có tác dụng chống ôxy hóa nhưng lại có thể gây bướu cổ. Bệnh nhân suy thận nặng, phải chạy thận nhân tạo cũng không nên dùng.&nbsp;</p><p>Ai đang bị đau dạ dày thì đây là 1 thực phẩm vô cùng tốt cho sức khỏe của bạn &nbsp;vì vào năm 1948 các nhà khoa học đã phát hiện trong bắp cải có chứa vitamin U: một chất chống loét dạ dày - tá tràng, viêm dạ dày ruột, viêm đại tràng. Vitamin U là muối của Methyl Methionin Sunfonium, có trong lá bắp cải tươi. Hàm lượng vitamin U còn tuỳ thuộc theo cách trồng, thu hoạch và bảo quản.&nbsp;</p><p>Cải bắp còn có &nbsp;tác dụng làm giảm quá trình đồng hóa glucid và giảm đường huyết. Dùng 100g hàng ngày giúp phòng và trị bệnh tiểu đường type 2.</p><p>Về cách trồng: không bao giờ dùng bất kỳ loại thuốc kích thích, thuốc tăng trưởng, hoặc hóa chất &nbsp;bảo quản nào cho các sản phẩm</p><p>Các loại phân bón sử dụng luôn được kiểm soát chặt chẽ, tuân thủ quy định của bộ nông nghiệp và các cơ quan chức năng.&nbsp;</p><p>Bắp cải ngon có bề ngoài lá úp vào trong, mặt ngoài căng đều, bắp phát triển đầy đủ, mặt bắp bóng láng và lá gốc bắt đầu vàng. Nếu thu hoạch sớm lá chưa cuốn chặt, năng suất kém nhưng thu hoạch muộn bắp sẽ bị nứt nẻ, kém chất lượng. Sau khi thu hoạch bắp cải được chuyển về Sunfood bảo quản ở môi trường có nhiệt độ và độ ẩm thích hợp cùng với sự điều chỉnh thành phần khí quyển để khống chế sự phát triển của các loại vi khuẩn gây ảnh hưởng đến chất lượng và hạn chế tối đa sự thay đổi chất lượng của rau quả.</p><p>&nbsp;</p>', '1', '0', '1543', 'nông sản sạch,thực phẩm tươi sống,hàng nội địa', '11', '2018-06-02 17:35:49', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('3', 'Bắp chuối', 'Bap-chuoi', '1', '/UploadedFiles/images/productImages/bap-chuoi_gjgy_58a08ca1abb44dc1b836f5657efccf19_large.jpg', '[\"/UploadedFiles/images/productImages/bap-chuoi_gjgy_58a08ca1abb44dc1b836f5657efccf19_master.jpg\",\"/UploadedFiles/images/productImages/hoa-chuoi_master.jpg\",\"/UploadedFiles/images/productImages/bap_chuoi_2_master.jpg\"]', '39000.00', '34125.00', '28363.63', null, '<p>Bắp chuối- Sản phẩm được cung cấp bởi THực phẩm an to&agrave;n Sunfood</p>', '<p>Bắp chuối- Sản phẩm được cung cấp bởi THực phẩm an toàn Sunfood</p>', '1', '0', '19577', 'nông sản sạch,thực phẩm tươi sống,hàng nội địa', '17', '2018-06-02 17:35:51', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('4', 'Bông Cải Trắng', 'Bong-Cai-Trang', '1', '/UploadedFiles/images/productImages/lnphoto_282_large.jpg', '[\"/UploadedFiles/images/productImages/lnphoto_282_master.jpg\",\"/UploadedFiles/images/productImages/lnphoto_283_master.jpg\",\"/UploadedFiles/images/productImages/lnphoto_284_master.jpg\"]', '39000.00', '34125.00', '28363.63', null, '<p>B&ocirc;ng cải trắng, s&uacute;p lơ hay su lơ được cung cấp bởi Thực phẩm an to&agrave;n Sunfood, đảm bảo chất lượng.</p>', '<p>Bông cải trắng, súp lơ hay su lơ được cung cấp bởi Thực phẩm an toàn Sunfood, đảm bảo chất lượng.</p>', '1', '0', '1544', 'nông sản sạch,thực phẩm tươi sống,hàng nội địa', '23', '2018-06-02 17:35:51', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('5', 'Bông cải xanh', 'Bong-cai-xanh', '1', '/UploadedFiles/images/productImages/broccoli_7866d8614f0a4b42b163fac1063060b5_large.jpg', '[\"/UploadedFiles/images/productImages/broccoli_7866d8614f0a4b42b163fac1063060b5_master.jpg\",\"/UploadedFiles/images/productImages/broccoli_master.jpg\"]', '39000.00', '34125.00', '17727.27', null, '<p>B&ocirc;ng cải xanh&nbsp;(hoặc&nbsp;s&uacute;p lơ xanh,&nbsp;cải b&ocirc;ng xanh) l&agrave; một loại c&acirc;y thuộc lo&agrave;i&nbsp;cải bắp, c&oacute; hoa lớn ở đầu, thường được d&ugrave;ng như&nbsp;rau. B&ocirc;ng cải xanh thường được chế biến bằng c&aacute;ch luộc hoặc hấp, nhưng cũng c&oacute; thể được ăn sống như l&agrave; rau sống trong những đĩa&nbsp;đồ nguội khai vị.</p>', '<h2>Bông cải xanh&nbsp;</h2><p>(hoặc&nbsp;súp lơ xanh,&nbsp;cải bông xanh) là một loại cây thuộc loài&nbsp;cải bắp, có hoa lớn ở đầu, thường được dùng như&nbsp;rau. Bông cải xanh thường được chế biến bằng cách luộc hoặc hấp, nhưng cũng có thể được ăn sống như là rau sống trong những đĩa&nbsp;đồ nguội khai vị.</p><p>Bông cải xanh có chứa nhiều&nbsp;Vitamin A,&nbsp;Vitamin C,&nbsp;Vitamin K,&nbsp;chất xơ,&nbsp;Quercetin. Nó cũng chứa nhiều chất dinh dưỡng có khả năng chống&nbsp;ung thư&nbsp;như Myrosinase, Sulforaphane, Di-indolyl&nbsp;mêtan&nbsp;và một lượng nhỏ&nbsp;selen.</p><p>Bông cải xanh là món ăn ưa thích, tuy nhiên khi chế biến bông cải xanh ở nhiệt độ cao, nhiều nghiên cứu đã cho thấy những thành phần vitamin đặc biệt là nhóm chất có tác dụng ngăn ngừa ung thư bị giảm. Lý do là&nbsp; nhiệt độ cao sẽ làm mất hoạt tính của các enzyme và chất ESP, làm mất cân bằng của sulforaphane. Hơn nữa, lượng sulforaphane có đính thêm Sulphur trong bông cải xanh rất nhỏ, chỉ chiếm khoảng 20% tổng số sulphoraphanes và rất dễ bị vô hiệu hóa. Các thành phần còn lại không có đủ nguyên tố Sulphur hữu ích, nên không có khả năng kháng bệnh.</p><p>Các nhà nghiên cứu so sánh cách nấu bằng luộc, lò vi sóng và hấp bông cải xanh, và thấy rằng hấp bông cải xanh trong năm phút là cách tốt nhất để giữ lại enzyme&nbsp;myrosinase(một loại enzyme có trong bông cải xanh giúp làm sạch chất gây ung thư trong gan) của nó. Cách luộc và hâm bằng lò vi sóng bông cải xanh trong một phút hoặc ít hơn đã phá hủy phần lớn các enzyme.</p><p>Hiện nay xu hướng dùng bông cải xanh trong bữa ăn như&nbsp;salad trộn&nbsp;không qua nấu chín đang là cách&nbsp;ẩm thực&nbsp;phổ biến và khoa học, có lẽ đây là cách đảm bảo nguyên vẹn thành phần&nbsp;dinh dưỡng&nbsp;có lợi và bảo vệ&nbsp;sức khỏe.</p><p>&nbsp;</p>', '1', '0', '10008', 'nông sản sạch,thực phẩm tươi sống,hàng nội địa', '29', '2018-06-02 17:35:52', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('6', 'Cải Bẹ Xanh', 'Cai-Be-Xanh', '1', '/UploadedFiles/images/productImages/cai_be_xanh_fd386785d6cc4c4c8c235acbe9d80a8e_large.jpg', '[\"/UploadedFiles/images/productImages/cai_be_xanh_fd386785d6cc4c4c8c235acbe9d80a8e_master.jpg\"]', '42000.00', '36750.00', '19090.90', null, '<p>Cải xanh l&agrave; một loại rau phổ biến trong thực đơn h&agrave;ng ng&agrave;y của nhiều gia đ&igrave;nh c&oacute; t&aacute;c dụng chữa bệnh tuyệt vời</p>', '<p>Cải xanh là một loại rau phổ biến trong thực đơn hàng ngày của nhiều gia đình có tác dụng chữa bệnh tuyệt vời</p><p><strong>Hỗ trợ hệ tiêu hóa và táo bón</strong></p><p>Rau cải xanh chứa hàm lượng chất xơ rất lớn, chất nhầy. Chất nhầy sẽ hỗ trợ nhu động ruột, giúp tiêu hóa tốt hơn. Đồng thời, chất xơ giúp bạn ngăn ngừa táo bón.</p><p>Phòng chống ung thư bàng quang</p><p>Nếu ăn cải xanh hàng ngày với một lượng nhất định bạn có thể ngăn ngừa đượcung thưbàng quang, là một trong số những ung thư hiện nay đang gặp rất nhiều ở những người lớn tuổi.</p><p>Lý do, người già thường uống nước ít, vận động không nhiều, lượng nước đọng lại trong đường tiểu, từ đó các vi khuẩn làm cho dễ phát sinh các bệnh lý, do đó dẫn tới ung thư.</p><p><strong>Tốt cho tim mạch.</strong></p><p>Trong cải xanh có hoạt chất có tác dụng kiềm chế cholesterol, hấp thu bài tiết ra phân. Do vậy, nếu ăn rau cải thường xuyên sẽ gián tiếp hỗ trợ tim, tốt cho mạch máu của cơ thể bạn.</p><p><strong>Chống lão hóa da</strong></p><p>Đối với nhữngthực phẩmrau có màu xanh đậm như cải bẹ xanh thì hàm lượng vitamin càng cao, cung cấp nhiều axit folic cần thiết cho tế bào máu, giúp da dẻ hồng hào, tươi tắn.</p><p><strong>Chữa bệnh gout</strong></p><p>Bệnh gout hình thành do một chế độ dinh dưỡng nhiềuthực phẩmgiàu năng lượng nhất là ăn các loại thịt, tim, gan, lòng hay các loại hải sản.</p><p>Ngoài chế độ dinh dưỡng tránh nhữngthực phẩmgiàu purin có trong nội tạngđộng vậtvà hải sản, bệnh nhân mắc bệnh gout còn được khuyên dùng nhiều rau xanh, những loại có tác dụng thải ra ngoài chất axit uric gây bệnh. Dùng cải bẹ xanh nấu và uống mỗi ngày thay nước.</p><p>Nhờ uống loại nước này đều đặn có tác dụng giúp thải ra ngoài chất axit uric, phòng trừ bệnh gout rất hiệu quả. Đồng thời, bệnh nhân gout có thể lấy cải xanh giã nát và đắp vào chỗ đau.</p><p><strong>Lưu ý:</strong></p><p>Rau cải xanh có chứa nhiềuvitaminC nên khi nấu bạn cần phải đậy nắp và khi sôi chín tới thì bắc ra ngay.Tốt nhất nên ăn lẩu, khi nước sôi bạn nhúng rau vào và lấy ra luôn. Bằng cách này có thể diệt được ký sinh trùng bám trên rau, không hủy hoại vitamin C.</p>', '1', '0', '18759', 'nông sản sạch,thực phẩm tươi sống,hàng nội địa', '34', '2018-06-02 17:35:53', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('7', 'Cải bó xôi', 'Cai-bo-xoi', '1', '/UploadedFiles/images/productImages/beneficiile-spanacului-pentru-sanatate_large.jpg', '[\"/UploadedFiles/images/productImages/beneficiile-spanacului-pentru-sanatate_master.jpg\",\"/UploadedFiles/images/productImages/cai_bo_xoi_master.jpg\",\"/UploadedFiles/images/productImages/556-cai-bo-xoi_master.jpg\"]', '39000.00', '34125.00', '17727.27', null, '<p>Cải b&oacute; x&ocirc;i dễ trồng v&agrave;o m&ugrave;a đ&ocirc;ng lạnh. Vậy ăn cải b&oacute; x&ocirc;i ph&aacute;t huy c&ocirc;ng dụng của g&igrave;?<br /> Thứ cải n&agrave;y c&oacute; vị ngọt, t&iacute;nh m&aacute;t v&agrave; kh&ocirc;ng hăng như cải cay. Kh&aacute;c với cải xanh, cải bẹ hay cải th&igrave;a, cải b&oacute; x&ocirc;i thường c&oacute; cuống nhỏ v&agrave; l&aacute; xanh đậm, l&aacute; mọc chụm lại ở một gốc b&eacute; x&iacute;u. Th&acirc;n v&agrave; l&aacute; d&ograve;n, dễ g&atilde;y, dập. &nbsp;</p>', '<p>Cải bó xôi dễ trồng vào mùa đông lạnh. Vậy ăn cải bó xôi phát huy công dụng của gì?<br> Thứ cải này có vị ngọt, tính mát và không hăng như cải cay. Khác với cải xanh, cải bẹ hay cải thìa, cải bó xôi thường có cuống nhỏ và lá xanh đậm, lá mọc chụm lại ở một gốc bé xíu. Thân và lá dòn, dễ gãy, dập. &nbsp;<br> Theo dân gian cải bó xôi còn gọi là rau chân vịt. Các mẹ thường bổ sung thêm vào thực đơn cho bé nhà mình loại rau này để bé ăn ngon miệng hơn.<br> Cải bó xôi không những là một món ăn ngon mà còn có tác dụng rất “thần kỳ” trong việc phòng và chữa bệnh.</p>', '1', '0', '4889', 'nông sản sạch,thực phẩm tươi sống,hàng nội địa', '40', '2018-06-02 17:35:53', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('8', 'Cải Ngồng Hữu cơ', 'Cai-Ngong-Huu-co', '1', '/UploadedFiles/images/productImages/cai-ngong_large.jpg', '[\"/UploadedFiles/images/productImages/cai-ngong_master.jpg\",\"/UploadedFiles/images/productImages/cai_ngong1_master.jpg\",\"/UploadedFiles/images/productImages/cai_ngong2_master.jpg\"]', '42000.00', '36750.00', '19090.90', null, '<p>Cải ngồng hữu cơ được trồng tại trang trại hữu cơ Organica tại Long An. Rau được trồng theo phương thức hữu cơ (kh&ocirc;ng sử dụng ph&acirc;n b&oacute;n h&oacute;a học, thuốc trừ s&acirc;u h&oacute;a học v&agrave; chất k&iacute;ch th&iacute;ch tăng trưởng) n&ecirc;n giữ được hương vị đặc trưng</p>', '<p>Cải ngồng&nbsp;(tên tiếng anh là Chinese Brocoli) có mùi vị tương đối giống cải bẹ xanh, thân lá giống súp lơ.</p><h2><strong>Giá trị dinh dưỡng</strong></h2><p>Cải giầu chất sơ,<strong>&nbsp;</strong>vitamin A, C, magie và sắt.</p><p>Lượng<span>&nbsp;</span>calorie: 258.5kcal;<span>&nbsp;</span>Protein: 30%; Lipid rất ít;<span>&nbsp;</span>Glucid: 64%.</p><h2><strong>Công dụng</strong></h2><p>Loại rau này rất tốt cho phụ nữ bởi nó chứa nhiều dinh dưỡng thiết yếu giúp ngăn ngừa hàm lượng estrogen dư thừa trong cơ thể có thể dẫn đến ung thư. Cải làn còn tốt cho gan, túi mật. Chất folate và chất xơ trong cải làn đều cần thiết cho sức khỏe của phụ nữ.</p><p>Cải làn có mùi vị tương đối giống cải bẹ xanh, hay thân lá súp lơ, được dùng để xào chung với thịt bò, hay dùng cả thân để hầm chung với thịt, hay sử dụng để làm nộm gỏi v..v cây cải làn sử dụng được cả thân và cành...</p><p>Có tác dụng rất tốt đối với những người mắc bệnh tim, chữa bệnh ho, tiểu đường và có tác dụng chữa bệnh ung thư.</p><h2><strong>Sử dụng</strong></h2><p>Chọn những cây cải xanh nhạt cho non. Cây cải làn có thể sử dụng cả thân và cành. Cải có thê nấu canh hoặc xào chín tới là có thể thưởng thức. Cải xào thơm ngon hơn khi xào với dầu dừa.</p><p>Cải có thể dùng xào chung với thịt bò hay dùng cả thân để hầm chung với thịt hay sử dụng để làm gỏi (nộm).</p><h2><strong>Bảo quản</strong></h2><p>Bảo quản trong túi khô ráo, để trong ngăn mát tủ lạnh.</p>', '1', '0', '4890', 'nông sản sạch,thực phẩm tươi sống,hàng nội địa', '46', '2018-06-02 17:35:54', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('9', 'Cải ngọt', 'Cai-ngot', '1', '/UploadedFiles/images/productImages/lnphoto_409_large.png', '[\"/UploadedFiles/images/productImages/lnphoto_409_master.png\",\"/UploadedFiles/images/productImages/lnphoto_409_master.jpg\",\"/UploadedFiles/images/productImages/lnphoto_410_master.jpg\",\"/UploadedFiles/images/productImages/lnphoto_411_master.jpg\"]', '42000.00', '36750.00', '38181.81', null, '<p>Rau cải ngọt hữu cơ&nbsp;&nbsp;l&agrave; một loại rau&nbsp;quen thuộc ở Việt Nam được d&ugrave;ng nhiều trong bữa ăn hằng ng&agrave;y v&agrave; rất được chị em ưa chuộng.</p>\n<p>Cải ngọt&nbsp;được trồng quanh năm, vụ ch&iacute;nh l&agrave; đ&ocirc;ng xu&acirc;n, thời gian sinh trưởng 35 &ndash; 45 ng&agrave;y.</p>', '<p>Rau cải ngọt hữu cơ&nbsp;&nbsp;là một loại rau&nbsp;quen thuộc ở Việt Nam được dùng nhiều trong bữa ăn hằng ngày và rất được chị em ưa chuộng.</p><p>Cải ngọt&nbsp;được trồng quanh năm, vụ chính là đông xuân, thời gian sinh trưởng 35 – 45 ngày.</p><p>Chất dinh dưỡng trong&nbsp;cải ngọt hữu cơ: Có chất aibumin, chất đường, vitamin B1, axít bốc hơi, axít pamic, coban, iot. Rễ và lá có nhiều chất kiềm thúc đẩy sự tiêu hoá, thúc đẩy cơ thể tiếp thu abumin bảo vệ gan, chống mỡ trong gan.</p><p>Theo Đông y,&nbsp;cải ngọt&nbsp;tính ôn, có công dụng thông lợi trường vị, làm đỡ tức ngực, tiêu thực hạ khí… có thể dùng để chữa các chứng ho, táo bón, ăn nhiều giúp cho việc phòng ngừa bệnh trĩ và ung thư ruột kết. Ăn nhiều&nbsp;rau cải ngọt&nbsp;có tác dụng ngăn ngừa ung thư gan và kết hợp điều trị bệnh ung thư và xơ cứng gan.</p><p>Rau cải ngọt hữu cơ&nbsp;có thể chế biến thành các món ăn như cải ngọt xào thịt, canh cải ngọt nấu tôm, rau cải ngọt luộc chấm xì dầu, cải ngọt xào thịt bò, cải ngọt xào chân gà…, làm lẩu cá, lẩu thịt...</p><p>Rõ ràng&nbsp;cải ngọt&nbsp;là loại&nbsp;rau hữu cơ&nbsp;rất đáng giá,tuy nhiên vẫn có những người không nên ăn loại thực phẩm bổ dưỡng này,</p><p>-Người bị dạ dày</p><p>-Người bị táo bón</p><p>-Người bị thận</p><p>Hãy là những bà nội trợ thông mình,chọn lựa đúng các loại&nbsp;rau sạch,thực phẩm hữu cơ&nbsp;vừa ngon,vừa lành phù hợp với bản thân mỗi gia đình.</p>', '1', '0', '18761', 'nông sản sạch,thực phẩm tươi sống,hàng nội địa', '52', '2018-06-02 17:35:54', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('10', 'Cải nhún', 'Cai-nhun', '1', '/UploadedFiles/images/productImages/cai-nhun_large.png', '[\"/UploadedFiles/images/productImages/cai-nhun_master.png\",\"/UploadedFiles/images/productImages/cai_nhun1_master.jpg\",\"/UploadedFiles/images/productImages/cai_nhun_master.jpg\",\"/UploadedFiles/images/productImages/cai_nhun3_master.jpg\",\"/UploadedFiles/images/productImages/cai_nhun2_master.jpg\"]', '42000.00', '36750.00', '11454.54', null, '', '<p><span>Rau cải nhún là nguồn cung cấp vitamin C và nhiều nguyên tố vi lượng giúp ích cho sự trao đổi chất của cơ thể. Tham khảo cách trồng rau cải nhún đơn giản sau:</span></p><h2><span>1. Chuẩn bị dụng cụ trồng, đất trồng và giống</span><span><br></span></h2><h3><span>Dụng cụ trồng</span></h3><div>Bạn có thể tận dụng những dụng cụ có sẵn như khay, chậu, bao xi măng, thùng xốp hoặc mảnh đất trống ở nhà. Lưu ý: Dụng cụ trồng phải đục dưới đáy để cây dễ dàng thoát nước hơn.<br>', '1', '0', '12518', 'nông sản sạch,thực phẩm tươi sống,hàng nội địa', '58', '2018-06-02 17:35:55', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('11', 'Cải thìa hữu cơ', 'Cai-thia-huu-co', '1', '/UploadedFiles/images/productImages/cai_thia2_672037c7f4fe42ecb4a4befa050520a2_large.jpg', '[\"/UploadedFiles/images/productImages/cai_thia2_672037c7f4fe42ecb4a4befa050520a2_master.jpg\",\"/UploadedFiles/images/productImages/cai_thia_master.jpg\",\"/UploadedFiles/images/productImages/cai_thia1_master.jpg\"]', '42000.00', '36750.00', '11454.54', null, '<p>&bull; Cải th&igrave;a l&agrave; loại rau rất gần gũi với c&aacute;c m&oacute;n ăn của người Việt Nam. Rau gi&ograve;n, vị ngon, ngọt.<br /> &bull; Cải th&igrave;a c&oacute; chứa folate, kali v&agrave; calci gi&uacute;p xương chắc khỏe.<br /> &bull; C&aacute;c chất thuộc nh&oacute;m carotenoid trong cải th&igrave;a c&oacute; t&aacute;c dụng như chất l&agrave;m chậm qu&aacute; tr&igrave;nh oxi h&oacute;a v&agrave; giảm việc h&igrave;nh th&agrave;nh những nguồn gốc c&oacute; hại trong cơ thể.</p>', '<p><br> <strong>GIỚI THIỆU</strong><br> • Cải thìa là loại rau rất gần gũi với các món ăn của người Việt Nam. Rau giòn, vị ngon, ngọt.<br> <strong>CÔNG DỤNG</strong><br> • Cải thìa có chứa folate, kali và calci giúp xương chắc khỏe.<br> • Các chất thuộc nhóm carotenoid trong cải thìa có tác dụng như chất làm chậm quá trình oxi hóa và giảm việc hình thành những nguồn gốc có hại trong cơ thể.</p><p><strong>Đặc điểm:</strong> Rau giòn, vị ngon, ngọt.<br> Cách bảo quản: Bảo quản ở nhiệt độ 5-12°C. Có thể bảo quản đến 15 ngày.<br> LƯỢNG DÙNG<br> • Cải thìa cung cấp rất ít calories vì vậy có thể ăn bao nhiêu tùy thích.<br> <strong>CÁCH DÙNG</strong><br> • Nên xào cải thìa để giữ lượng vitamin C và folate trong rau.<br> • Nước luộc cải cũng có thể dùng làm canh vì chứa nhiều chất khoáng; xác rau sẽ mất bớt những chất này trong quá trình đun nấu.</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Sản phẩm được cung cấp bởi Sunfood, được bảo hiểm 100% từ bảo hiểm thực phẩm Prudential.</p>', '1', '0', '4889', 'nông sản sạch,thực phẩm tươi sống,hàng nội địa', '64', '2018-06-02 17:35:56', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('12', 'Cải Xanh (HỮU CƠ)', 'cai-xanh-huu-co-', '1', '/UploadedFiles/images/productImages/lnphoto_385_large.jpg', '[\"/UploadedFiles/images/productImages/lnphoto_385_master.jpg\",\"/UploadedFiles/images/productImages/lnphoto_383_master.jpg\",\"/UploadedFiles/images/productImages/lnphoto_384_master.jpg\",\"/UploadedFiles/images/productImages/lnphoto_382_de514235b7c8488daa0b4ab0ece97724_master.jpg\"]', '42000.00', '36750.00', '30545.45', null, '<p>Cải xanh hay c&ograve;n gọi l&agrave; cải cay, l&agrave; loại rau được kh&aacute; nhiều người ưa th&iacute;ch. Với m&oacute;n x&agrave;o, m&oacute;n luộc, nấu canh, d&ugrave;ng ăn lẩu&hellip; rau cải xanh dường như kh&ocirc;ng thể thiếu trong c&aacute;c bữa ăn gia đ&igrave;nh. Kh&ocirc;ng chỉ l&agrave;m n&ecirc;n c&aacute;c m&oacute;n ăn ngon, bổ dưỡng cho gia đ&igrave;nh, rau cải xanh c&ograve;n mang đến nhiều t&aacute;c dụng tốt cho sức khỏe.&nbsp;</p>\n<p>Sản phẩm được cung cấp bởi Thực phẩm an to&agrave;n Sunfood</p>', '<p>Cải xanh hay còn gọi là cải cay, là loại rau được khá nhiều người ưa thích. Với món xào, món luộc, nấu canh, dùng ăn lẩu… rau cải xanh dường như không thể thiếu trong các bữa ăn gia đình. Không chỉ làm nên các món ăn ngon, bổ dưỡng cho gia đình, rau cải xanh còn mang đến nhiều tác dụng tốt cho sức khỏe.&nbsp;</p><p>Sản phẩm được cung cấp bởi Thực phẩm an toàn Sunfood</p>', '1', '0', '18759', 'nông sản sạch,thực phẩm tươi sống,hàng nội địa', '69', '2018-06-02 17:35:57', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('13', 'Cần tây', 'Can-tay', '1', '/UploadedFiles/images/productImages/cantay1_large.jpg', '[\"/UploadedFiles/images/productImages/cantay1_master.jpg\",\"/UploadedFiles/images/productImages/cantay2_master.jpg\"]', '45000.00', '39375.00', '32727.27', null, '', '<p>Cần tây không chỉ là nguyên liệu dùng để chế biến nhiều món ăn ngon, cần tây còn mang lại rất nhiều dưỡng chất thiết yếu cho cơ thể nên có khả năng phòng chống một số bệnh nguy hiểm, đặc biệt là chứng huyết áp cao.<br> Theo Tổ chức Y tế Thế giới (WHO), tăng huyết áp ảnh hưởng đến sức khỏe của hơn 1 tỉ người trên toàn thế giới và là yếu tố nguy cơ tim mạch quan trọng nhất liên quan đến bệnh mạch vành, suy tim, bệnh mạch máu não và bệnh thận mạn tính.<br> Song rất may là trong các loại rau sử dụng ăn hằng ngày lại rất giàu dược tính nên còn là thuốc chữa bệnh như rau cần tây chẳng hạn.</p>', '1', '0', '2324', 'nông sản sạch,thực phẩm tươi sống,hàng nội địa', '75', '2018-06-02 17:47:26', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('14', 'Cải rổ (Hữu cơ)', 'cai-ro-huu-co-', '1', '/UploadedFiles/images/productImages/cai_ro1_9ddcc5842c9e4f45a03a9564d358282f_large.jpg', '[\"/UploadedFiles/images/productImages/cai_ro1_9ddcc5842c9e4f45a03a9564d358282f_master.jpg\",\"/UploadedFiles/images/productImages/cai_ro_master.jpg\",\"/UploadedFiles/images/productImages/cai_ro1_master.jpg\",\"/UploadedFiles/images/productImages/cai_ro2_master.jpg\"]', '84000.00', '73500.00', '61090.90', null, '<p>Cải rổ&nbsp;do Sunfood&nbsp;ph&acirc;n phối&nbsp;được trồng tr&ecirc;n quy tr&igrave;nh sạch, kh&ocirc;ng chứa dư lượng h&oacute;a chất bảo vệ thực vật, kh&ocirc;ng sử dụng h&oacute;a chất k&iacute;ch th&iacute;ch tăng trưởng độc hại, đảm bảo an to&agrave;n cho sức khỏe của người sử dụng. Bạn ho&agrave;n to&agrave;n c&oacute; thể y&ecirc;n t&acirc;m khi sử dụng sản phẩm để chế biến những m&oacute;n ăn ngon trong gia đ&igrave;nh.</p>\n<p>&nbsp;</p>', '<p>Cải rổ có mùi vị tương đối giống cải bẹ xanh hay thân lá súp lơ, có giá trị dinh dưỡng cao. Khi nấu chín, cải có vị ngọt tự nhiên, màu xanh mát mắt.&nbsp;Ăn cải rổ có tác dụng rất tốt cho những người mắc bệnh tim mạch, chữa bệnh ho, tiểu đường và có tác dụng chống bệnh ung thư.</p><p>Cải rổ&nbsp;do Sunfood&nbsp;phân phối&nbsp;được trồng trên quy trình sạch, không chứa dư lượng hóa chất bảo vệ thực vật, không sử dụng hóa chất kích thích tăng trưởng độc hại, đảm bảo an toàn cho sức khỏe của người sử dụng. Bạn hoàn toàn có thể yên tâm khi sử dụng sản phẩm để chế biến những món ăn ngon trong gia đình.</p><p>&nbsp;</p>', '1', '0', '2324', 'nông sản sạch,thực phẩm tươi sống,hàng nội địa', '81', '2018-06-02 17:47:27', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('15', 'Chùm ngây', 'Chum-ngay', '1', '/UploadedFiles/images/productImages/lnphoto_402_large.jpg', '[\"/UploadedFiles/images/productImages/lnphoto_402_master.jpg\",\"/UploadedFiles/images/productImages/upload_774590dbe9f24aa2b4407ce0bc8ccf18_master.jpg\",\"/UploadedFiles/images/productImages/lnphoto_400_master.jpg\",\"/UploadedFiles/images/productImages/lnphoto_401_master.jpg\"]', '41781.00', '36558.37', '34184.45', null, '<p>Rau&nbsp;ch&ugrave;m ng&acirc;y&nbsp;gi&aacute; trị dinh dưỡng cao v&agrave; nhiều c&ocirc;ng dụng với sức khỏe. Sản phẩm được cung cấp bởi Thực phẩm an to&agrave;n Sunfood.</p>\n<p>&nbsp;</p>', '<p>Rau&nbsp;chùm ngây&nbsp;giá trị dinh dưỡng cao và nhiều công dụng với sức khỏe. Sản phẩm được cung cấp bởi Thực phẩm an toàn Sunfood.</p><p><br></p>', '1', '0', '15553', 'nông sản sạch,thực phẩm tươi sống,hàng nội địa', '87', '2018-06-02 17:47:28', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('16', 'Đậu đũa', 'Dau-dua', '1', '/UploadedFiles/images/productImages/dau-dua_large.jpg', '[\"/UploadedFiles/images/productImages/dau-dua_master.jpg\",\"/UploadedFiles/images/productImages/dau-dua1_master.jpg\",\"/UploadedFiles/images/productImages/dau-dua2_master.jpg\"]', '42000.00', '36750.00', '38181.81', null, '<p>Đậu đũa- sản phẩm được cung cấp bởi thực phẩm an to&agrave;n Sunfood</p>', '<p>Đậu đũa- sản phẩm được cung cấp bởi thực phẩm an toàn Sunfood</p>', '1', '0', '3105', 'nông sản sạch,thực phẩm tươi sống,hàng nội địa', '93', '2018-06-02 17:47:30', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('17', 'GIÁ ĐỖ SẠCH (Gói)', 'gia-do-sach-goi-', '1', '/UploadedFiles/images/productImages/lnphoto_396_large.jpg', '[\"/UploadedFiles/images/productImages/lnphoto_396_master.jpg\",\"/UploadedFiles/images/productImages/lnphoto_392_master.jpg\",\"/UploadedFiles/images/productImages/lnphoto_393_master.jpg\",\"/UploadedFiles/images/productImages/lnphoto_394_master.jpg\",\"/UploadedFiles/images/productImages/lnphoto_395_master.jpg\"]', '14000.00', '12250.00', '12727.27', null, '<p>Gi&aacute; đỗ, sản phẩm được cung cấp bởi Thực phẩm an to&agrave;n Sunfood.</p>', '<p>Giá đỗ, sản phẩm được cung cấp bởi Thực phẩm an toàn Sunfood.</p>', '1', '0', '3105', 'nông sản sạch,thực phẩm tươi sống,hàng nội địa', '99', '2018-06-02 17:47:30', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('18', 'Hành lá', 'Hanh-la', '1', '/UploadedFiles/images/productImages/hanhla_large.jpg', '[\"/UploadedFiles/images/productImages/hanhla_master.jpg\",\"/UploadedFiles/images/productImages/hanh-la_1__master.jpg\",\"/UploadedFiles/images/productImages/hanh_la_master.jpg\"]', '39000.00', '34125.00', '35454.54', null, '', '<h2>Hành lá (hành ta)</h2><p>Là một gia vị phổ biến, rất cần thiết trong việc chế biến các món ăn. Hầu như tất cả các món ăn đều có thể sử dụng hành: Kho, xào, nấu, chiên, chưng, làm chả...<br><br></p><p>Hành lá giàu chất xơ, vitamin C, vitamin K, vitamin A, vitamin B2, flavonoid, chất đồng và kali.</p><p>Trợ giúp tiêu hóa.&nbsp;Giàu chất xơ, hành lá giúp hỗ trợ tiêu hóa tốt hơn. Ăn sống hay nấu chín đều đem lại công dụng giống nhau.</p><p>Tăng cường hệ miễn dịch.&nbsp;Hành lá chứa nhiều vitamin C và vitamin A nên giúp tăng cường hệ miễn dịch và bảo vệ cơ thể khỏi bị nhiễm trùng.</p><p>Kiểm soát lượng đường trong máu và ngừa bệnh tiểu đường.&nbsp;Hợp chất lưu huỳnh có trong hành lá có tác dụng giảm lượng đường trong máu, từ đó ngừa tiểu đường.</p><p>Ngừa cảm lạnh.&nbsp;Hành lá có đặc tính kháng khuẩn và chống vi rút. Ăn hành lá giúp ngừa các bệnh truyền nhiễm do vi rút như cảm lạnh cũng như giúp loại bỏ chất nhầy.</p><p>Chống ung thư.&nbsp;Chứa nhiều flavonoid và hợp chất allyl sulfide, hành lá giúp đẩy lùi các gốc tự do và ngăn ngừa sự phát triển của các tế bào ung thư, từ đó chống lại ung thư.</p><p>Bảo vệ thị lực.&nbsp;Nguồn dồi dào vitamin A và carotenoid trong hành lá giữ cho đôi mắt khỏe mạnh và ngăn ngừa mất thị lực.</p><p>Tốt cho tim mạch.&nbsp;Hành lá rất giàu vitamin C và chất chống ô xy hóa có tác dụng đẩy lùi các gốc tự do cũng như giảm nguy cơ mắc bệnh tim.</p><p>Củng cố xương.&nbsp;Vitamin C, vitamin K và một số chất dinh dưỡng cần thiết khác trong hành lá giúp xương chắc khỏe.</p><p>Sản phẩm được trồng theo tiêu chuẩn nông sản an toàn.</p>', '1', '0', '15553', 'nông sản sạch,thực phẩm tươi sống,hàng nội địa', '104', '2018-06-02 17:47:32', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('19', 'Lá hẹ', 'La-he', '1', '/UploadedFiles/images/productImages/rau_he_large.jpg', '[\"/UploadedFiles/images/productImages/rau_he_master.jpg\",\"/UploadedFiles/images/productImages/rau_he_1_master.jpg\",\"/UploadedFiles/images/productImages/rau_he3_master.jpg\"]', '70000.00', '61250.00', '63636.36', null, '<p>Rau hẹ, l&aacute; hẹ - Sản phẩm được cung cấp bởi thực phẩm an to&agrave;n Sunfood</p>', '<p>Rau hẹ, lá hẹ - Sản phẩm được cung cấp bởi thực phẩm an toàn Sunfood</p>', '1', '0', '4540', 'nông sản sạch,thực phẩm tươi sống,hàng nội địa', '110', '2018-06-02 17:47:33', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('20', 'Mồng tơi (Hữu cơ)', 'mong-toi-huu-co-', '1', '/UploadedFiles/images/productImages/mong_toi_085c753c9c5f460db8e605dab3c5f90a_large.jpg', '[\"/UploadedFiles/images/productImages/mong_toi_085c753c9c5f460db8e605dab3c5f90a_master.jpg\",\"/UploadedFiles/images/productImages/mong_toi1_master.jpg\",\"/UploadedFiles/images/productImages/mong_toi2_master.jpg\"]', '56000.00', '49000.00', '35636.36', null, '<p>Rau mồng tơi (m&ugrave;ng tơi) vị chua ngọt, t&iacute;nh h&agrave;n, kh&ocirc;ng độc, c&oacute; t&aacute;c dụng thanh nhiệt, hoạt tr&agrave;ng, lương huyết, th&ecirc;m t&acirc;n dịch, giải độc, lợi tiểu. Mồng tơi được d&ugrave;ng để chữa một số bệnh như: Đại tiện xuất huyết kinh ni&ecirc;n, Đi tiểu rắt, Khớp xương ch&acirc;n tay đau nhức do phong thấp, Chữa đinh sang, Vi&ecirc;m ruột thừa, Bị thương chảu m&aacute;u, Ngực sườn đầy tức, bứt rứt kh&oacute; chịu do t&iacute;ch nhiệt. L&agrave;m đẹp da.</p>\n<p>&nbsp;</p>', '<p>Rau mồng tơi (mùng tơi) vị chua ngọt, tính hàn, không độc, có tác dụng thanh nhiệt, hoạt tràng, lương huyết, thêm tân dịch, giải độc, lợi tiểu. Mồng tơi được dùng để chữa một số bệnh như: Đại tiện xuất huyết kinh niên, Đi tiểu rắt, Khớp xương chân tay đau nhức do phong thấp, Chữa đinh sang, Viêm ruột thừa, Bị thương chảu máu, Ngực sườn đầy tức, bứt rứt khó chịu do tích nhiệt. Làm đẹp da.</p><p>&nbsp;</p>', '1', '0', '12518', 'nông sản sạch,thực phẩm tươi sống,hàng nội địa', '116', '2018-06-02 17:47:33', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('21', 'Rau Đay', 'Rau-Day', '1', '/UploadedFiles/images/productImages/ray_day_large.jpg', '[\"/UploadedFiles/images/productImages/ray_day_master.jpg\",\"/UploadedFiles/images/productImages/ray_day1_master.jpg\"]', '56000.00', '49000.00', '35636.36', null, '<p>Rau đay tươi đem rửa sạch, sau đ&oacute; nấu với nước cua để ăn cơm h&agrave;ng ng&agrave;y sẽ gi&uacute;p giải nhiệt, tăng cường canxi cho cơ thể, bồi bổ cơ thể.</p>', '<p>Ăn rau đay vào mùa hè không chỉ giúp bạn tránh bị táo bón mà còn giải nhiệt, chữa cảm nắng...</p><p>Rau đay&nbsp;– loại rau đem lại nhiều lợi ích sức khỏe không thể thiếu vào mùa hè</p><p>Là một loại rau thường được ăn vào mùa hè, rau đay đem lại vô vàn tác dụng.</p><p>Không chỉ giúp giải nhiệt mùa hè, rau đay còn là loại rau giúp nhuận tràng, chữa được nhiều bệnh thường gặp.</p><p>Trong Đông y, rau đay có vị ngọt, tính mát, không độc có tác dụng nhuận tràng, tiêu đàm, thông kinh.</p><p>Rau đay thường được dùng để chữa bệnh cho người bị suy nhược cơ thể, táo bón, kiết lỵ, ho đàm, an thần, trợ tim, lợi tiểu và lợi sữa cho phụ nữ sau sinh.</p><p>&nbsp;</p>', '1', '0', '15554', 'nông sản sạch,thực phẩm tươi sống,hàng nội địa', '122', '2018-06-02 17:47:34', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('22', 'Rau dền cơm (Hữu cơ)', 'rau-den-com-huu-co-', '1', '/UploadedFiles/images/productImages/lnphoto_386_large.jpg', '[\"/UploadedFiles/images/productImages/lnphoto_386_master.jpg\",\"/UploadedFiles/images/productImages/lnphoto_387_master.jpg\",\"/UploadedFiles/images/productImages/rau_den_com_master.jpg\",\"/UploadedFiles/images/productImages/rau_den_com1_master.jpg\",\"/UploadedFiles/images/productImages/rau_den_com2_master.jpg\"]', '42000.00', '36750.00', '15272.72', null, 'Rau dền cơm hữu cơ là rau dền được trồng theo phương pháp hữu cơ, với những tiêu chuẩn khắt khe: - Không bón phân hoá học - Không phun thuốc bảo vệ thực vật - Không phun thuốc kích thích sinh trưởng - Không sử dụng thuốc diệt cỏ - Không sử dụng sản phẩm biến đổi gen', '<p>Rau dền cơm hữu cơ là rau dền được trồng theo phương pháp hữu cơ, với những tiêu chuẩn khắt khe: - Không bón phân hoá học - Không phun thuốc bảo vệ thực vật - Không phun thuốc kích thích sinh trưởng - Không sử dụng thuốc diệt cỏ - Không sử dụng sản phẩm biến đổi gen</p><p>Cách sử dụng: xào, nấu canh hoặc kết hợp cùng các món ăn khác.</p>', '1', '0', '4540', 'nông sản sạch,thực phẩm tươi sống,hàng nội địa', '128', '2018-06-02 17:47:34', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('23', 'Rau lang (Hữu cơ)', 'rau-lang-huu-co-', '1', '/UploadedFiles/images/productImages/rau_lang1_17b6641f6e1b4d35902caac8e8e315b2_large.jpg', '[\"/UploadedFiles/images/productImages/rau_lang1_17b6641f6e1b4d35902caac8e8e315b2_master.jpg\",\"/UploadedFiles/images/productImages/rau_lang_master.jpg\",\"/UploadedFiles/images/productImages/rau_lang2_master.jpg\"]', '39000.00', '34125.00', '14181.81', null, '<p>Rau lang&nbsp;l&agrave; loại rau sạch của Organic trồng theo phương ph&aacute;p hữu cơ, đạt ti&ecirc;u chuẩn chất lượng, đảm bảo vệ sinh an to&agrave;n thực phẩm.</p>\n<p>Sản phẩm được sơ chế v&agrave; đ&oacute;ng g&oacute;i theo ti&ecirc;u chuẩn chất lượng.( C&oacute; tem chứng nhận xuất xứ )</p>', '<p>Rau lang&nbsp;là loại rau sạch của Organic trồng theo phương pháp hữu cơ, đạt tiêu chuẩn chất lượng, đảm bảo vệ sinh an toàn thực phẩm.</p><p>Sản phẩm được sơ chế và đóng gói theo tiêu chuẩn chất lượng.( Có tem chứng nhận xuất xứ )</p><p>Công dụng từ rau lang:&nbsp;</p><p>Rau khoai lang có tác dụng nhuận tràng, trị táo bón. Rau lang còn được phơi khô để làm thuốc nhuận tràng, không có độc tố và không bị tác dụng phụ.</p><p>- Rau lang tươi luộc chín có tác dụng nhuận tràng. Rau lang có vị ngọt, mát, nhờ chứa nhiều chất xơ nên giúp nhuận tràng rất hay. Đặc biệt, món rau lang xào tỏi rất tốt cho tiêu hóa.</p><p>- Lá rau lang có đặc tính giảm đường huyết. Bệnh nhân tiểu đường, đái tháo đường nên thường xuyên dùng món rau lang luộc.</p><p>- Phụ nữ sau khi sinh có thể dùng ngọn hay lá rau khoai lang nấu canh ăn cho thêm sữa.</p><p>Các món ăn chế biến từ rau lang còn có tác dụng thanh nhiệt, làm mát cơ thể, rất thích hợp trong những ngày nắng nóng hoặc bị nóng trong người.</p>', '1', '0', '4540', 'nông sản sạch,thực phẩm tươi sống,hàng nội địa', '133', '2018-06-02 17:47:36', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('24', 'Rau muống', 'Rau-muong', '1', '/UploadedFiles/images/productImages/lnphoto_389_large.jpg', '[\"/UploadedFiles/images/productImages/lnphoto_389_master.jpg\",\"/UploadedFiles/images/productImages/lnphoto_388_master.jpg\",\"/UploadedFiles/images/productImages/lnphoto_390_master.jpg\",\"/UploadedFiles/images/productImages/lnphoto_391_master.jpg\"]', '44000.00', '38500.00', '15999.99', null, '<p>Rau muống Hữu cơ, sản phẩm được cung cấp bởi Thực phẩm an to&agrave;n Sunfood.</p>', '<p>Rau muống Hữu cơ, rau muống Vietgap sản phẩm được cung cấp bởi Thực phẩm an toàn Sunfood.</p>', '1', '0', '15553', 'nông sản sạch,thực phẩm tươi sống,hàng nội địa', '139', '2018-06-02 17:47:37', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('25', 'Tần ô', 'Tan-o', '1', '/UploadedFiles/images/productImages/tan_o2_4301d0685d4948fda293a073338be1cc_large.jpg', '[\"/UploadedFiles/images/productImages/tan_o2_4301d0685d4948fda293a073338be1cc_master.jpg\",\"/UploadedFiles/images/productImages/tan_o_master.jpg\",\"/UploadedFiles/images/productImages/tan_o1_master.jpg\"]', '35000.00', '30625.00', '12727.27', null, '<p>Rau tần &ocirc; l&agrave; một loại&nbsp;rau ăn l&aacute;&nbsp;c&oacute; nhiều t&ecirc;n gọi t&ugrave;y theo địa phương: Rau c&uacute;c, cải tần &ocirc;, c&uacute;c tần &ocirc;, cải nh&uacute;ng (v&igrave; thường nh&uacute;ng ăn t&aacute;i ngon hơn). Rau tần &ocirc; d&ugrave;ng l&agrave;m rau ăn sống, t&aacute;i, nấu canh, lẩu đều ngon thơm, gi&ograve;n.</p>', '<p>Rau tần ô là một loại&nbsp;rau ăn lá&nbsp;có nhiều tên gọi tùy theo địa phương: Rau cúc, cải tần ô, cúc tần ô, cải nhúng (vì thường nhúng ăn tái ngon hơn). Rau tần ô dùng làm rau ăn sống, tái, nấu canh, lẩu đều ngon thơm, giòn.</p><p>Rau tần ô chứa các acid amin, lysin, analin, glutamic, threonin, aspartat, prolin, chất béo, chất xơ, đường, carotene, vitamin A, B1, B2, B6, C, E, K, niacin, acide pantotenic, calci, sắt, kẽm, selen, tinh dầu thơm.</p><p>Theo đông y, rau tần ô cso vị ngọt, hơi đắng, the, thơm, tính hơi mát, không độc. Có tác dụng tiêu thực, lợi trường vị, thanh đàm hỏa, yên tâm khí, chữa ho lâu ngày, thổ huyết, tán phong nhiệt, chữa đau mắt, nhức đầu kinh niên, dùng cho trường hợp ăn kém tiêu, viêm họng, viêm phế quản...<br></p><p><strong>Các bài thuốc chữ bệnh bằng rau tần ô:</strong></p><p>- Ho dai: Lấy 6g lá cây rau tần ô xắt nhỏ, thêm ít đường hay mật ong hấp trong nồi cho ra nước, rồi lấy nước này mà uống. Hoặc lấy một bó rau tần ô nấu với phổi heo, mỗi ngày ăn 1 tô vào buổi sáng.</p><p>- Đau mắt: Lấy rau tần ô nấu với cá diếc làm canh ăn ( có thể nêm thêm muối ). Ngoài ra lấy lá rau tần ô, hơ nóng đắp lên mắt.</p><p>- Giải cảm cúm ( đau họng, ho, sốt ): Rau tần ô tươi lượng vừa đủ cho vào bát to, đổ cháo đang sôi lên trên mặt để 5-10 phút cho đỡ nóng rồi trộn rau lên ăn.</p><p>- Nhức đầu kinh niên: Lấy 30-40g rau tần ô sắc với nước để uống và lấy lá tần ô hơ nóng chườm lên 2 màng tang ( thái dương ), nên làm trước khi đi ngủ.</p><p>- Thổ huyết: Lấy một bó rau tần ô, giã nhuyễn hòa với một ít nước rồi vắt lấy nước cốt mà uống.</p><p>&nbsp;</p>', '1', '0', '12518', 'nông sản sạch,thực phẩm tươi sống,hàng nội địa', '145', '2018-06-02 17:47:55', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('26', 'Xà lách Carol', 'Xa-lach-Carol', '1', '/UploadedFiles/images/productImages/xa-lach-carol_large.jpg', '[\"/UploadedFiles/images/productImages/xa-lach-carol_master.jpg\",\"/UploadedFiles/images/productImages/salad_carol1_master.jpg\",\"/UploadedFiles/images/productImages/salad_carol2_master.jpg\",\"/UploadedFiles/images/productImages/salad_carol3_master.jpg\"]', '35000.00', '30625.00', '15909.09', null, '<ul>\n<li>Bẹ l&agrave; cứng m&agrave;u trắng, m&eacute;p l&aacute; xanh hơi xoăn</li>\n<li>C&ocirc;ng dụng: k&iacute;ch th&iacute;ch ti&ecirc;u h&oacute;a, Ngăn ngừa bệnh ung thư, tim mạch, giải nhiệt.</li>\n<li>C&aacute;ch d&ugrave;ng: x&agrave;o, salad...</li>\n<li>Bảo quản: cho v&agrave;o t&uacute;i nhựa v&agrave; bảo quản trong hộc tủ lạnh ở nhiệt độ 5-12&deg;C, trong khoảng 5 ng&agrave;y.</li>\n</ul>', '<ul><li>Bẹ là cứng màu trắng, mép lá xanh hơi xoăn</li><li>Công dụng: kích thích tiêu hóa, Ngăn ngừa bệnh ung thư, tim mạch, giải nhiệt.</li><li>Cách dùng: xào, salad...</li><li>Bảo quản: cho vào túi nhựa và bảo quản trong hộc tủ lạnh ở nhiệt độ 5-12°C, trong khoảng 5 ngày.<br></li></ul>', '1', '0', '1975', 'nông sản sạch,thực phẩm tươi sống,hàng nội địa', '151', '2018-06-02 17:47:56', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('27', 'Xà lách Frisse - Xà lá', 'xa-lach-frisse-xa-la-', '1', '/UploadedFiles/images/productImages/rau-xa-lach-xoan_large.jpg', '[\"/UploadedFiles/images/productImages/rau-xa-lach-xoan_master.jpg\",\"/UploadedFiles/images/productImages/xa-lach-xoan1_master.jpg\",\"/UploadedFiles/images/productImages/xa-lach-xoan_master.jpg\",\"/UploadedFiles/images/productImages/xalachxoan_master.png\"]', '42000.00', '36750.00', '38181.81', null, '<p>Rau x&agrave; l&aacute;ch xoăn thuộc giống c&acirc;y trồng ngắn ng&agrave;y, th&acirc;n thảo v&agrave; d&ugrave;ng để ăn l&aacute;. Rau được ng&agrave;y c&agrave;ng sử dụng rộng r&atilde;i để trang tr&iacute; c&aacute;c m&oacute;n ăn, ăn sống với c&aacute;c m&oacute;n nướng, ri&ecirc;u...do c&oacute; đường vi&ecirc;n xoăn rất bắt mắt, ăn ngon, ngọt, gi&ograve;n v&agrave; t&iacute;nh m&aacute;t.<br /> Trong rau x&agrave; l&aacute;ch xoăn c&oacute; nhiều kho&aacute;ng chất sắt, canxi v&agrave; gi&agrave;u Vitamin A</p>\n<p>&nbsp;</p>', '<p>Rau xà lách xoăn thuộc giống cây trồng ngắn ngày, thân thảo và dùng để ăn lá. Rau được ngày càng sử dụng rộng rãi để trang trí các món ăn, ăn sống với các món nướng, riêu...do có đường viên xoăn rất bắt mắt, ăn ngon, ngọt, giòn và tính mát.<br> Trong rau xà lách xoăn có nhiều khoáng chất sắt, canxi và giàu Vitamin A</p><p>&nbsp;</p>', '1', '0', '19735', 'nông sản sạch,thực phẩm tươi sống,hàng nội địa', '157', '2018-06-02 17:47:56', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('28', 'Xà lách lô lô', 'Xa-lach-lo-lo', '1', '/UploadedFiles/images/productImages/lnphoto_375_large.jpg', '[\"/UploadedFiles/images/productImages/lnphoto_375_master.jpg\",\"/UploadedFiles/images/productImages/lnphoto_372_master.jpg\",\"/UploadedFiles/images/productImages/lnphoto_373_master.jpg\",\"/UploadedFiles/images/productImages/xa_lach_lolo1_master.jpg\",\"/UploadedFiles/images/productImages/xa_lach_lolo2_master.jpg\",\"/UploadedFiles/images/productImages/lnphoto_374_master.jpg\"]', '69000.00', '60375.00', '62727.27', null, '<p>X&agrave; l&aacute;ch c&oacute; nguồn gốc từ v&ugrave;ng &nbsp;nhiệt đới, được trồng ở tất cả c&aacute;c vườn rau tr&ecirc;n to&agrave;n thế giới v&agrave; nay trở th&agrave;nh c&acirc;y to&agrave;n thế giới. C&oacute; đến 100 thứ X&agrave; l&aacute;ch. Ở nước ta, c&oacute; trồng thứ X&agrave; l&aacute;ch c&oacute; l&aacute; xếp v&agrave;o nhau th&agrave;nh một đầu tr&ograve;n tựa như cải bắp thu nhỏ, gọi l&agrave; X&agrave; l&aacute;ch quăn hay x&agrave; l&aacute;ch &ETH;&agrave; Lạt. X&agrave; l&aacute;ch l&ocirc; l&ocirc; xanh gi&ograve;n được trồng từ v&ugrave;ng đồng bằng tới v&ugrave;ng n&uacute;i, từ Bắc ch&iacute; Nam, n&oacute; th&iacute;ch ứng với kh&iacute; hậu m&aacute;t, đặc biệt l&agrave; kh&iacute; hậu ở Đ&agrave; Lạt.</p>', '<p>Xà lách có nguồn gốc từ vùng nhiệt đới, được trồng ở tất cả các vườn rau trên toàn thế giới và nay trở thành cây toàn thế giới. Có đến 100 thứ Xà lách. Ở nước ta, có trồng thứ Xà lách có lá xếp vào nhau thành một đầu tròn tựa như cải bắp thu nhỏ, gọi là Xà lách quăn hay xà lách Ðà Lạt. Xà lách lô lô xanh giòn được trồng từ vùng đồng bằng tới vùng núi, từ Bắc chí Nam, nó thích ứng với khí hậu mát, đặc biệt là khí hậu ở Đà Lạt.</p><p>Xà lách có thể được ăn sống hoặc nấu chín, xà lách tươi sống, có nhiều chất dinh dưỡng và có nhiều tác dụng hơn xà lách nấu chín.</p><p>Bạn có thể dùng lá xà lách sống trong các món salad, sandwiches, dùng để cuốn, và trong nhiều món ăn khác. Cách tốt nhất là chiết xuất nước xà lách để lấy được hết các chất dinh dưỡng của nó. Nó tạo thức uống rất ngon khi xay với cà rốt, cà chua, cần tây, rau thì là và atiso</p><p>Xà lách Lô lô xanh khi ăn chung với Mayonnaise sẽ giúp tăng khả năng hấp thụ các chất dinh dưỡng và cơ thể.</p><p>Cách chọn mua rau xà lách lô lô xanh giòn ngon:</p><p>Chọn rau xà lách còn nguyên vẹn, không dập nát, lá xanh non và còn cứng, không bị héo</p><p>&nbsp;</p>', '1', '0', '1977', 'nông sản sạch,thực phẩm tươi sống,hàng nội địa', '163', '2018-06-02 17:47:57', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('29', 'Xà lách Oakleaf đỏ', 'Xa-lach-Oakleaf-do', '1', '/UploadedFiles/images/productImages/lnphoto_381_large.jpg', '[\"/UploadedFiles/images/productImages/lnphoto_381_master.jpg\",\"/UploadedFiles/images/productImages/lnphoto_376_master.jpg\",\"/UploadedFiles/images/productImages/lnphoto_377_master.jpg\",\"/UploadedFiles/images/productImages/lnphoto_378_master.jpg\"]', '69000.00', '60375.00', '62727.27', null, '<p>L&agrave; loại l&aacute; m&agrave;u đỏ t&iacute;a, th&acirc;n mềm, x&agrave; l&aacute;ch sồi t&iacute;m (Oak Leaf Lettuce) điểm th&ecirc;m m&agrave;u sắc cho m&oacute;n salad th&ecirc;m hấp dẫn. Tr&aacute;i với vẻ bề ngo&agrave;i &ldquo;ốm yếu\", loại giống x&agrave; l&aacute;ch n&agrave;y đem lại gi&aacute; trị sức khoẻ hết sức to lớn.</p>', '<p>Xà lách Oakleaf đỏ có đường viền đầy màu sắc của mùa thu được sử dụng trang trí món ăn. Hương vị của loại xà lách này khá tinh tế. Khi mua Xà lách Oakleaf đỏ, mọi người nên biết rằng cây này phải có màu sắc đậm, lá của nó phải nhún nhổ, sắc nét và chắc. Hơn nữa Xà lách Oakleaf đỏ phải được bảo quản nơi tối và mát mẻ. Xét về khía cạnh dinh dưỡng Xà lách Oakleaf đỏ có chứa nhiều khoáng chất, vitamin A, vitamin B, vitamin C, vitamin D và vitamin E. Khi rửa lá, bạn phải làm nhanh để giữ được các chất dinh dưỡng.</p><ul style=\"text-align: justify;\"><li style=\"font-weight: 400;\"><span style=\"font-weight: 400; font-size: 11pt; color: rgb(0, 0, 0);\">Ngăn ngừa vỡ hoặc tắc nghẽn động mạch</span></li><li style=\"font-weight: 400;\"><span style=\"font-weight: 400; font-size: 11pt; color: rgb(0, 0, 0);\">Nâng cao sức đề kháng nhờ vitamin C (hay còn gọi là axit ascorbic)</span></li><li style=\"font-weight: 400;\"><span style=\"font-weight: 400; font-size: 11pt; color: rgb(0, 0, 0);\">Bảo vệ cơ thể khỏi những viêm nhiễm quá mức.</span></li><li style=\"font-weight: 400;\"><span style=\"font-weight: 400; font-size: 11pt; color: rgb(0, 0, 0);\">Giảm nguy cơ bị cảm lạnh thường xuyên và nhiễm trùng (hiển nhiên chất này đã trở thành một phần quan trọng của chế độ ăn phòng chống bệnh cúm)</span></li><li style=\"font-weight: 400;\"><span style=\"font-weight: 400; font-size: 11pt; color: rgb(0, 0, 0);\">Giảm nguy cơ mắc các bệnh mãn tính</span></li></ul>', '1', '0', '1977', 'nông sản sạch,thực phẩm tươi sống,hàng nội địa', '168', '2018-06-02 17:47:59', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('73', 'Nấm Bào Ngư Xám', 'Nam-Bao-Ngu-Xam', '3', '/UploadedFiles/images/productImages/baonguxam2_large.jpg', '[\"/UploadedFiles/images/productImages/baonguxam2_master.jpg\",\"/UploadedFiles/images/productImages/baonguxam1_master.png\",\"/UploadedFiles/images/productImages/baonguxam_master.png\"]', '65000.00', '56875.00', '41363.63', null, '<p>Nấm b&agrave;o ngư x&aacute;m hay c&ograve;n gọi với t&ecirc;n l&agrave; Nấm S&ograve;, Nấm Dai, thường được ph&aacute;t hiện mọc hoang tr&ecirc;n th&acirc;n gỗ, mọc đơn độc v&agrave; mọc chồng l&ecirc;n nhau.</p>\n<p>Nấm b&agrave;o ngư x&aacute;m ở trong Đ&ocirc;ng Y được dụng l&agrave;m nhiều b&agrave;i thuốc chữa bệnh hiệu quả.</p>', '<p>Nấm bào ngư xám hay còn gọi với tên là Nấm Sò, Nấm Dai, thường được phát hiện mọc hoang trên thân gỗ, mọc đơn độc và mọc chồng lên nhau.</p><p>Nấm bào ngư xám ở trong Đông Y được dụng làm nhiều bài thuốc chữa bệnh hiệu quả.</p><p>Nấm bào ngư xám có màu sắc xám nâu, cuống trắng, dày, thịt chắc, ăn giòn, vị ngọt, hơi dai, có mùi thơm đặc trưng, mọc đơn lẻ, mũ nấm dầy. Đây là loại thực phẩm có giá trị dinh dưỡng cao, cung cấp một lượng không hề nhỏ chất đạm, đường, bột,các vitamin cùng các khoáng chất nguồn gốc từ thực vật.</p><p>Nấm bào ngư xám có 2 loại: màu xám đậm và xám nhạt. Mỗi loại &nbsp;màu xám đậm hay nhạt lại được phân loại ra có loại chân dài hay chân ngắn. Tại &nbsp;Việt Nam, loại nấm bào ngư xám nhạt, chân dài được biết tới với tên nấm bào ngư xám Nhật, còn loại nấm màu xám đậm là bào ngư xám Long Khánh. Ngoài ra còn có nấm &nbsp;bào ngư trắng, tuy nhiên không dai và giòn bằng loại màu xám.</p><p>Công dụng của nấm bào ngư xám với sức khỏe con người</p><p>Kháng Khuẩn</p><p>Nấm bào ngư xám có chứa chất pleutorin có công đụng kháng khuẩn và hỗ trợ ngăn ngừa các tế bào ung thư phát triển.</p><p>Giảm lượng cholesterol</p><p>Nấm bào ngư xám có công dụng giảm thiểu lượng cholesterol và lượng đường</p><p>trong máu.</p><p>Giá trị dinh dưỡng</p><p>Theo các tài liệu nghiên cứu cho biết nấm bào ngư xám có chứa hàm lượng chất dinh dưỡng cao, cung cấp cho cơ thể lượng dinh dưỡng đáng kể. Trong nấm bào ngư xám có chứa chất đạm, đường bột, các vitamin và khoáng chất phong phú.</p><p>Hỗ trợ điều trị tiểu đường</p><p>Trong Đông y nấm bào ngư xám cũng là một thành phần trong bài thuốc chữa trị tiểu đường, mỡ trong máu.</p><p>Tăng sức khỏe</p><p>Nấm bào ngư chứa hàm lượng chất đạm cũng như dinh dưỡng phong phú giúp cơ thể bổ sung thêm nguồn năng lượng dồi dào, giúp tăng cường sức khỏe hiệu quả.</p>', '1', '0', '4960', 'nông sản sạch,thực phẩm tươi sống,hàng nội địa', '425', '2018-06-02 17:50:15', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('74', 'Nấm Hương', 'Nam-Huong', '3', '/UploadedFiles/images/productImages/nam_huong_large.jpg', '[\"/UploadedFiles/images/productImages/nam_huong_master.jpg\",\"/UploadedFiles/images/productImages/namhuong2_master.jpg\",\"/UploadedFiles/images/productImages/mon_an_tu_nam_huong_master.jpg\"]', '420000.00', '367500.00', '305454.54', null, '<p>Nấm hương xuất ph&aacute;t ch&iacute;nh từ m&ugrave;i hương thơm ng&aacute;t của loại nấm n&agrave;y, ngo&agrave;i ra c&ograve;n c&oacute; t&ecirc;n gọi kh&aacute;c l&agrave; nấm đ&ocirc;ng c&ocirc;, hay nấm hoa , nấm hương t&iacute;m, hương c&ocirc; xuất hiện nhiều ở khu vực Đ&ocirc;ng &Aacute;, tại Việt Nam nấm mọc nhiều trong c&aacute;c c&aacute;nh rừng n&uacute;i cao như&nbsp;&nbsp;SAPA &ndash; L&agrave;o Cai, Lai Ch&acirc;u, H&agrave; Giang, Th&aacute;i Nguy&ecirc;n, Tuy&ecirc;n Quang, H&agrave; T&acirc;y cũng như tỉnh H&ograve;a B&igrave;nh&hellip;</p>', '<p><strong>Nấm hương</strong>&nbsp;từ xưa đã được mệnh danh là “ Hoàng hậu của thực vật” và là “vua của loài rau” (Can thái chi vương) , không phải tự nhiên nấm được mệnh danh thế mà vì nấm hương loại thực vật giàu protein nhất có tới 12-14g Protein/100g Nấm hương khô, với hàm lượng trên không có bất kỳ loại rau nào sánh được, nó có thể sánh với lượng protein trong thịt.</p><p>Nấm hương xuất phát chính từ mùi hương thơm ngát của loại nấm này, ngoài ra còn có tên gọi khác là nấm đông cô, hay nấm hoa , nấm hương tím, hương cô xuất hiện nhiều ở khu vực Đông Á, tại Việt Nam nấm mọc nhiều trong các cánh rừng núi cao như&nbsp;&nbsp;SAPA – Lào Cai, Lai Châu, Hà Giang, Thái Nguyên, Tuyên Quang, Hà Tây cũng như tỉnh Hòa Bình…Trong đó nấm hương rừng tại Sapa được khai thác nhiều nhất vì chất lượng nấm tại đây được xác định có hàm lượng Protein cao cũng như phát triển du lịch giúp cho nấm giới thiệu ra cả nước.</p>', '1', '0', '4612', 'nông sản sạch,thực phẩm tươi sống,hàng nội địa', '431', '2018-06-02 17:50:16', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('75', 'Nấm mèo', 'Nam-meo', '3', '/UploadedFiles/images/productImages/nam_meo1_large.jpg', '[\"/UploadedFiles/images/productImages/nam_meo1_master.jpg\",\"/UploadedFiles/images/productImages/nam_meo_master.jpg\",\"/UploadedFiles/images/productImages/nam-meo_master.jpg\",\"/UploadedFiles/images/productImages/nam_meo_f6b696497c6042dda0b8c13dbf805a6e_master.jpg\"]', '308000.00', '269500.00', '196000.00', null, '<p>Nấm m&egrave;o c&ograve;n c&oacute; t&ecirc;n gọi kh&aacute;c l&agrave; nấm mộc nhĩ đen c&oacute; t&ecirc;n khoa học l&agrave; Auricularia auricula-judae. T&ecirc;n nấm m&egrave;o cũng xuất ph&aacute;t từ h&igrave;nh dạng của nấm nh&igrave;n như đ&ocirc;i tai của m&egrave;o n&ecirc;n người d&acirc;n gọi l&agrave; nấm m&egrave;o. Nấm c&oacute; m&agrave;u nẫu sẫm đến đen, nấm m&egrave;o mọc tr&ecirc;n c&aacute;c c&acirc;y th&acirc;n gỗ mục v&agrave;o mua mưa ẩm thấp.&nbsp;<br /> </p>', '<p>Nấm mèo còn có tên gọi khác là nấm mộc nhĩ đen có tên khoa học là Auricularia auricula-judae. Tên nấm mèo cũng xuất phát từ hình dạng của nấm nhìn như đôi tai của mèo nên người dân gọi là nấm mèo. Nấm có màu nẫu sẫm đến đen, nấm mèo mọc trên các cây thân gỗ mục vào mua mưa ẩm thấp.&nbsp;<br> Tai nấm thường được người dân thu hoạch về gác lên dàn bếp hay sấy khô để dùng dần. Vì đặc tính dòn, dai nên rất được chị em nội trợ dùng làm các món gỏi, món canh. Là một nguyên liệu không thể nào thiếu trong các mâm cỗ cưới hỏi và được dùng hàng ngày trong các gia đình Việt Nam.<br> Công dụng khi dùng nấm mèo hay mộc nhĩ<br> Theo đông y&nbsp;mộc nhĩ&nbsp;có tác dụng và đặc tính như sau: nấm có vị ngọt tính bình, đi vào các kinh tỳ vị , đại tràng, can, thận. Nó có tác dụng rất tốt cho cơ thể như làm mát máu, cầm máu trong các trường hợp té ngã bị thương, giúp chữa trị các trường hợp hạ huyết, nhuận trường, trị lỡ và bổ khí…<br> Ngoài ra y học hiện đại còn nghiên cứu&nbsp;nấm mèo&nbsp;cho thấy trong nấm mèo chủ yếu chứa protein, chất béo, lecithin, sphingomyelin, vitamin, canxi, photpho, sắt và các thành phần vô cơ khác nên khi ăn nấm mèo rất tốt cho người có nguy cơ đột quy do tắc vỡ mạch máu ở người cao huyết áp, hạn chế vấn đề tai biến do nhồi máu cơ tim, chậm lão hóa, chống loét, chống nấm.<br> Ngoài ra nấm mộc nhĩ còn được dùng rất nhiều trong ngành ẩm thực như làm các món gỏi, chè, canh… Các món ăn được chế biến với mộc nhĩ đen không chỉ thơm ngon, bổ dưỡng mà còn có công dụng chữa bệnh, bồi bổ sức khỏe hiệu quả.</p>', '1', '0', '15277', 'nông sản sạch,thực phẩm tươi sống,hàng nội địa', '436', '2018-06-02 17:50:17', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('76', 'Ba rọi bò Mỹ', 'Ba-roi-bo-My', '4', '/UploadedFiles/images/productImages/baroibomy_6d95ff1124df451d9722acfab99764c9_large.jpg', '[\"/UploadedFiles/images/productImages/baroibomy_6d95ff1124df451d9722acfab99764c9_master.jpg\",\"/UploadedFiles/images/productImages/baroibomy1_master.jpg\",\"/UploadedFiles/images/productImages/baroibomy_master.jpg\",\"/UploadedFiles/images/productImages/thit-ba-chi-bo-my2_master.jpg\"]', '202000.00', '176750.00', '128545.45', null, '<p>Thịt b&ograve; Mỹ nổi tiếng khắp thế giới nhờ hương vị v&agrave; v&acirc;n mỡ đặc trưng cũng như khả năng cung ứng linh hoạt hơn v&agrave; chuy&ecirc;n biệt hơn, nhờ v&agrave;o hệ thống sản xuất, chế biến v&agrave; ph&acirc;n phối thịt hiệu quả nhất thế giới.</p>', '<p>Thịt bò Mỹ nổi tiếng khắp thế giới nhờ hương vị và vân mỡ đặc trưng cũng như khả năng cung ứng linh hoạt hơn và chuyên biệt hơn, nhờ vào hệ thống sản xuất, chế biến và phân phối thịt hiệu quả nhất thế giới. Thịt bò Mỹ là sự lựa chọn tốt nhất vì chúng ta biết có thể tin tưởng vào hệ thống tiêu chuẩn chất lượng luôn được duy trì ở mức cao. Thịt bò được nhập khẩu trực tiếp, theo tiêu chuẩn của Bộ Nông Nghiệp Hoa Kỳ (USDA). Tất cả đều thuộc phân hạng Cao Cấp.</p><p>Món Bò Mỹ cuộn nấm kim châm&nbsp;<br> Trụng sơ nấm kim châm trong nước sôi khoảng 30 giây. Sau đó lấy ra dĩa, thêm một ít muối cho vừa ăn.<br> Trải lát ba rọi bò ra, bỏ nấm kim châm vào và cuộn lại. Bạn có thể dùng tăm xiên qua để giữ thịt bò và nấm, hoặc dùng nấm kim châm để buộc miếng bò lại.<br> Đun nóng một ít dầu ăn trên chảo, sau đó chiên thịt bò cuộn nấm kim châm cho đến khi vàng giòn.&nbsp;<br> Ngon hơn khi dùng với sốt và phục vụ khi món ăn còn nóng.</p>', '1', '0', '1168', null, '442', '2018-06-02 17:51:31', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('77', 'CÁ BÒ DA', 'CA-BO-DA', '4', '/UploadedFiles/images/productImages/ca-bo-da-sach-1_large.png', '[\"/UploadedFiles/images/productImages/ca-bo-da-sach-1_master.png\",\"/UploadedFiles/images/productImages/ca-da-bo-sach_master.png\",\"/UploadedFiles/images/productImages/ca-bo-da-nuong-24-09-2017-15-10-55_master.jpg\",\"/UploadedFiles/images/productImages/ca-bo-nuong-muoi-ot-24-09-2017-15-10-55_master.jpg\"]', '263000.00', '230125.00', '95636.36', null, '', '<p><span><strong>Cá Bò Da&nbsp;</strong>được cung cấp bởi <a href=\"http://sunfood.com.vn/\">cửa hàng thực phẩm sạch Sunfood</a>&nbsp;</span><span>là một loài cá nước mặn, có vẻ ngoài xấu xí, nhưng khi qua chế biến lại có mùi thơm quyến rũ khiến thực khách khó lòng cưỡng lại được.</span></p><p style=\"text-align: center;\"><img src=\"//file.hstatic.net/1000198833/file/ca-bo-da-sach-sunfood_large.png\" alt=\"Cá bò da, được cung cấp bởi cửa hàng thực phẩm sạch Sunfood, sản phẩm đảm bảo an toàn chất lượng và được bảo hiểm 100%\"></p><h2><span>Món ăn từ Cá Bò da</span></h2><p><span>Nhắc tới cá bò da mọi người đều nghĩ ngay tới món nướng muối ớt. Cá bò da nướng than, cá bò da nướng muối ớt, nướng lá chuối, nướng giấy bạc... Tuy nhiên, cá bò da còn rất nổi tiếng với nhiều món ăn khác như lẩu, canh chua, đặc biệt là món Gỏi cá bò da.</span></p><p><span><strong>Cá bò da nguyên con</strong>&nbsp;(từ 0,5kg đến 2,0kg). con càng lớn ăn càng ngon.</span></p><h2>Cách làm món canh chua cá bò da ngon đúng điệu</h2><p>Nguyên liệu:&nbsp;<br></p><ul><li>Cá bò da 1 con&nbsp;<br></li><li>Cà chua: 2 quả</li><li>Dọc mùng (bạc hà): 2 lạng</li><li>Bột mì: 1 lạng</li><li>Dứa thơm: nửa quả</li><li>Đậu bắp&nbsp;</li><li>Giá đỗ</li><li>Nước mắm</li><li>Đường</li><li>Bột nêm</li><li>Me vắt: nửa lạng</li><li>Hành tím, hành lá, ớt trái</li><li>Rau thơm</li></ul><p>Cách làm</p><ul><li>Bước 1: Cá bò da mua tại cửa hàng thực phẩm sạch Sunfood, rã đông Cho cá bò da vào khay sau đó thoa phần bột mì lên mình cá rồi vuốt dọc từ đầu đến đuôi cá cho sạch nhớt, rửa cá lại bằng nước lạnh thật sạch. Cắt khúc vừa ăn hoặc cắt làm đôi.</li><li>Bước 2: Bạc hà tước vỏ, cắt khúc vừa ăn, bóp sạch với chút muối. Cà chua bổ múi cau, thơm thái lát. Đậu bắp cắt bỏ cuống, thái lát vừa ăn.</li><li>Bước 3: Phi thơm hành tím với &nbsp;dầu ăn, đổ cà chua vào xào chín và nêm thêm một muỗng canh nước mắm. Chế nước sôi ngập mặt cà chua và nêm gia vị, đường cho vừa khẩu vị.</li><li>Bước 4: Vắt me cho ra tô, chế nước dùng cá vào khuấy cho me tan rồi đổ từ từ nước me vào nồi nước dùng. Cho thơm vào nồi để thơm tiết ra chất làm ngọt và thơm nước dùng.</li><li>Cuối cùng cho cá vào nồi, đun lửa nhỏ chừng 15 phút. Cá chín vớt ra để riêng. Thêm bạc hà, đậu bắp vào nấu chừng 3 phút cho mềm rồi cho giá đỗ vào. Canh sôi, cho cá lại vào nồi, rắc hành, rau thơm thái nhỏ lên và tắt bếp.</li><li><p>Món canh cá bò da nấu chua có vị ngọt của nước dùng cá, chua nhẹ của dứa và thơm của hành, rau thơm sẽ chinh phục các bạn ngay trong lần đầu thưởng thức. Các bạn có thể dùng canh cá bò da nấu chua với bún hoặc với cơm. Ăn kèm rau sống và nước mắm cay rất ngon nhé!</p>Kính chúc quý khách có một bữa ăn thật ngon miệng cùng gia đình!</li></ul><p>Liên hệ ngay Cửa hàng thực phẩm sạch Sunfood để mua nguyên liệu đảm bảo an toàn.</p><p><span></span><br></p>', '1', '0', '1251', null, '448', '2018-06-02 17:51:32', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('78', 'Cá Thu Nhật', 'Ca-Thu-Nhat', '4', '/UploadedFiles/images/productImages/ca-thu-nhat-1_large.jpg', '[\"/UploadedFiles/images/productImages/ca-thu-nhat-1_master.jpg\",\"/UploadedFiles/images/productImages/ca-thu-nhat-nguyen-con_master.png\",\"/UploadedFiles/images/productImages/ca-thu-nhat_master.jpg\",\"/UploadedFiles/images/productImages/ca-thu-nhat2_master.jpg\"]', '51000.00', '44625.00', '18545.45', null, '<p>C&aacute; Thu Nhật đ&ocirc;ng lạnh được cung cấp bởi <a title=\"cửa h&agrave;ng thực phẩm sạch Sunfood\" href=\"http://sunfood.com.vn/\">Cửa h&agrave;ng thực phẩm sạch Sunfood</a> l&agrave; sản phẩm thủy hải sản sạch đảm bảo ti&ecirc;u chuẩn an to&agrave;n chất lượng.</p>\n<p>C&aacute; Thu Nhật c&oacute; thể chế biến được nhiều m&oacute;n ngon như kho ti&ecirc;u, kho c&agrave;, C&aacute; Thu Nhật nướng giấy bạc&hellip;</p>\n<p>Hotline: 0915.544.244</p>', '<p>Cá Thu Nhật đông lạnh được cung cấp bởi <a href=\"http://sunfood.com.vn/\" title=\"cửa hàng thực phẩm sạch Sunfood\">Cửa hàng thực phẩm sạch Sunfood</a> là sản phẩm thủy hải sản sạch đảm bảo tiêu chuẩn an toàn chất lượng.</p><p>Cá Thu Nhật có thể chế biến được nhiều món ngon như kho tiêu, kho cà, Cá Thu Nhật nướng giấy bạc…</p><p>Sunfood giới thiệu cách làm món Cá Thu Nhật kho tiêu, đơn giản nhưng đảm bảo ăn hết cơm nha mọi người.</p><h2>Nguyên liệu:</h2><p>Cá thu nhật đông lạnh mua tại cửa hàng thực phẩm sạch Sunfood</p><p>Củ riềng, <a href=\"http://sunfood.com.vn/products/ot-hiem\">ớt</a>, tỏi, sả cây, hạt tiêu</p><p>Gia vị: Mắm, <a href=\"http://sunfood.com.vn/products/muoi-tinh-khiet-thai-lan\" title=\"Muối tinh khiết\">muối</a>, đường, bột nêm.</p><h2>Cách làm</h2><p>Bước 1: Cá thu Nhật đông lạnh, mua tại cửa hàng thực phẩm sạch Sunfood. Cá đã qua sơ chế, vì vậy các mẹ chỉ cần rã đông và rửa lại bằng nước sạch, để ráo.</p><p style=\"text-align: center;\"><img src=\"//file.hstatic.net/1000198833/file/ca-thu-nhat-nguyen-con_grande.png\"></p><p>Cắt khúc dài khoảng 4-5cm. Ướp cá với 2 muỗng hạt tiêu, 2 muỗng hạt nêm, chao đều để cá ngấm gia vị.</p><p>Riềng, sả, ớt băm nhỏ.</p><p>Bước 2:</p><p>Để có được món cá thu nhật kho tiêu ngon đúng điệu, bước làm nước màu là quan trọng nhất. Không nên mua nước màu sẵn ngoài chợ vì khó yên tâm được sự độ an toàn và chất lượng.</p><p><img src=\"//file.hstatic.net/1000198833/file/ca-basa-kho-tieu-xanh-03_large.jpg\" alt=\"Nước màu\" style=\"display: block; margin-left: auto; margin-right: auto;\"></p><p>Cho 3 muỗng đường vào chảo, đun lửa vừa, đường chuyển sang màu cánh gián và nổi bột khí thì cho nước vào, chú ý, cho nước vào sớm quá đường sẽ đóng cục, trễ quá, nước đường chuyển sang màu đen sẽ có vị đắng. Canh vừa chuẩn màu cánh gián và sủi bột khí cho nước vào sẽ có nước màu như ý.</p><p>Bước 3: Xếp cá vào nồi nước màu, nêm 3 thìa nước mắm ngon, cho riềng, sả ớt vào ướp cá </p><p>Bước 4: Kho cá lửa vừa, cho thêm 200ml nước lọc, và 1 muỗng dấm gạo.</p><p>Đợi nước sôi, vặn lửa liu riu để gia vị thấm đều vào cá, khi gần cạn hết nước, các mẹ nêm lại gia vị cho vừa miệng, thường thì kho cá chúng ta kho đậm một tí thịt cá sẽ ngon hơn.</p><p>Cho thêm vài muỗng dầu ăn để cá tăng vị béo và có màu bóng bẩy.</p><p>Các mẹ nhớ lật mặt cá để gia vị được thấm đều hơn. Kho cho tới khi gần cạn hết nước, cá lên màu vàng nâu đẹp mắt, thịt cá săn chắc lại là được.</p><p>Cuối cùng là bày ra đĩa và thưởng thức món cá Thu Nhật Kho tiêu ngon bá cháy thôi nào.</p><p><img src=\"//file.hstatic.net/1000198833/file/ca-thu-nhat2_large.jpg\" alt=\"Cá thu nhật kho tiêu\" style=\"display: block; margin-left: auto; margin-right: auto;\"></p><p>Chúc các mẹ có một bữa ăn như ý cùng gia đình và đừng quên ghé <a href=\"http://sunfood.com.vn/collections/thuy-hai-san-sach\" title=\"thủy hải sản sạch\">Sunfood</a> mua nguyên liệu sạch, đảm bảo an toàn nha.</p><p>', '1', '0', '17069', null, '454', '2018-06-02 17:51:32', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('79', 'Lõi nạc vai bò Mỹ', 'Loi-nac-vai-bo-My', '4', '/UploadedFiles/images/productImages/loi-nac-vai-bo-choice_large.jpg', '[\"/UploadedFiles/images/productImages/loi-nac-vai-bo-choice_master.jpg\",\"/UploadedFiles/images/productImages/loi_nat_vai_bo_my_master.png\",\"/UploadedFiles/images/productImages/loi_nat_vai_bo_my_master.jpg\"]', '356000.00', '311500.00', '129454.54', null, '<p>Thịt b&ograve; Mỹ nổi tiếng khắp thế giới nhờ hương vị v&agrave; v&acirc;n mỡ đặc trưng cũng như khả năng cung ứng linh hoạt hơn v&agrave; chuy&ecirc;n biệt hơn, nhờ v&agrave;o hệ thống sản xuất, chế biến v&agrave; ph&acirc;n phối thịt hiệu quả nhất thế giới.</p>', '<p>Thịt bò Mỹ nổi tiếng khắp thế giới nhờ hương vị và vân mỡ đặc trưng cũng như khả năng cung ứng linh hoạt hơn và chuyên biệt hơn, nhờ vào hệ thống sản xuất, chế biến và phân phối thịt hiệu quả nhất thế giới. Thịt bò Mỹ là sự lựa chọn tốt nhất vì chúng ta biết có thể tin tưởng vào hệ thống tiêu chuẩn chất lượng luôn được duy trì ở mức cao. Thịt bò được nhập khẩu trực tiếp, theo tiêu chuẩn của Bộ Nông Nghiệp Hoa Kỳ (USDA). Tất cả đều thuộc phân hạng Cao Cấp.</p><p>THÀNH PHẦN: 100% thịt lõi nạc vai bò&nbsp;</p><p>- HD SỬ DỤNG: dùng để chế biến thực phẩm. Rã đông ở nhiệt độ tối đa +4C trong tủ lạnh. Không làm đông trở lại. Nấu chín trước khi dùng&nbsp;<br> - HD BẢO QUẢN: ở nhiệt độ -18C&nbsp;<br> - HSD: 6 tháng kể từ ngày đóng gói (NĐG)&nbsp;</p>', '1', '0', '4025', null, '460', '2018-06-02 17:51:34', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('80', 'Sườn bò Mỹ có xương', 'Suon-bo-My-co-xuong', '4', '/UploadedFiles/images/productImages/suon_bo_my_large.jpg', '[\"/UploadedFiles/images/productImages/suon_bo_my_master.jpg\",\"/UploadedFiles/images/productImages/suon_bo_my1_master.jpg\"]', '413000.00', '361375.00', '225272.72', null, '<p>Thịt b&ograve; Mỹ nổi tiếng khắp thế giới nhờ hương vị v&agrave; v&acirc;n mỡ đặc trưng cũng như khả năng cung ứng linh hoạt hơn v&agrave; chuy&ecirc;n biệt hơn, nhờ v&agrave;o hệ thống sản xuất, chế biến v&agrave; ph&acirc;n phối thịt hiệu quả nhất thế giới. Thịt b&ograve; Mỹ l&agrave; sự lựa chọn tốt nhất v&igrave; ch&uacute;ng ta biết c&oacute; thể tin tưởng v&agrave;o hệ thống ti&ecirc;u chuẩn chất lượng lu&ocirc;n được duy tr&igrave; ở mức cao.&nbsp;</p>', '<p><span>Thịt bò Mỹ nổi tiếng khắp thế giới nhờ hương vị và vân mỡ đặc trưng cũng như khả năng cung ứng linh hoạt hơn và chuyên biệt hơn, nhờ vào hệ thống sản xuất, chế biến và phân phối thịt hiệu quả nhất thế giới. Thịt bò Mỹ là sự lựa chọn tốt nhất vì chúng ta biết có thể tin tưởng vào hệ thống tiêu chuẩn chất lượng luôn được duy trì ở mức cao.&nbsp;</span></p>', '1', '1', '12258', null, '466', '2018-06-02 17:51:34', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('81', 'Thịt đầu thăn ngoại bò Mỹ', 'Thit-dau-than-ngoai-bo-My', '4', '/UploadedFiles/images/productImages/thit_bo_than_fe99d08ed0594f9da1c9cad86fe6b372_large.jpg', '[\"/UploadedFiles/images/productImages/thit_bo_than_fe99d08ed0594f9da1c9cad86fe6b372_master.jpg\",\"/UploadedFiles/images/productImages/thit_bo_than_ngoao_e1601073e1aa4a55ae5aa77a4700b998_master.jpg\",\"/UploadedFiles/images/productImages/than_bo_ngoai_master.jpg\"]', '690000.00', '603750.00', '376363.63', null, '<p>Thịt đầu thăn ngoại l&agrave; phần được cắt ra từ miếng thăn ngoại sau khi đ&atilde; lọc bỏ hết xương v&agrave; sụn.Phần thịt n&agrave;y d&agrave;y hơn hẳn, c&oacute; một lớp mỡ bao bọc b&ecirc;n ngo&agrave;i v&agrave; mỡ dắt xen kẽ b&ecirc;n trong tạo độ b&eacute;o ngậy hấp dẫn cho m&oacute;n ăn. C&oacute; thể n&oacute;i đ&acirc;y l&agrave; một trong những phần thịt ngon nhất của con b&ograve;, được nhiều người ưa th&iacute;ch bởi nạc của n&oacute; cho ta vị ngọt đậm đ&agrave; lại kh&ocirc;ng qu&aacute; dai v&agrave; kh&ocirc;. Tỷ lệ nạc v&agrave; mỡ h&agrave;i h&ograve;a n&ecirc;n mặc d&ugrave; b&eacute;o ngậy nhưng kh&ocirc;ng hề g&acirc;y ng&aacute;n ngấy.</p>', '<p><span>Thịt đầu thăn ngoại là phần được cắt ra từ miếng thăn ngoại sau khi đã lọc bỏ hết xương và sụn.Phần thịt này dày hơn hẳn, có một lớp mỡ bao bọc bên ngoài và mỡ dắt xen kẽ bên trong tạo độ béo ngậy hấp dẫn cho món ăn. Có thể nói đây là một trong những phần thịt ngon nhất của con bò, được nhiều người ưa thích bởi nạc của nó cho ta vị ngọt đậm đà lại không quá dai và khô. Tỷ lệ nạc và mỡ hài hòa nên mặc dù béo ngậy nhưng không hề gây ngán ngấy.</span></p><p>Thịt bò Mỹ nổi tiếng khắp thế giới nhờ hương vị và vân mỡ đặc trưng cũng như khả năng cung ứng linh hoạt hơn và chuyên biệt hơn, nhờ vào hệ thống sản xuất, chế biến và phân phối thịt hiệu quả nhất thế giới. Thịt bò Mỹ là sự lựa chọn tốt nhất vì chúng ta biết có thể tin tưởng vào hệ thống tiêu chuẩn chất lượng luôn được duy trì ở mức cao. Thịt bò được nhập khẩu trực tiếp, theo tiêu chuẩn của Bộ Nông Nghiệp Hoa Kỳ.</p><p>Thịt đầu thăn bò đông lạnh Mỹ</p><p>Thành Phần: 100% Thịt Đầu Thăn Ngoại Bò&nbsp;<br> Dùng Để Chế Biến Thực Phẩm. Rã Đông Ở Nhiệt Độ Tối Đa +4C Trong Tủ Lạnh. Không Làm Đông Trở Lại. Nấu Chín Trước Khi Dùng&nbsp;<br> Bảo Quản: Ở Nhiệt Độ -18C&nbsp;<br> Hsd: 6 Tháng Kể Từ Ngày Đóng Gói</p>', '1', '0', '16254', null, '471', '2018-06-02 17:51:35', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('82', 'Thịt heo sạch', 'Thit-heo-sach', '4', '/UploadedFiles/images/productImages/thit_heo_sach1_5c4b31ad30bc4522866cf651da1ae56a_large.jpg', '[\"/UploadedFiles/images/productImages/thit_heo_sach1_5c4b31ad30bc4522866cf651da1ae56a_master.jpg\",\"/UploadedFiles/images/productImages/thit_heo_huu_co_master.jpg\",\"/UploadedFiles/images/productImages/thit_heo_huu_co_84f66d892f5543a4a96329f2593dc5cd_master.jpg\",\"/UploadedFiles/images/productImages/thit_heo_sach_master.jpg\"]', '69957.00', '61212.37', '63597.27', null, '', '<p>Thịt heo sạch là thịt của con heo được nuôi bằng thức ăn thực vật “sinh học” với một quy trình phù hợp với tự nhiên.</p><p>Nói đơn giản hơn là chăn nuôi theo kiểu truyền thống, đó là một phương pháp chăn nuôi đáp ứng “sự thoải mái và tiện nghi” một cách tối ưu mà mỗi loài gia súc đòi hỏi . Mật độ tập trung, tăng trưởng và tăng cân một cách tự nhiên, theo nhịp sinh học của mỗi chủng loại; phối giống, sinh sản theo cách cổ truyền, “tôn trọng” bản năng tự nhiên của con vật, tùy thuộc vào đặc điểm của từng giống,loài...</p><p>Thịt sạch là sản phẩm không có thuốc, kháng sinh, hormon, chất kích thích tăng trưởng... heo được ăn thức ăn hữu cơ (Selen hữu cơ khoáng hữu cơ và các hạt ngũ cốc), heo được uống nước sạch.</p><p>Quy trình nuôi heo được quản lý chặt chẽ và chứng nhận bởi cơ quan có thẩm quyền.</p><p>Sunfood cam kết mang đến cho khách hàng nguồn thịt heo chất lượng nhất.</p>', '1', '0', '2019', null, '477', '2018-06-02 17:51:36', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('83', 'Trứng gà', 'Trung-ga', '4', '/UploadedFiles/images/productImages/trung_ga_large.jpg', '[\"/UploadedFiles/images/productImages/trung_ga_master.jpg\",\"/UploadedFiles/images/productImages/trung-ga2_master.jpg\"]', '18000.00', '15750.00', '4909.09', null, '', '<p>Trứng gà công nghiệp an toàn hơn trứng gà ta&nbsp;</p><p>Xét về an toàn thực phẩm, gà ta chạy lung tung, ăn tạp lại không an toàn bằng gà công nghiệp.<br>Trứng gà luôn được gọi là loại “thực phẩm dinh dưỡng toàn phần”. Thật vậy, trứng gà là một trong những nguồn cung cấp cao đạm tối ưu, trong đó có chứa nhiều loại vitamin và khoáng chất, một lượng nhỏ axit béo omega-3, một lượng lớn các thành phần nâng thể lực như lecithin, lutein.</p><p>Nhưng người ta cũng chưa hiểu được nhiều lắm về loại thực phẩm giàu dinh dưỡng này. Xin cung cấp những kiến thức cần biết dưới đây.</p><p><strong>Ăn trứng cách nào tốt nhất?</strong></p><p><img class=\"alignnone size-full wp-image-45 lazy-loaded\" alt=\"trung-ga\" src=\"http://www.trungsach.com/wp-content/uploads/2012/12/trung-ga.jpg\" width=\"449\" height=\"396\"></p><p>Phạm Chí Hồng, phó giáo sư Học viện thực phẩm thuộc Đại học nông nghiệp Trung Quốc cho biết, xét về sự tổn thất vitamin và tỉ lệ hấp thu protein từ lòng đỏ, nếu không rán tới mức vàng giòn, thì sự khác biệt giữa các cách thức nấu như hấp, luộc, xào không lớn.</p><p>Tuy nhiên, xét theo mức độ oxy hóa và mức độ chịu nhiệt của cholesterol, sẽ sắp xếp sự khỏe mạnh cho cơ thể do cách nấu trứng đem lại như sau: Hạng A: hấp; hạng B: canh trứng, hạng C: trứng tráng.</p><p><strong>Trứng muối có làm mất dinh dưỡng không?</strong></p><p>Chất dinh dưỡng bị mất trong quá trình muối không nhiều, nhưng mức độ oxy hóa cholesterol lại khá lớn, sản phẩm oxy hóa cholesterol sẽ gây nguy hại cho tim mạch.</p><p><strong>Một ngày ăn mấy quả trứng là vừa?</strong></p><p>Giáo sư Trình Nghĩa Dũng, chủ tịch Hiệp hội Dinh dưỡng Trung Quốc cho biết, lượng ăn trứng gà ở những nhóm người khác nhau có phần khác nhau.</p><p>Trẻ em, phụ nữ mang thai, cho con bú và những người có lượng vận động lớn có thể ăn 1-2 quả trứng mỗi ngày.</p><p>Người lớn bình thường, người cao tuổi mỗi ngày ăn 1 quả là được. Những người mỡ máu bất thường hoặc béo phì, mỗi tuần ăn 2-4 quả là vừa.</p><p><strong>Ăn 5 quả trứng một lúc có bị tăng cholesterol không?</strong></p><p>Hiệp hội dinh dưỡng Trung Quốc khuyến cáo người lớn nói chung, lượng cholesterol nạp vào mỗi ngày không quá 300mg, người mỡ máu cao cần khống chế dưới 200mg. Một quả trứng gà 50g có hàm lượng cholesterol tới 290mg.</p><p>Nhưng thực tế sự hợp thành mỗi tế bào trong cơ thể đều cần đến cholesterol. Để cung ứng đầy đủ, người lớn mỗi ngày cần tổng hợp trên 1000mg cholesterol, vì vậy, người tiêu dùng không phải lo lắng về việc tiêu thụ quá nhiều trứng cùng một lúc.</p><p>Chỉ cần trong vài ngày tiếp theo giảm bớt lượng ăn các thực phẩm giàu cholesterol, là sẽ không xuất hiện nỗi phiền phức cholesterol tăng cao.</p><p><strong>Bị cảm sốt có ăn trứng rán được không?</strong></p><p>Khi bị cảm sốt, năng lương ở cơ thể bị tiêu hao nhiêu, sức đề kháng sẽ giảm, không ăn được thứ gì nên bị thiếu dinh dưỡng, nên bổ sung những thức ăn có protein tương đối cao như trứng gà… sẽ rất có ích cho phục hồi cơ thể.<br>Chuyên gia khuyến cáo tốt nhất nên ăn trứng hấp, canh trứng, không nên ăn trứng rán bởi đồ án dễ sinh vị nhiệt (dạ dày nóng), khó tiêu.</p><p><strong>Trứng gà nhỏ dinh dưỡng tốt hơn?</strong></p><p>Nhiều người tiêu dùng cho rằng trứng gà nhỏ hoặc vỏ trứng có màu sẫm sẽ có giá trị dinh dưỡng tốt, song Phạm Chí Hồng cho biết, trứng gà to nhỏ và màu vỏ trứng chưa hẳn có liên quan đến giá trị dinh dưỡng.</p><p>Còn có những người lại cho là trứng gà ta có giá trị dinh dưỡng cao hơn trứng gà công nghiệp. Thực ra xét về giá trị dinh dưỡng, sự khác biệt giữa chúng không lớn, hàm lượng phospholipid và acid béo omega 3 trong trứng gà ta cao hơn trứng gà công nghiệp, nhưng hàm lượng chất khoáng thì lại thấp hơn một chút.</p><p>Tuy nhiên, xét về an toàn thực phẩm, thì gà ta chạy lung tung, ăn tạp lại không an toàn bằng gà công nghiệp.</p><p><strong>Giữ trứng gà được trong bao lâu?</strong></p><p>Hạn bảo quản ghi trên bao bì trứng gà là 54-60 ngày, vì thế rất nhiều người yên tâm để trứng hàng tháng. Song chuyên gia nhắc nhở, trứng gà để lâu không những mang lại ẩn họa về độ an toàn, mà độ dinh dưỡng cũng kém đi.</p><p>Trứng gà tươi trong vòng 1 tuần là tốt nhất, nhưng nếu không có điều kiện thì để trong vòng nửa tháng cũng được.</p><p>Theo vtc</p>', '1', '0', '2450', null, '483', '2018-06-02 17:51:36', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('84', 'Củ Tỏi Đà Lạt', 'Cu-Toi-Da-Lat', '5', '/UploadedFiles/images/productImages/lnphoto_361_large.jpg', '[\"/UploadedFiles/images/productImages/lnphoto_361_master.jpg\",\"/UploadedFiles/images/productImages/lnphoto_362_master.jpg\",\"/UploadedFiles/images/productImages/lnphoto_363_master.jpg\",\"/UploadedFiles/images/productImages/lnphoto_364_master.jpg\"]', '168000.00', '147000.00', '45818.18', null, '<p>Tỏi Đ&agrave; Lạt, sản phẩm được cung cấp bởi thực phẩm an to&agrave;n Sunfood</p>', '<p>Tỏi Đà Lạt, sản phẩm được cung cấp bởi thực phẩm an toàn Sunfood</p>', '1', '0', '16251', 'dản phẩm khô,đặc sản,hàng nội địa,thực phẩm đóng hộp', '489', '2018-06-02 17:52:26', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('85', 'Hành tím', 'Hanh-tim', '5', '/UploadedFiles/images/productImages/lnphoto_337_0497a0e6fc2d48b8ad602cf38a72943f_large.jpg', '[\"/UploadedFiles/images/productImages/lnphoto_337_0497a0e6fc2d48b8ad602cf38a72943f_master.jpg\",\"/UploadedFiles/images/productImages/lnphoto_336_cc67cabb52a94ddebe5047e03fad6b72_master.jpg\",\"/UploadedFiles/images/productImages/lnphoto_338_f646616b0f3c4e9684f222fe99dcd8e2_master.jpg\",\"/UploadedFiles/images/productImages/lnphoto_339_38c19194571f43c88070f5e601ee342b_master.jpg\"]', '60000.00', '52500.00', '16363.63', null, '<p>H&agrave;nh t&iacute;m,&nbsp;sản phẩm được cung cấp bởi Thực phẩm an to&agrave;n Sunfood</p>', '<p>Hành tím,&nbsp;sản phẩm được cung cấp bởi Thực phẩm an toàn Sunfood<br></p>', '1', '0', '12257', 'dản phẩm khô,đặc sản,hàng nội địa,thực phẩm đóng hộp', '495', '2018-06-02 17:52:27', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('86', 'Hạt chia', 'Hat-chia', '5', '/UploadedFiles/images/productImages/hat_chia_sabal_large.jpg', '[\"/UploadedFiles/images/productImages/hat_chia_sabal_master.jpg\",\"/UploadedFiles/images/productImages/hat_chia_master.jpg\"]', '359000.00', '314125.00', '293727.27', null, '<p>Hạt Chia: Sản phẩm được cung cấp bởi Thực phẩm an to&agrave;n Sunfood</p>\n<p>Hạt chia c&oacute; nguồn&nbsp;acid b&eacute;o&nbsp;thiết yếu&nbsp;Omega-3&nbsp;vượt trội, h&agrave;m lượng Natri thấp, h&agrave;m lượng protein, chất b&eacute;o, chất xơ v&agrave; chất chống oxy h&oacute;a cao. Hạt c&oacute; h&agrave;m lượng đạm 19-23%, nguồn vitamin B dồi d&agrave;o, canxi cao gấp 6 lần sữa, chất xơ cao gấp 1,6 lần l&uacute;a mạch, nồng độ lipid trong hạt cũng rất cao.</p>', '<p>Hạt Chia: Sản phẩm được cung cấp bởi Thực phẩm an toàn Sunfood</p><p>Hạt chia có nguồn&nbsp;acid béo&nbsp;thiết yếu&nbsp;Omega-3&nbsp;vượt trội, hàm lượng Natri thấp, hàm lượng proteHATin, chất béo, chất xơ và chất chống oxy hóa cao. Hạt có hàm lượng đạm 19-23%, nguồn vitamin B dồi dào, canxi cao gấp 6 lần sữa, chất xơ cao gấp 1,6 lần lúa mạch, nồng độ lipid trong hạt cũng rất cao.</p>', '1', '0', '3663', 'dản phẩm khô,đặc sản,hàng nội địa,thực phẩm đóng hộp', '501', '2018-06-02 17:52:28', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('87', 'Hạt Maca', 'Hat-Maca', '5', '/UploadedFiles/images/productImages/macca_large.jpg', '[\"/UploadedFiles/images/productImages/macca_master.jpg\",\"/UploadedFiles/images/productImages/hat-macadamia-uc-mua-o-dau_master.jpg\",\"/UploadedFiles/images/productImages/14292418_685846644905102_873108392885057831_n_master.jpg\",\"/UploadedFiles/images/productImages/ban-hat-mac-ca-tai-ha-noi-1_master.jpg\"]', '364000.00', '318500.00', '297818.18', null, '<p>Hạt Macca- Sản phẩm được cung cấp bởi Thực phẩm an to&agrave;n Sunfood.</p>', '<p>Hạt Macca - Sản phẩm được cung cấp bởi Thực phẩm an toàn Sunfood.</p>', '1', '0', '18045', 'dản phẩm khô,đặc sản,hàng nội địa,thực phẩm đóng hộp', '506', '2018-06-02 17:52:29', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('88', 'Hạt Sen', 'Hat-Sen', '5', '/UploadedFiles/images/productImages/hat_sen_3a26efff9b1043f887bb42291b94ea6b_large.jpg', '[\"/UploadedFiles/images/productImages/hat_sen_3a26efff9b1043f887bb42291b94ea6b_master.jpg\",\"/UploadedFiles/images/productImages/hat_sen_master.jpg\",\"/UploadedFiles/images/productImages/hatsen_master.jpg\"]', '49000.00', '42875.00', '40090.90', null, '<p>Hạt sen sau khi thu hoạch sẽ được lột vỏ v&agrave; xử l&yacute; vệ sinh. Sau đ&oacute; đưa v&agrave;o buồng Sấy thăng hoa trong m&ocirc;i trường ch&acirc;n kh&ocirc;ng với t&aacute;c nh&acirc;n dầu, cho ra sản phẩm&nbsp;Hạt Sen Sấy&nbsp;vẫn giữ được m&agrave;u sắc tự nhi&ecirc;n, kh&ocirc;ng biến dạng, kh&ocirc;ng caramel h&oacute;a, kh&ocirc;ng bị thấm dầu với độ gi&ograve;n vừa phải v&agrave; hương vị hạt sen vẫn được bảo quản sau khi sấy.</p>', '<p>Hạt sen sau khi thu hoạch sẽ được lột vỏ và xử lý vệ sinh. Sau đó đưa vào buồng Sấy thăng hoa trong môi trường chân không với tác nhân dầu, cho ra sản phẩm&nbsp;Hạt Sen Sấy&nbsp;vẫn giữ được màu sắc tự nhiên, không biến dạng, không caramel hóa, không bị thấm dầu với độ giòn vừa phải và hương vị hạt sen vẫn được bảo quản sau khi sấy.</p><p>Hạt sen cung cấp cho cơ thể những dưỡng chất cần thiết như protit, lipit, gluxit, canxi, photpho, sắt,…</p><p>Hạt sen rất giàu các vitamin B1, vitamin B2, vitamin PP, vitamin C…</p><p>Hàm lượng mỡ bão hòa, natri và cholesterol trong hạt sen rất thấp.</p><p>Hạt sen có tác dụng tăng cường chức năng tỳ vị, đảm bảo dinh dưỡng cho cơ thể, điều hòa sự thu nạp thức ăn.</p><p>bổ sung chất khoáng, chất xơ và đặc biệt phù hợp với chế độ ăn kiêng.</p><p>Ăn hạt sen chữa mất ngủ, thiếu máu, kén ăn, làm đẹp da, chống lão hóa</p><p>Hạt sen còn giàu hàm lượng kaempferol, một chất flavonoid tự nhiên rất hữu ích, có tác dụng ngăn ngừa viêm nhiễm, đặc biệt là tác dụng chống viêm các mô lợi, nhất là ở nhóm người cao niên.</p><p>Sản phẩm nên bảo quản nơi khô ráo, thoáng mát và giữ kín gió khi sử dụng.</p>', '1', '0', '4095', 'dản phẩm khô,đặc sản,hàng nội địa,thực phẩm đóng hộp', '512', '2018-06-02 17:52:29', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('89', 'Hồng sấy dẻo', 'Hong-say-deo', '5', '/UploadedFiles/images/productImages/hong-say-deo_b8bae8f006ee46879e056e3e19e69285_large.jpg', '[\"/UploadedFiles/images/productImages/hong-say-deo_b8bae8f006ee46879e056e3e19e69285_master.jpg\",\"/UploadedFiles/images/productImages/hong-say-deo1_master.jpg\"]', '70000.00', '61250.00', '38181.81', null, '<p>Đặc sản Đ&agrave; Lạt-Hồng sấy dẻo-được cung cấp bởi thực phẩm an to&agrave;n Sunfood.</p>', '<p>Hồng là một trong top 4 loại trái cây được bình chọn là ngon nhất và là sản phẩm độc đáo của vùng đất Đà Lạt.</p><p>Sản phẩm hồng sấy dẻo được làm từ trái hồng cũng là một đặc sản được yêu thích của khách du lịch khi đến Đà Lạt. Có hai loại là hồng sấy nguyên trái và hồng sấy nửa trái (còn gọi là hồng dẻo miếng)</p><p>Để làm ra hồng sấy dẻo, phải chọn lựa những trái hồng thật chín, như vậy khi ăn sẽ không bị chát.</p><p>Hồng được gọt vỏ rửa sạch, để miếng hồng làm ra có màu sắc rất đỏ đẹp, không bị đen.&nbsp;Sau đó trái hồng được đưa vào lò sấy trong nhiều giờ, để hồng được ngon và khô đều người sấy phải thường xuyên lật trái hồng. Tùy theo thời gian sấy sẽ cho ra lò hồng sấy dẻo hay hồng sấy khô đáp ứng nhu cầu của từng khách hàng.</p><p>Sản phẩm được cung cấp bởi Sunfood.</p>', '1', '0', '4527', 'dản phẩm khô,đặc sản,hàng nội địa,thực phẩm đóng hộp', '518', '2018-06-02 17:52:30', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('90', 'Nấm mèo', 'Nam-meo', '5', '/UploadedFiles/images/productImages/nam_meo1_large.jpg', '[\"/UploadedFiles/images/productImages/nam_meo1_master.jpg\",\"/UploadedFiles/images/productImages/nam_meo_master.jpg\",\"/UploadedFiles/images/productImages/nam-meo_master.jpg\",\"/UploadedFiles/images/productImages/nam_meo_f6b696497c6042dda0b8c13dbf805a6e_master.jpg\"]', '308000.00', '269500.00', '168000.00', null, '<p>Nấm m&egrave;o c&ograve;n c&oacute; t&ecirc;n gọi kh&aacute;c l&agrave; nấm mộc nhĩ đen c&oacute; t&ecirc;n khoa học l&agrave; Auricularia auricula-judae. T&ecirc;n nấm m&egrave;o cũng xuất ph&aacute;t từ h&igrave;nh dạng của nấm nh&igrave;n như đ&ocirc;i tai của m&egrave;o n&ecirc;n người d&acirc;n gọi l&agrave; nấm m&egrave;o. Nấm c&oacute; m&agrave;u nẫu sẫm đến đen, nấm m&egrave;o mọc tr&ecirc;n c&aacute;c c&acirc;y th&acirc;n gỗ mục v&agrave;o mua mưa ẩm thấp.&nbsp;<br /> </p>', '<p>Nấm mèo còn có tên gọi khác là nấm mộc nhĩ đen có tên khoa học là Auricularia auricula-judae. Tên nấm mèo cũng xuất phát từ hình dạng của nấm nhìn như đôi tai của mèo nên người dân gọi là nấm mèo. Nấm có màu nẫu sẫm đến đen, nấm mèo mọc trên các cây thân gỗ mục vào mua mưa ẩm thấp.&nbsp;<br> Tai nấm thường được người dân thu hoạch về gác lên dàn bếp hay sấy khô để dùng dần. Vì đặc tính dòn, dai nên rất được chị em nội trợ dùng làm các món gỏi, món canh. Là một nguyên liệu không thể nào thiếu trong các mâm cỗ cưới hỏi và được dùng hàng ngày trong các gia đình Việt Nam.<br> Công dụng khi dùng nấm mèo hay mộc nhĩ<br> Theo đông y&nbsp;mộc nhĩ&nbsp;có tác dụng và đặc tính như sau: nấm có vị ngọt tính bình, đi vào các kinh tỳ vị , đại tràng, can, thận. Nó có tác dụng rất tốt cho cơ thể như làm mát máu, cầm máu trong các trường hợp té ngã bị thương, giúp chữa trị các trường hợp hạ huyết, nhuận trường, trị lỡ và bổ khí…<br> Ngoài ra y học hiện đại còn nghiên cứu&nbsp;nấm mèo&nbsp;cho thấy trong nấm mèo chủ yếu chứa protein, chất béo, lecithin, sphingomyelin, vitamin, canxi, photpho, sắt và các thành phần vô cơ khác nên khi ăn nấm mèo rất tốt cho người có nguy cơ đột quy do tắc vỡ mạch máu ở người cao huyết áp, hạn chế vấn đề tai biến do nhồi máu cơ tim, chậm lão hóa, chống loét, chống nấm.<br> Ngoài ra nấm mộc nhĩ còn được dùng rất nhiều trong ngành ẩm thực như làm các món gỏi, chè, canh… Các món ăn được chế biến với mộc nhĩ đen không chỉ thơm ngon, bổ dưỡng mà còn có công dụng chữa bệnh, bồi bổ sức khỏe hiệu quả.</p>', '1', '0', '18045', 'dản phẩm khô,đặc sản,hàng nội địa,thực phẩm đóng hộp', '524', '2018-06-02 17:52:30', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('91', 'Tỏi cô đơn miền Bắc', 'Toi-co-don-mien-Bac', '5', '/UploadedFiles/images/productImages/toi-co-don1_large.jpg', '[\"/UploadedFiles/images/productImages/toi-co-don1_master.jpg\",\"/UploadedFiles/images/productImages/toi-co-don_master.jpg\",\"/UploadedFiles/images/productImages/toi-co-don2_master.jpg\"]', '170000.00', '148750.00', '46363.63', null, '<p>Tỏi c&ocirc; đơn, tỏi mồ c&ocirc;i hay tỏi một t&eacute;p l&agrave; loại tỏi qu&yacute; ở Việt Nam, được trồng nhiều ở hai địa điểm nổi tiếng l&agrave; Đảo L&yacute; Sơn Quảng Ng&atilde;i v&agrave; huyện Kinh M&ocirc;n Hải Dương</p>', '<p>Tỏi cô đơn, tỏi mồ côi hay tỏi một tép là loại tỏi quý ở Việt Nam, được trồng nhiều ở hai địa điểm nổi tiếng là Đảo Lý Sơn Quảng Ngãi và huyện Kinh Môn Hải Dương và một số tỉnh miền Bắc.<br></p><p>Trong quá trình sinh trưởng và phát triển loại Tỏi này không giống như các loại tỏi thường (một củ có rất nhiều tép) mà mỗi củ Tỏi này chỉ có duy nhất một tép, vì tất cả chất dinh dưỡng của cây Tỏi chỉ tập trung vào một tép một cách tự nhiên, mà những người dân trồng tỏi cũng không thể tác động vào cây Tỏi để cho ra loại Tỏi cô đơn&nbsp; này được, trong một ruộng (rẫy) Tỏi khi thu hoạch thì có rất ít loại Tỏi cô đơn này nên người dân rất quý loại tỏi này bởi lẽ loại tỏi này có công dụng rất đặc biệt so với loại tỏi thường ngoài việc dùng để ăn Tỏi cô đơn còn dùng ngâm rượu để trong nhà làm thuốc gia truyền như các bài thuốc ôn thận tráng dương, bổ khí sinh tinh, tư âm bổ thận, trị cảm cúm - dịch bệnh, đâu lưng nhức mỏi, đổ mồ hôi tay-chân, cao huyết áp, giảm mỡ máu, bộ tiêu hóa yếu ăn khó tiêu, dạ dày, sốt, viêm xoang…Ngoài ra theo truyền thống người dân để tỏi trong nhà hoặc mang theo bên người có thể trừ tà ma và bùa ngãi.</p>', '1', '0', '3525', 'dản phẩm khô,đặc sản,hàng nội địa,thực phẩm đóng hộp', '530', '2018-06-02 17:52:31', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('92', 'Hảo hảo chua cay', 'Hao-hao-chua-cay', '6', '/UploadedFiles/images/productImages/hao_hao_chua_cay_large.jpg', '[\"/UploadedFiles/images/productImages/hao_hao_chua_cay_master.jpg\",\"/UploadedFiles/images/productImages/hao_hao_chua_cay_1_master.jpg\",\"/UploadedFiles/images/productImages/hhcc_master.jpg\"]', '3700.00', '3237.50', '1009.09', null, '<h2>Mì Hảo Hảo chua cay</h2>\n<p>Được chế biến từ bột m&igrave;, tinh bột khoai m&igrave;, muối, đường, chất điều vị, dịch chiết xuất từ c&aacute;, ngh&ecirc;̣&hellip; giúp cho sợi mì được vàng óng tự nhi&ecirc;n, vừa m&ecirc;̀m vừa dai.</p>', '<h2>Mì Hảo Hảo chua cay</h2><p>Được chế biến từ bột mì, tinh bột khoai mì, muối, đường, chất điều vị, dịch chiết xuất từ cá, nghệ… giúp cho sợi mì được vàng óng tự nhiên, vừa mềm vừa dai.</p><p>Thêm vào đó, gói gia vị của sản phẩm còn được bổ sung gia vị (tiêu, ớt, tỏi, rau thơm) tạo nên hương vị chua chua, cay cay hấp dẫn, thơm lừng, kích thích vị giác.</p><p>Mì được&nbsp;sản xuất theo dây chuyền công nghệ hiện đại, tiên tiến của Nhật Bản, đảm bảo an toàn vệ sinh thực phẩm.</p>', '1', '0', '1085', 'dản phẩm khô,đặc sản,hàng nội địa,thực phẩm đóng hộp', '535', '2018-06-02 17:54:00', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('93', 'Hảo Hảo mì xào tôm hành', 'Hao-Hao-mi-xao-tom-hanh', '6', '/UploadedFiles/images/productImages/mi-hao-hao-xao-kho-tom-hanh-1_large.jpg', '[\"/UploadedFiles/images/productImages/mi-hao-hao-xao-kho-tom-hanh-1_master.jpg\",\"/UploadedFiles/images/productImages/mi-hao-hao-xao-kho-tom-hanh-2_master.jpg\",\"/UploadedFiles/images/productImages/mi-hao-hao-xao-kho-tom-hanh-3_master.jpg\"]', '4500.00', '3937.50', '1227.27', null, '<p>M&igrave; Hảo Hảo được chế biến từ bột m&igrave;, tinh bột khoai m&igrave;, muối, đường, chất điều vị, dịch chiết xuất từ cá,&hellip; n&ecirc;n sợi mì được vàng óng tự nhi&ecirc;n, kh&ocirc;ng có ph&acirc;̉m màu, an toàn cho sức khỏe.</p>', '<p>Mì Hảo Hảo được chế biến từ bột mì, tinh bột khoai mì, muối, đường, chất điều vị, dịch chiết xuất từ cá,… nên sợi mì được vàng óng tự nhiên, không có phẩm màu, an toàn cho sức khỏe.</p><p>Thêm vào đó, gói gia vị của sản phẩm còn được bổ sung hành, hành lá sấy, cà rốt sấy cùng với các gia vị khác, tạo nên hương vị thơm ngon, hấp dẫn người dùng.</p><p>Mì được&nbsp;sản xuất theo dây chuyền công nghệ hiện đại, tiên tiến của Nhật Bản, đảm bảo an toàn vệ sinh thực phẩm.</p>', '1', '0', '18045', 'dản phẩm khô,đặc sản,hàng nội địa,thực phẩm đóng hộp', '541', '2018-06-02 17:54:00', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('94', 'Mì A-One thịt xào', 'Mi-A-One-thit-xao', '6', '/UploadedFiles/images/productImages/mi-a-one-thit-xao_large.jpg', '[\"/UploadedFiles/images/productImages/mi-a-one-thit-xao_master.jpg\",\"/UploadedFiles/images/productImages/mi-a-one-thit-xao2_master.jpg\",\"/UploadedFiles/images/productImages/mi-a-one-thit-xao3_master.jpg\"]', '6000.00', '5250.00', '2727.27', null, '<p>Sợi mì A-One được chế biến từ bột m&igrave;, tinh bột khoai m&igrave;, muối, đường, chất chống oxi h&oacute;a,&hellip; n&ecirc;n sợi mì vàng óng tự nhi&ecirc;n, khi nấu ch&iacute;n, sợi m&igrave;&nbsp;trở n&ecirc;n dai gi&ograve;n, đậm đ&agrave;</p>\n<p>Th&ecirc;m vào đó, gói gia vị của sản ph&acirc;̉m còn dầu thực vật, muối, đường, gia vị (bột ti&ecirc;u, bột tỏi, bột ớt), bột hương thịt tự nhi&ecirc;n, bột chiết xuất nấm men, rau sấy kh&ocirc; (đậu n&agrave;nh, c&agrave; rốt, h&agrave;nh l&aacute;, ng&ograve; gai)...</p>', '<p>Sợi mì A-One được chế biến từ bột mì, tinh bột khoai mì, muối, đường, chất chống oxi hóa,… nên sợi mì vàng óng tự nhiên, khi nấu chín, sợi mì&nbsp;trở nên dai giòn, đậm đà</p><p>Thêm vào đó, gói gia vị của sản phẩm còn dầu thực vật, muối, đường, gia vị (bột tiêu, bột tỏi, bột ớt), bột hương thịt tự nhiên, bột chiết xuất nấm men, rau sấy khô (đậu nành, cà rốt, hành lá, ngò gai)...</p><p>Sản phẩm có hương vị thơm ngon của những nguyên liệu tự nhiên được chọn lọc kỹ càng, kích thích vị giác, phù hợp khẩu vị của người Việt Nam.</p><p>Mì được&nbsp;sản xuất theo dây chuyền công nghệ hiện đại, tiên tiến quy trình sản xuất khép kín, đảm bảo an toàn vệ sinh thực phẩm.</p>', '1', '0', '4736', 'dản phẩm khô,đặc sản,hàng nội địa,thực phẩm đóng hộp', '547', '2018-06-02 17:54:01', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('95', 'Mì bò hầm Omachi', 'Mi-bo-ham-Omachi', '6', '/UploadedFiles/images/productImages/mi-omachi-xot-bo-ham_large.jpg', '[\"/UploadedFiles/images/productImages/mi-omachi-xot-bo-ham_master.jpg\",\"/UploadedFiles/images/productImages/mi-omachi-xot-bo-ham2_master.jpg\"]', '7500.00', '6562.50', '3409.09', null, '<p>Sợi m&igrave; Omachi&nbsp;được l&agrave;m từ bột m&igrave; nguy&ecirc;n chất,&nbsp;dầu thực vật, bột l&ograve;ng đỏ trứng,...b&ecirc;n cạnh đ&oacute; c&ograve;n được&nbsp;bổ sung tinh bột&nbsp;khoai t&acirc;y&nbsp;tạo n&ecirc;n sự kh&aacute;c biệt thơm ngon hấp dẫn.</p>', '<p>Sợi mì Omachi&nbsp;được làm từ bột mì nguyên chất,&nbsp;dầu thực vật, bột lòng đỏ trứng,...bên cạnh đó còn được&nbsp;bổ sung tinh bột&nbsp;khoai tây&nbsp;tạo nên sự khác biệt thơm ngon hấp dẫn.</p><p>Gia vị của mì&nbsp;được&nbsp;tinh chế&nbsp;từ&nbsp;bột&nbsp;ớt, bột&nbsp;chanh&nbsp;cùng vị xốt bò hầm&nbsp;tạo&nbsp;nên vị ngọt đậm đà&nbsp;đặc&nbsp;trưng.</p><p>Sản phẩm&nbsp;được dùng&nbsp;để cung cấp năng lượng và chất dinh dưỡng&nbsp;cho mọi người.</p><p>&nbsp;</p>', '1', '0', '12257', 'dản phẩm khô,đặc sản,hàng nội địa,thực phẩm đóng hộp', '553', '2018-06-02 17:54:01', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('96', 'Mì Đệ Nhất', 'Mi-De-Nhat', '6', '/UploadedFiles/images/productImages/mi-de-nhat_large.jpg', '[\"/UploadedFiles/images/productImages/mi-de-nhat_master.jpg\",\"/UploadedFiles/images/productImages/mi-de-nhat-1_master.jpg\",\"/UploadedFiles/images/productImages/mi-de-nhat-vi-3_master.jpg\"]', '7000.00', '6125.00', '6363.63', null, '<p>M&igrave; Đ&ecirc;̣ Nh&acirc;́t được làm từ nguy&ecirc;n li&ecirc;̣u đặc bi&ecirc;̣t là đ&acirc;̣u xanh vì đ&acirc;̣u xanh từ xưa đ&ecirc;́n nay được bi&ecirc;́t đ&ecirc;́n là m&ocirc;̣t thực ph&acirc;̉m t&ocirc;́t cho sức khỏe và sắc vóc của con người. Hi&ecirc;̉u được đi&ecirc;̀u đó, Đ&ecirc;̣ Nh&acirc;́t chọn đ&acirc;̣u xanh trở thành m&ocirc;̣t thành ph&acirc;̀n quan trọng của sợi mì.</p>', '<p><span style=\"font-family: Roboto, sans-serif;\"><span>Mì Đệ Nhất được làm từ nguyên liệu đặc biệt là đậu xanh vì đậu xanh từ xưa đến nay được biết đến là một thực phẩm tốt cho sức khỏe và sắc vóc của con người. Hiểu được điều đó, Đệ Nhất chọn đậu xanh trở thành một thành phần quan trọng của sợi mì.</span></span></p><p><span style=\"font-family: Roboto, sans-serif;\"><span>Cùng với đó, gói gia vị còn được chế biến từ cà chua, thịt heo, hành sấy, bắp sấy,... tạo nên một màu sắc bắt mắt cho bát mì. Thêm vào đó là hương thơm ngây ngút tỏa ra, kích thích vị giác của người dùng.</span></span></p><p>Mì gia Đệ Nhất được sản xuất theo công nghệ hiện đại, tiên tiến, không chứa chất phụ gia, chất bảo quản đảm bảo an toàn cho sức khỏe của gia đình bạn khi chế biến món ăn.</p>', '1', '0', '19841', 'dản phẩm khô,đặc sản,hàng nội địa,thực phẩm đóng hộp', '559', '2018-06-02 17:54:02', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('97', 'Mì gà tím Vifon', 'Mi-ga-tim-Vifon', '6', '/UploadedFiles/images/productImages/mi-ga-tim-1_large.jpg', '[\"/UploadedFiles/images/productImages/mi-ga-tim-1_master.jpg\",\"/UploadedFiles/images/productImages/mi-ga-tim-2_master.jpg\",\"/UploadedFiles/images/productImages/mi-ga-tim-3_master.jpg\"]', '3900.00', '3412.50', '2836.36', null, '<p>Sợi mì Vifon được làm từ những nguy&ecirc;n li&ecirc;̣u chọn lọc: b&ocirc;̣t mì, b&ocirc;̣t khoai mì, d&acirc;̀u thực v&acirc;̣t,... giúp sợi mì được dai ngon hơn.</p>\n<p>Cùng với đó, gói gia vị của Mì gà tím ăn li&ecirc;̀n Vifon còn được b&ocirc;̉ sung th&ecirc;m b&ocirc;̣t thịt gà, hành tím, ti&ecirc;u,... th&ecirc;m đ&acirc;̣m đà, h&acirc;́p d&acirc;̃n hương vị truy&ecirc;̀n thống.</p>', '<p>Mì gà tím Vifon được làm từ những nguyên liệu chọn lọc: bột mì, bột khoai mì, dầu thực vật,... giúp sợi mì được dai ngon hơn.</p><p>Cùng với đó, gói gia vị của Mì gà tím ăn liền Vifon còn được bổ sung thêm bột thịt gà, hành tím, tiêu,... thêm đậm đà, hấp dẫn hương vị truyền thống.</p><p>Sản phẩm được sản xuất trên dây chuyền công nghệ hiện đại, tiên tiến, không sử dụng các hóa chất độc hại.</p>', '1', '0', '3141', 'dản phẩm khô,đặc sản,hàng nội địa,thực phẩm đóng hộp', '565', '2018-06-02 17:54:02', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('98', 'Mì Miliket', 'Mi-Miliket', '6', '/UploadedFiles/images/productImages/mi-miliket_large.jpg', '[\"/UploadedFiles/images/productImages/mi-miliket_master.jpg\",\"/UploadedFiles/images/productImages/mi-miliket1_master.jpg\"]', '3500.00', '3062.50', '2545.45', null, '<p>M&igrave; Miliket được chế biến từ bột m&igrave;, shortening, tinh bột khoai m&igrave; tạo n&ecirc;n những sợi m&igrave; mềm, dai thơm ngon.</p>\n<p>Hương vị t&ocirc;m hấp dẫn c&ugrave;ng gia vị đậm đ&agrave; của&nbsp;muối, đường, dầu cọ tinh luyện&hellip;</p>\n<p>Sản phẩm kh&ocirc;ng sử dụng chất bảo quản v&agrave; cung cấp nhiều năng lượng cho cơ thể.</p>', '<p>Mì Miliket được chế biến từ b<span>ột mì, shortening, tinh bột khoai mì tạo nên những sợi mì mềm, dai thơm ngon.</span></p><p><span>Hương vị tôm hấp dẫn cùng gia vị đậm đà của</span><span>&nbsp;muối, đường, dầu cọ tinh luyện…</span></p><p><span>Sản phẩm không sử dụng chất bảo quản và cung cấp nhiều năng lượng cho cơ thể.</span></p>', '1', '1', '1727', 'dản phẩm khô,đặc sản,hàng nội địa,thực phẩm đóng hộp', '570', '2018-06-02 17:54:03', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('99', 'Mì trứng thượng hạng S', 'mi-trung-thuong-hang-s-', '6', '/UploadedFiles/images/productImages/mi_trung_safaco_vang_large.jpg', '[\"/UploadedFiles/images/productImages/mi_trung_safaco_vang_master.jpg\"]', '25000.00', '21875.00', '18181.81', null, '<p>M&igrave; trứng thượng hạng Safaco nh&atilde;n v&agrave;ng 400g</p>\n<p>- M&oacute;n ăn th&ocirc;ng dụng cho c&aacute;c bữa ăn<br />- Th&iacute;ch hợp chế biến nhiều m&oacute;n ăn ngon<br />- Đảm bảo an to&agrave;n vệ sinh thực phẩm</p>', '<p><span>Mì trứng thượng hạng Safaco nhãn vàng 400g</span></p><p><span>- Món ăn thông dụng cho các bữa ăn</span><br><span>- Thích hợp chế biến nhiều món ăn ngon</span><br><span>- Đảm bảo an toàn vệ sinh thực phẩm</span></p><p><span>Hướng dẫn sử dụng:</span></p><p>Cho các vắt mì vào nước đang sôi, nấu khoảng 1 - 3 phút, thỉnh thoảng đánh tơi vắt mì cho chín mềm đều, đừng nấu chín quá, vớt mì ra, bỏ vào nước lạnh, đánh tơi sợi mì rồi vớt ra để cho ráo nước, trộn mì với một muỗng dầu thực vật để mì không dính cục vào nhau, chế biến thành các món ăn theo ý thích.</p><p>Bảo quản nơi khô ráo, thoáng mát</p><p>Thành phần nguyên liệu: Bột mì, trứng, muối ăn, chất ổn định, màu thực phẩm</p><p>Thương hiệu: Safoco</p>', '1', '0', '19840', 'dản phẩm khô,đặc sản,hàng nội địa,thực phẩm đóng hộp', '576', '2018-06-02 17:54:03', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('100', 'Mì trứng vàng khô Safa', 'mi-trung-vang-kho-safa-', '6', '/UploadedFiles/images/productImages/mi-trung-safoco_500g_large.jpg', '[\"/UploadedFiles/images/productImages/mi-trung-safoco_500g_master.jpg\",\"/UploadedFiles/images/productImages/mi-trung-soi-nho-goi-500g_master.jpg\",\"/UploadedFiles/images/productImages/1458359575326_9791054_master.jpg\"]', '30000.00', '26250.00', '13636.36', null, '<ul>\n<li>Nguy&ecirc;n liệu cao cấp, an to&agrave;n</li>\n<li>Đ&oacute;ng g&oacute;i nhỏ gọn tiện dụng</li>\n<li>Hương vị thơm ngon bổ dưỡng</li>\n</ul>', '<p><strong>Mì trứng Safoco</strong><span>&nbsp;được chế biến từ những nguyên liệu cao cấp nhất, đảm bảo hương vị thơm ngon tự nhiên cho sản phẩm. Mì được sản xuất trên dây chuyền công nghệ hiện đại, khép kín, dưới sự kiểm soát nghiêm ngặt nên tuyệt đối không chứa chất bảo quản hay phẩm màu, rất an toàn cho người sử dụng.&nbsp;Sản phẩm cho sợi mì trứng mềm, dai, mùi thơm hấp dẫn khi chế biến, khiến bạn không thể cưỡng lại. Mì giúp bổ sung các loại vitamin cũng như những dưỡng chất thiết yếu cho cơ thể, giúp bạn chăm sóc chu đáo cho sức khỏe cả gia đình.</span></p><ul><li>Nguyên liệu cao cấp, an toàn</li><li>Đóng gói nhỏ gọn tiện dụng</li><li>Hương vị thơm ngon bổ dưỡng</li></ul><p><strong>Hướng dẫn sử dụng:</strong> cho các vắt mì vào nước sôi, nấu khoảng 1 - 3 phút, thỉnh thoảng đánh tơi vắt mì cho chín mềm đều, đừng nấu chín quá, vớt mì ra, bỏ vào nước lạnh, đánh tơi sợi mì rồi vớt ra để cho ráo nước, cho một muỗng dầu thực vật rồi trộn đều để các sợi mì không dính vào nhau, sau đó dùng làm các món ăn tùy thích</p><p><strong>Hướng dẫn bảo quản</strong> Nơi khô ráo, thoáng mát, tránh ánh nắng trực tiếp</p><p><strong>Thành phần nguyên liệu</strong> Bột mì, trứng (1.5%, đã qua kiểm dịch), muối ăn, chất ổn định, màu thực phẩm tổng hợp…</p><p><strong>Hạn sử dụng</strong> 12 tháng</p><p>&nbsp;</p>', '1', '0', '12257', 'dản phẩm khô,đặc sản,hàng nội địa,thực phẩm đóng hộp', '582', '2018-06-02 17:54:04', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('101', 'Nuti ST tiệt trùng 100', 'nuti-st-tiet-trung-100-', '7', '/UploadedFiles/images/productImages/sua_tuoi_large.jpg', '[\"/UploadedFiles/images/productImages/sua_tuoi_master.jpg\",\"/UploadedFiles/images/productImages/nuti-su-a-tuoi-100-co-duo-ng-110ml-3-org-2_master.jpg\",\"/UploadedFiles/images/productImages/nuti-su-a-tuoi-100-co-duo-ng-110ml-3-org-3_master.jpg\"]', '5500.00', '4812.50', '2499.99', null, '<p>Nuti ST tiệt tr&ugrave;ng 100% C&oacute; Đường 110ml (hộp)- Sản phẩm được cung cấp bởi Thực phẩm an to&agrave;n Sunfood</p>', '<p>Nuti ST tiệt trùng 100% Có Đường 110ml (hộp)- Sản phẩm được cung cấp bởi Thực phẩm an toàn Sunfood</p>', '1', '0', '1378', 'sản phẩm đóng chai,thực phẩm đóng hộp,dản phẩm khô,sản phẩm trưng bày', '588', '2018-06-02 17:54:24', null, null, null, null, null, '1');
