INSERT INTO `products` VALUES ('106', 'Nuvi Cacao Lúa Mạch hộ', 'nuvi-cacao-lua-mach-ho-', '7', '/UploadedFiles/images/productImages/nuvi-cacao-lua-m-ch_80_1_large.jpg', '[\"/UploadedFiles/images/productImages/nuvi-cacao-lua-m-ch_80_1_master.jpg\",\"/UploadedFiles/images/productImages/nuvi-cacao-lua-m-ch_80_3_master.jpg\",\"/UploadedFiles/images/productImages/nuvi-cacao-lua-m-ch_80_5_master.jpg\",\"/UploadedFiles/images/productImages/nuvi-cacao-lua-m-ch_80_7_master.jpg\"]', '5000.00', '4375.00', '3181.81', null, '<p>Thức uống dinh dưỡng&nbsp;<strong>Nuvi Cacao L&uacute;a Mạch</strong>&nbsp;được kết hợp từ sữa, ca cao v&agrave; chiết xuất từ mầm l&uacute;a mạch kh&ocirc;ng chỉ gi&uacute;p ph&aacute;t triển chiều cao, m&agrave; c&ograve;n cung cấp nguồn năng lượng dồi d&agrave;o, tăng cường sức mạnh. H&atilde;y uống Nuvi Cacao L&uacute;a Mạch mỗi ng&agrave;y v&agrave; c&ugrave;ng Nuvi Cacao L&uacute;a Mạch l&agrave;m n&ecirc;n chiến thắng trong học tập v&agrave; thể thao.</p>\n<p>Canxi, Vitamin D, Phốt pho, kẽm gi&uacute;p ph&aacute;t triển chiều cao. Mầm l&uacute;a mạch, c&aacute;c Vitamin nh&oacute;m B cung cấp năng lượng, th&ecirc;m sức mạnh.</p>\n<h3 class=\"title ng-binding\">Nuvi Cacao L&uacute;a Mạch hộp 110ml (hộp) - sản phẩm được cung cấp bởi thực phẩm an to&agrave;n Sunfood.</h3>', '<p><span>Thức uống dinh dưỡng&nbsp;</span><span><strong>Nuvi Cacao Lúa Mạch</strong></span><span>&nbsp;được kết hợp từ sữa, ca cao và chiết xuất từ mầm lúa mạch không chỉ giúp phát triển chiều cao, mà còn cung cấp nguồn năng lượng dồi dào, tăng cường sức mạnh. Hãy uống Nuvi Cacao Lúa Mạch mỗi ngày và cùng Nuvi Cacao Lúa Mạch làm nên chiến thắng trong học tập và thể thao.</span></p><p>Canxi, Vitamin D, Phốt pho, kẽm giúp phát triển chiều cao. Mầm lúa mạch, các Vitamin nhóm B cung cấp năng lượng, thêm sức mạnh.</p><h3 class=\"title ng-binding\"><span style=\"font-size: 11pt;\">Nuvi Cacao Lúa Mạch hộp 110ml (hộp) - sản phẩm được cung cấp bởi thực phẩm an toàn Sunfood.</span></h3>', 