INSERT INTO `products` VALUES ('108', 'Nuvita Có Đường 180ml ', 'nuvita-co-duong-180ml-', '7', '/UploadedFiles/images/productImages/stt-nuvita-cd-ho-p-180ml-1-700x467-1_large.jpg', '[\"/UploadedFiles/images/productImages/stt-nuvita-cd-ho-p-180ml-1-700x467-1_master.jpg\",\"/UploadedFiles/images/productImages/stt-nuvita-cd-ho-p-180ml-1-700x467-2_master.jpg\",\"/UploadedFiles/images/productImages/stt-nuvita-cd-ho-p-180ml-1-700x467-3_master.jpg\"]', '7500.00', '6562.50', '2727.27', null, '<p>Nuvita C&oacute; Đường 180ml (hộp)- Sản phẩm được cung cấp bởi Thực phẩm an to&agrave;n Sunfood.</p>\n<p>&nbsp;</p>', '<p><span>Nuvita Có Đường 180ml (hộp)- Sản phẩm được cung cấp bởi Thực phẩm an toàn Sunfood.</span></p><p><span><br></span></p>', '1', '0', '15815', 'sản phẩm đóng chai,thực phẩm đóng hộp,dản phẩm khô,sản phẩm trưng bày', '629', '2018-06-02 17:54:29', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('109', 'Sữa chua mứt dứa', 'Sua-chua-mut-dua', '7', '/UploadedFiles/images/productImages/sua_chua_large.jpg', '[\"/UploadedFiles/images/productImages/sua_chua_master.jpg\"]', '7500.00', '6562.50', '6136.36', null, '<p>- Cung cấp vitamin A, D3, cacbohyrat, năng lượng.<br />- Được l&ecirc;n men tự nhi&ecirc;n từ chủng men h&agrave;ng đ&acirc;u Ch&acirc;u &Acirc;u.<br />- Kh&ocirc;ng sử dụng chất bảo quản.</p>', '<h2><span>Sữa chua mứt dứa</span></h2><p><span>- Cung cấp vitamin A, D3, cacbohyrat, năng lượng.</span><br><span>- Được lên men tự nhiên từ chủng men hàng đâu Châu Âu.</span><br><span>- Không sử dụng chất bảo quản.</span></p><p><strong>- Giá trị dinh dưỡng trung bình trong 100g:</strong><span>&nbsp;</span>Năng lượng 96,8 Kcal; Đạm: 2,9g; Cacbonhyrat: 15g; Vitamin A: 250IU; Vitamin D3: 60IU; Canxi: 82 mg.</p><p><strong>- Thành phần:</strong><span>&nbsp;</span>Nước, Sữa bò tươi, đường tinh luyện, mứt dứa tươi, sữa bột, chất béo sữa, chất ổn định, vitamin (A, D3); hương liệu tổng hợp dùng cho thực phẩm, màu tự nhiên, chủng men Streptococcus Thermophilus và Lactobacillus Bugaricus.</p><p><strong>- Hướng dẫn sử dụng:</strong><span>&nbsp;Sản phẩm sữa chua dùng ăn trực tiếp ngay khi mở hộp.</span><br><strong>- Hướng dẫn bảo quản:</strong><span>&nbsp;bảo quản lạnh từ 3</span><span>C – 8</span><span>C.</span></p>', '1', '0', '3803', 'sản phẩm đóng chai,thực phẩm đóng hộp,dản phẩm khô,sản phẩm trưng bày', '635', '2018-06-02 17:54:30', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('110', 'Sữa chua Nuti có đường', 'Sua-chua-Nuti-co-duong', '7', '/UploadedFiles/images/productImages/1442025696_chk_591_20150908_8935049005407_1_chon_large.jpg', '[\"/UploadedFiles/images/productImages/1442025696_chk_591_20150908_8935049005407_1_chon_master.jpg\",\"/UploadedFiles/images/productImages/sua_chua_nuti_master.jpg\"]', '6000.00', '5250.00', '4909.09', null, '<p>Sữa Chua Nuti l&agrave; thực phẩm dinh dưỡng từ sữa được tạo ra bằng c&aacute;ch l&ecirc;n men tự nhi&ecirc;n với chủng men Streptococcus thermophilus v&agrave; Lactobacillus bulgaricus. Sản phẩm gi&agrave;u dinh dưỡng, hương vị thơm ngon thanh m&aacute;t, đồng thời mang lại nhiều lợi &iacute;ch sức khỏe như hỗ trợ ti&ecirc;u h&oacute;a tốt, tăng sức đề kh&aacute;ng.</p>', '<p>Sữa Chua Nuti là thực phẩm dinh dưỡng từ sữa được tạo ra bằng cách lên men tự nhiên với chủng men Streptococcus thermophilus và Lactobacillus bulgaricus. Sản phẩm giàu dinh dưỡng, hương vị thơm ngon thanh mát, đồng thời mang lại nhiều lợi ích sức khỏe như hỗ trợ tiêu hóa tốt, tăng sức đề kháng.</p><p>Lợi ích nổi bật: Sữa Chua Giúp Tăng Cường Sức Đề Kháng và Tiêu Hóa Tốt.</p><p>Đóng gói: 04 hộp/block – Khối lượng tịnh 100g/hộp</p><p>&nbsp;</p><p>&nbsp;</p>', '1', '0', '10332', 'sản phẩm đóng chai,thực phẩm đóng hộp,dản phẩm khô,sản phẩm trưng bày', '640', '2018-06-02 17:54:30', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('111', 'Sữa chua Nuti Nha Đam', 'Sua-chua-Nuti-Nha-Dam', '7', '/UploadedFiles/images/productImages/1496202842238_5858417_616ccdf869f549309d8138e2df0a82b8_large.jpg', '[\"/UploadedFiles/images/productImages/1496202842238_5858417_616ccdf869f549309d8138e2df0a82b8_master.jpg\",\"/UploadedFiles/images/productImages/1496202843164_4173950_master.jpg\",\"/UploadedFiles/images/productImages/nutinhadam_master.jpg\"]', '6500.00', '5687.50', '5318.18', null, '<p>Sữa Chua Nuti l&agrave; thực phẩm dinh dưỡng từ sữa được tạo ra bằng c&aacute;ch l&ecirc;n men tự nhi&ecirc;n với chủng men&nbsp;Streptococcus thermophilus&nbsp;v&agrave;&nbsp;Lactobacillus bulgaricus. Sản phẩm gi&agrave;u dinh dưỡng, hương vị thơm ngon thanh m&aacute;t, đồng thời mang lại nhiều lợi &iacute;ch sức khỏe như hỗ trợ ti&ecirc;u h&oacute;a tốt, tăng sức đề kh&aacute;ng...</p>', '<p>Sữa Chua Nuti là thực phẩm dinh dưỡng từ sữa được tạo ra bằng cách lên men tự nhiên với chủng men&nbsp;Streptococcus thermophilus&nbsp;và&nbsp;Lactobacillus bulgaricus. Sản phẩm giàu dinh dưỡng, hương vị thơm ngon thanh mát, đồng thời mang lại nhiều lợi ích sức khỏe như hỗ trợ tiêu hóa tốt, tăng sức đề kháng...</p><p>Sản phẩm&nbsp;Sữa Chua Nuti Nha Đam&nbsp;thơm ngon, nha đam giòn giòn, thanh mát thích hợp cho tất cả các thành viên trong gia đình.&nbsp;Sữa Chua Nuti Nha Đam bổ sung thêm Vitamin A, vitamin D3, Canxi,… giúp đẹp da, chống lão hóa.</p><p>Thực phẩm bổ sung</p><p>- Lợi ích nổi bật: Giúp đẹp da, chống lão hóa.</p>', '1', '0', '17610', 'sản phẩm đóng chai,thực phẩm đóng hộp,dản phẩm khô,sản phẩm trưng bày', '646', '2018-06-02 17:54:31', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('112', 'Sữa chua uống men sống', 'Sua-chua-uong-men-song', '7', '/UploadedFiles/images/productImages/sua_chua_uong_men_song_nuti_large.jpg', '[\"/UploadedFiles/images/productImages/sua_chua_uong_men_song_nuti_master.jpg\",\"/UploadedFiles/images/productImages/s-a-chua-u-ng-men-s-ng-nuti_109_2_master.jpg\"]', '5000.00', '4375.00', '4545.45', null, '<p><strong>Lợi &iacute;ch nổi bật sản phẩm:</strong></p>\n<ul>\n<li>Cung cấp 13 tỷ lợi khuẩn/ mỗi chai 65ml.</li>\n<li>Cải thiện t&igrave;nh trạng rối loạn ti&ecirc;u h&oacute;a.</li>\n<li>Tăng hấp thu dưỡng chất.</li>\n<li>Giảm t&igrave;nh trạng t&aacute;o b&oacute;n.</li>\n</ul>', '<p>Sữa chua uống men sống</p><p>Men sống là nhóm lợi khuẩn có vai trò cân bằng hệ vi sinh đường ruột, giúp cải thiện tình trạng rối loạn tiêu hóa, gia tăng khả năng hấp thu dưỡng chất, tăng cường miễn dịch.</p><p>Sữa chua uống men sống Nuti cung cấp khoảng 20 tỷ lợi khuẩn Lactobacillus paracasie trong 100ml giúp đường ruột khỏe mạnh, hỗ trợ ngăn ngừa táo bón cho gia đình khỏe mạnh mỗi ngày.</p><p><strong>Lợi ích nổi bật sản phẩm:</strong></p><ul><li>Cung cấp 13 tỷ lợi khuẩn/ mỗi chai 65ml.</li><li>Cải thiện tình trạng rối loạn tiêu hóa.</li><li>Tăng hấp thu dưỡng chất.</li><li>Giảm tình trạng táo bón.</li></ul>', '1', '0', '3929', 'sản phẩm đóng chai,thực phẩm đóng hộp,dản phẩm khô,sản phẩm trưng bày', '652', '2018-06-02 17:54:31', null, null, null, null, null, '1');
