INSERT INTO `products` VALUES ('115', 'Sữa đặc Nuti lon đỏ', 'Sua-dac-Nuti-lon-do', '7', '/UploadedFiles/images/productImages/nutilondo-dac_0199a88acb354bd98f215e7faf719091_large.jpg', '[\"/UploadedFiles/images/productImages/nutilondo-dac_0199a88acb354bd98f215e7faf719091_master.jpg\",\"/UploadedFiles/images/productImages/sua-dac-co-duong-nuti-creamer-do-2_master.jpg\",\"/UploadedFiles/images/productImages/sua-dac-co-duong-nuti-creamer-do-3_master.jpg\"]', '20000.00', '17500.00', '12727.27', null, '<p>Sữa đặc c&oacute; đường Nuti đỏ&nbsp;cung cấp năng lượng cho cơ thể, b&ugrave; đắp năng lượng thiếu hụt trong qu&aacute; tr&igrave;nh vận động hằng ng&agrave;y.</p>\n<p>Bổ sung chất đạm gi&uacute;p cơ thể ph&aacute;t triển khỏe mạnh, c&oacute; thể d&ugrave;ng sữa để uống, pha c&agrave; ph&ecirc;, l&agrave;m b&aacute;nh... rất ngon v&agrave; hấp dẫn.</p>\n<p>Được cung cấp bởi Cửa h&agrave;ng thực phẩm an to&agrave;n Sunfood</p>', '<p>Sữa đặc Nuti đỏ lon 380g</p><p>Thương hiệu: Nutifood</p><p>Đặc điểm: ngọt dịu, vị béo kem, sữa</p><p>Cung cấp đạm và năng lượng</p><p>Đóng lon nhỏ, gọn, tiện lợi</p><p>Thương hiệu và sản xuất tại Malaysia</p><p>Thành phần và công dụng:</p><p>Sữa đặc có đường Nuti đỏ&nbsp;cung cấp năng lượng cho cơ thể, bù đắp năng lượng thiếu hụt trong quá trình vận động hằng ngày.</p><p>Bổ sung chất đạm giúp cơ thể phát triển khỏe mạnh, có thể dùng sữa để uống, pha cà phê, làm bánh... rất ngon và hấp dẫn.</p><p>Cách sử dụng:</p><p>Có thể sử dung trực tiếp hoặc dùng để pha chế các món ăn, đồ uống.</p><p>&nbsp;</p>', '1', '0', '10332', 'sản phẩm đóng chai,thực phẩm đóng hộp,dản phẩm khô,sản phẩm trưng bày', '669', '2018-06-02 17:54:46', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('116', 'Sữa đặc Nuti lon xanh', 'Sua-dac-Nuti-lon-xanh', '7', '/UploadedFiles/images/productImages/sua-dac-co-duong-nuti-creamer-xanh1_75fc1fb27a114737a029c6cad3c5308b_large.jpg', '[\"/UploadedFiles/images/productImages/sua-dac-co-duong-nuti-creamer-xanh1_75fc1fb27a114737a029c6cad3c5308b_master.jpg\",\"/UploadedFiles/images/productImages/sua-dac-co-duong-nuti-creamer-xanh-2_master.jpg\",\"/UploadedFiles/images/productImages/sua-dac-co-duong-nuti-creamer-xanh-3_master.jpg\"]', '20000.00', '17500.00', '12727.27', null, '<p>Sữa đặc c&oacute; đường Nuti xanh cung cấp năng lượng cho cơ thể, b&ugrave; đắp năng lượng thiếu hụt trong qu&aacute; tr&igrave;nh vận động hằng ng&agrave;y.</p>\n<p>Bổ sung chất đạm gi&uacute;p cơ thể ph&aacute;t triển khỏe mạnh, c&oacute; thể d&ugrave;ng sữa để uống, pha c&agrave; ph&ecirc;, l&agrave;m b&aacute;nh... rất ngon v&agrave; hấp dẫn.</p>', '<p>Sữa đặc Nuti xanh lon 380g</p><p>Thương hiệu: Nutifood</p><p>Đặc điểm: ngọt dịu, vị béo kem, sữa</p><p>Cung cấp đạm và năng lượng</p><p>Đóng lon nhỏ, gọn, tiện lợi</p><p>Thương hiệu và sản xuất tại Malaysia</p><p>Thành phần và công dụng:</p><p>Sữa đặc có đường Nuti xanh cung cấp năng lượng cho cơ thể, bù đắp năng lượng thiếu hụt trong quá trình vận động hằng ngày.</p><p>Bổ sung chất đạm giúp cơ thể phát triển khỏe mạnh, có thể dùng sữa để uống, pha cà phê, làm bánh... rất ngon và hấp dẫn.</p><p>Cách sử dụng:</p><p>Có thể sử dung trực tiếp hoặc dùng để pha chế các món ăn, đồ uống.</p>', '1', '0', '2145', 'sản phẩm đóng chai,thực phẩm đóng hộp,dản phẩm khô,sản phẩm trưng bày', '675', '2018-06-02 17:54:46', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('117', 'Sữa tươi Nuti Socola t', 'sua-tuoi-nuti-socola-t-', '7', '/UploadedFiles/images/productImages/socola-nuti_large.png', '[\"/UploadedFiles/images/productImages/socola-nuti_master.png\"]', '5500.00', '4812.50', '3500.00', null, '<p>Sản phẩm được cung cấp bởi thực phẩm an to&agrave;n Sunfood</p>', '<p><span>Sữa tươi Nuti Socola tiệt trùng 100% 110ml - sản phẩm được cung cấp bởi thực phẩm an toàn Sunfood.</span></p>', '1', '0', '17609', 'sản phẩm đóng chai,thực phẩm đóng hộp,dản phẩm khô,sản phẩm trưng bày', '681', '2018-06-02 17:54:47', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('118', '7 up chai 390ml', '7-up-chai-390ml', '8', '/UploadedFiles/images/productImages/7up_chai_large.jpg', '[\"/UploadedFiles/images/productImages/7up_chai_master.jpg\",\"/UploadedFiles/images/productImages/7_up_chai_master.jpg\",\"/UploadedFiles/images/productImages/7up_chai_nho_master.jpg\"]', '8000.00', '7000.00', '5090.90', null, '<p>Thương hiệu Pepsi</p>\n<p>Nước ngọt c&oacute; gas the m&aacute;t</p>\n<p>Xua tan cơn kh&aacute;t nhanh ch&oacute;ng</p>\n<p>Hương chanh tự nhi&ecirc;n, m&aacute;t lạnh</p>\n<p>Vitamin C cho cơ thể khỏe khoắn</p>\n<p>Sản xuất tại Việt Nam</p>', '<ul><li><p>Thương hiệu Pepsi</p><p>Nước ngọt có gas the mát</p><p>Xua tan cơn khát nhanh chóng</p><p>Hương chanh tự nhiên, mát lạnh</p><p>Vitamin C cho cơ thể khỏe khoắn</p><p>Sản xuất tại Việt Nam</p><p>&nbsp;</p><p>Thành phần chủ yếu:&nbsp;nước bão hòa CO2, đường mía, chất điều chỉnh độ acid, hương chanh tự nhiên...</p><p>Với vị ngọt vừa phải và hương vị chanh the mát, nước giải khát có gas 7 Up&nbsp;giúp bạn xua tan nhanh chóng cơn khát hay giảm cảm giác ngấy nếu ăn nhiều đồ đạm trong các bữa tiệc.&nbsp;</p><p>Chứa nhiều vitamin C cho cơ thể khỏe khoắn và tinh thần luôn tươi vui mỗi ngày.&nbsp;Sản phẩm được đóng chai&nbsp;tiện dụng, dễ dàng mang theo trong các chuyến dã ngoại hay các buổi luyện tập thể thao.</p><p>Hướng dẫn sử dụng:</p><p>Dùng trực tiếp, ngon hơn khi uống lạnh</p><p>&nbsp;</p></li></ul>', '1', '0', '4362', 'sản phẩm đóng chai,thực phẩm đóng hộp,dản phẩm khô,sản phẩm trưng bày', '687', '2018-06-02 17:55:11', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('119', '7 up lon 330ml', '7-up-lon-330ml', '8', '/UploadedFiles/images/productImages/7up_lon_24_large.jpg', '[\"/UploadedFiles/images/productImages/7up_lon_24_master.jpg\",\"/UploadedFiles/images/productImages/7up-sleek-lon-330ml-th24-3-1_master.jpg\"]', '11000.00', '9625.00', '9000.00', null, '<p>Thương hiệu Pepsi</p>\n<p>Nước ngọt c&oacute; ga m&aacute;t lạnh</p>\n<p>Xua tan cơn kh&aacute;t nhanh ch&oacute;ng</p>\n<p>Vị chanh tự nhi&ecirc;n, m&aacute;t lạnh</p>\n<p>Vitamin C cho cơ thể khỏe khoắn</p>\n<p>Sản xuất tại Việt Nam</p>', '<p>Thương hiệu Pepsi</p><p>Nước ngọt có ga mát lạnh</p><p>Xua tan cơn khát nhanh chóng</p><p>Vị chanh tự nhiên, mát lạnh</p><p>Vitamin C cho cơ thể khỏe khoắn</p><p>Sản xuất tại Việt Nam</p><p>&nbsp;</p><p>Thành phần chủ yếu:&nbsp;nước bão hòa CO2, đường mía, chất điều chỉnh độ acid, hương chanh tự nhiên,...</p><p>Với vị ngọt vừa phải và hương vị chanh the mát, nước giải khát có ga 7 Up&nbsp;giúp bạn xua tan nhanh chóng cơn khát hay giảm cảm giác ngấy nếu ăn nhiều đồ đạm trong các bữa tiệc.&nbsp;</p><p>Chứa nhiều vitamin C cho cơ thể khỏe khoắn và tinh thần luôn tươi vui mỗi ngày.&nbsp;Sản phẩm được đóng chai&nbsp;tiện dụng, dễ dàng mang theo trong các chuyến dã ngoại hay các buổi luyện tập thể thao.</p><p>Hướng dẫn sử dụng:</p><p>Dùng trực tiếp.</p><p>Ngon hơn khi uống lạnh.</p><p>&nbsp;</p>', '1', '0', '1143', 'sản phẩm đóng chai,thực phẩm đóng hộp,dản phẩm khô,sản phẩm trưng bày', '693', '2018-06-02 17:55:12', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('120', 'Mirinda cam', 'Mirinda-cam', '8', '/UploadedFiles/images/productImages/mirinda-cam-390_large.jpg', '[\"/UploadedFiles/images/productImages/mirinda-cam-390_master.jpg\",\"/UploadedFiles/images/productImages/mirinda-cam-390-1_master.jpg\",\"/UploadedFiles/images/productImages/mirinda-cam-390-2_master.jpg\"]', '8000.00', '7000.00', '4363.63', null, '<p>Thương hiệu Pepsi</p>\n<p>Nước ngọt c&oacute; ga</p>\n<p>Giải kh&aacute;t v&agrave; b&ugrave; năng lượng</p>\n<p>Vị cam thơm ngon đặc trưng</p>\n<p>Kh&ocirc;ng chứa chất bảo quản</p>\n<p>Thiết kế chai tiện dụng</p>', '<p>Thương hiệu Pepsi</p><p>Nước ngọt có ga</p><p>Giải khát và bù năng lượng</p><p>Vị cam thơm ngon đặc trưng</p><p>Không chứa chất bảo quản</p><p>Thiết kế chai tiện dụng</p><p><strong>Thành phần và công dụng:</strong></p><p>Với thành phần nước bão hòa CO2, chất điều chỉnh độ axit, đường mía, hương xá xị tổng hợp, màu thực phẩm.</p><p>Được sản xuất trên dây chuyền hiện đại, không chứa chất bảo quản và hóa chất độc hại cho người sử dụng, bạn có thể hoàn toàn yên tâm về chất lượng sản phẩm.</p><p>Hương vị cam đặc trưng,&nbsp;không chỉ giải khát,&nbsp;mà còn giúp bạn lấy lại năng lượng cho hoạt động hàng ngày.</p><p>Thiết kế chai 390ml nhỏ tiện dụng, sản phẩm có thể mang theo trong những buổi tập thể thao hay những chuyến vui chơi, dã ngoại ngoài trời đều phù hợp.&nbsp;</p><p>&nbsp;</p>', '1', '1', '16791', 'sản phẩm đóng chai,thực phẩm đóng hộp,dản phẩm khô,sản phẩm trưng bày', '699', '2018-06-02 17:55:13', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('121', 'Mirinda cam 1.5 lít', 'Mirinda-cam-1-5-lit', '8', '/UploadedFiles/images/productImages/mirinda-cam-1.5l_large.jpg', '[\"/UploadedFiles/images/productImages/mirinda-cam-1.5l_master.jpg\",\"/UploadedFiles/images/productImages/mirinda-cam-1.5l1_master.jpg\"]', '22000.00', '19250.00', '12000.00', null, '<p>Nước ngọt Mirinda hương Cam chai 1,5l&iacute;t được sản xuất tr&ecirc;n d&acirc;y chuyền hiện đại, kh&ocirc;ng chứa chất bảo quản v&agrave; h&oacute;a chất độc hại cho người sử dụng, bạn c&oacute; thể ho&agrave;n to&agrave;n y&ecirc;n t&acirc;m về chất lượng sản phẩm.</p>\n<p>Hương vị cam đặc trưng,&nbsp;kh&ocirc;ng chỉ giải kh&aacute;t,&nbsp;m&agrave; c&ograve;n gi&uacute;p bạn lấy lại năng lượng cho hoạt động h&agrave;ng ng&agrave;y.</p>', '<p>Nước ngọt Mirinda hương Cam chai 1,5lít được sản xuất trên dây chuyền hiện đại, không chứa chất bảo quản và hóa chất độc hại cho người sử dụng, bạn có thể hoàn toàn yên tâm về chất lượng sản phẩm.</p><p>Hương vị cam đặc trưng,&nbsp;không chỉ giải khát,&nbsp;mà còn giúp bạn lấy lại năng lượng cho hoạt động hàng ngày.</p><p>Vỏ chai được sản xuất từ nguyên liệu sạch thân thiện với môi trường, giúp bảo quản nước giữ nguyên mùi vị mà không sợ hư hỏng.&nbsp;</p><p>Hướng dẫn sử dụng:</p><p>Dùng trực tiếp, ngon hơn khi uống lạnh.</p><p>&nbsp;</p>', '1', '0', '2228', 'sản phẩm đóng chai,thực phẩm đóng hộp,dản phẩm khô,sản phẩm trưng bày', '704', '2018-06-02 17:55:13', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('122', 'Mirinda xá xị chai nhỏ', 'Mirinda-xa-xi-chai-nho', '8', '/UploadedFiles/images/productImages/mirinda_large.jpg', '[\"/UploadedFiles/images/productImages/mirinda_master.jpg\",\"/UploadedFiles/images/productImages/mirinda-xaxi_master.jpg\"]', '8000.00', '7000.00', '4363.63', null, '<p>Thương hiệu Pepsi</p>\n<p>Nước ngọt c&oacute; ga</p>\n<p>Giải kh&aacute;t, hỗ trợ ti&ecirc;u h&oacute;a</p>\n<p>Hương x&aacute; xị thơm nồng</p>\n<p>Thiết kế chai tiện dụng</p>\n<p>An to&agrave;n cho sức khỏe người d&ugrave;ng</p>', '<p>Thương hiệu Pepsi</p><p>Nước ngọt có ga</p><p>Giải khát, hỗ trợ tiêu hóa</p><p>Hương xá xị thơm nồng</p><p>Thiết kế chai tiện dụng</p><p>An toàn cho sức khỏe người dùng</p><p>Thành phần và công dụng:</p><p>Với thành phần nước bão hòa&nbsp;CO2, chất điều chỉnh độ axit, đường mía, hương xá xị tổng hợp, màu thực phẩm</p><p>Sản phẩm có hương xá xị tự nhiên, độc đáo giúp bạn giải nhanh cơn khát, đầy hơi khi dùng nhiều dầu mỡ. Nước ngọt hương xá xị với vị ga nhẹ là thức uống giải khát tuyệt vời dành cho mọi lứa tuổi.</p><p>Được sản xuất trên dây chuyền công nghệ hiện đại, đảm bảo vệ sinh, an toàn cho sức khỏe người tiêu dùng.</p><p>Sản phẩm được đóng chai 390ml nhỏ dễ dàng sử dụng trong gia đình cũng như mang theo trong các chuyến dã ngoại.</p><p>&nbsp;</p>', '1', '0', '3010', 'sản phẩm đóng chai,thực phẩm đóng hộp,dản phẩm khô,sản phẩm trưng bày', '710', '2018-06-02 17:55:14', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('123', 'Mirinda xá xị lon 330ml', 'Mirinda-xa-xi-lon-330ml', '8', '/UploadedFiles/images/productImages/mirinda-xa-xi330ml_large.jpg', '[\"/UploadedFiles/images/productImages/mirinda-xa-xi330ml_master.jpg\",\"/UploadedFiles/images/productImages/mirinda-xa-xi330m1_master.jpg\"]', '10000.00', '8750.00', '2727.27', null, '<p>Thương hiệu Pepsi</p>\n<p>Nước ngọt c&oacute; gas</p>\n<p>D&ugrave;ng để giải kh&aacute;t nhanh ch&oacute;ng</p>\n<p>Hương x&aacute; xị thơm nồng</p>\n<p>Thiết kế lon đẹp mắt, tiện dụng</p>\n<p>Sản xuất tại Việt Nam</p>\n<p>Sản phẩm c&oacute; hương x&aacute; xị tự nhi&ecirc;n, độc đ&aacute;o gi&uacute;p bạn giải nhanh cơn kh&aacute;t, &nbsp;với vị gas nhẹ l&agrave; thức uống giải kh&aacute;t tuyệt vời d&agrave;nh cho mọi lứa tuổi.</p>\n<p>Được sản xuất tr&ecirc;n d&acirc;y chuyền c&ocirc;ng nghệ hiện đại, đảm bảo vệ sinh, an to&agrave;n cho sức khỏe người ti&ecirc;u d&ugrave;ng.</p>\n<p>Sản phẩm được đ&oacute;ng lon nhỏ dễ d&agrave;ng sử dụng trong gia đ&igrave;nh cũng như mang theo trong c&aacute;c chuyến d&atilde; ngoại.</p>\n<p>Hướng dẫn sử dụng:</p>\n<p>D&ugrave;ng trực tiếp sau khi khui lon, ngon hơn khi uống lạnh.</p>\n<p>&nbsp;</p>', '<p>Thương hiệu Pepsi</p><p>Nước ngọt có gas</p><p>Dùng để giải khát nhanh chóng</p><p>Hương xá xị thơm nồng</p><p>Thiết kế lon đẹp mắt, tiện dụng</p><p>Sản xuất tại Việt Nam</p><p>Sản phẩm có hương xá xị tự nhiên, độc đáo giúp bạn giải nhanh cơn khát, &nbsp;với vị gas nhẹ là thức uống giải khát tuyệt vời dành cho mọi lứa tuổi.</p><p>Được sản xuất trên dây chuyền công nghệ hiện đại, đảm bảo vệ sinh, an toàn cho sức khỏe người tiêu dùng.</p><p>Sản phẩm được đóng lon nhỏ dễ dàng sử dụng trong gia đình cũng như mang theo trong các chuyến dã ngoại.</p><p>Hướng dẫn sử dụng:</p><p>Dùng trực tiếp sau khi khui lon, ngon hơn khi uống lạnh.</p><p>&nbsp;</p>', '1', '0', '16793', 'sản phẩm đóng chai,thực phẩm đóng hộp,dản phẩm khô,sản phẩm trưng bày', '716', '2018-06-02 17:55:14', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('124', 'Moutain Dew chai 390ml', 'Moutain-Dew-chai-390ml', '8', '/UploadedFiles/images/productImages/nuoc-mountain-dew-390_large.jpg', '[\"/UploadedFiles/images/productImages/nuoc-mountain-dew-390_master.jpg\",\"/UploadedFiles/images/productImages/nuoc-mountain-dew-chai3901_master.jpg\"]', '9000.00', '7875.00', '2454.54', null, '<p>Nước ngọt Mountain DEW c&oacute; gas với vị citrus mạnh mẽ mang tới cảm gi&aacute;c sảng kho&aacute;i cho những bạn trẻ y&ecirc;u th&iacute;ch phi&ecirc;u lưu, lu&ocirc;n t&igrave;m kiếm niềm vui v&agrave; sự phấn kh&iacute;ch.</p>\n<p>Sử dụng những hương liệu chiết xuất từ thi&ecirc;n nhi&ecirc;n, pha chế theo c&ocirc;ng thức ri&ecirc;ng biệt đồng thời được sản xuất tr&ecirc;n d&acirc;y chuyền c&ocirc;ng nghệ hiện đại, đảm bảo vệ sinh an to&agrave;n thực phẩm gi&uacute;p bạn ho&agrave;n to&agrave;n an t&acirc;m khi sử dụng.</p>', '<p>Nước ngọt Mountain DEW có gas với vị citrus mạnh mẽ mang tới cảm giác sảng khoái cho những bạn trẻ yêu thích phiêu lưu, luôn tìm kiếm niềm vui và sự phấn khích.</p><p>Sử dụng những hương liệu chiết xuất từ thiên nhiên, pha chế theo công thức riêng biệt đồng thời được sản xuất trên dây chuyền công nghệ hiện đại, đảm bảo vệ sinh an toàn thực phẩm giúp bạn hoàn toàn an tâm khi sử dụng.</p><p>Được sản xuất trên dây chuyền công nghệ hiện đại, đảm bảo vệ sinh an toàn thực phẩm, sản phẩm được rất nhiều người tiêu dùng tin tưởng và sử dụng.</p><p>&nbsp;</p>', '1', '0', '2354', 'sản phẩm đóng chai,thực phẩm đóng hộp,dản phẩm khô,sản phẩm trưng bày', '722', '2018-06-02 17:55:14', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('125', 'Nước ép nguyên chất', 'Nuoc-ep-nguyen-chat', '8', '/UploadedFiles/images/productImages/nuoc_ep_sunfood_large.jpg', '[\"/UploadedFiles/images/productImages/nuoc_ep_sunfood_master.jpg\",\"/UploadedFiles/images/productImages/f6663712f1791d274468_master.jpg\"]', '20000.00', '17500.00', '5454.54', null, '', '<p>Nước ép nguyên chất các loại.</p><p>Sản phẩm được sản xuất và cung cấp bởi Sunfood.</p>', '1', '0', '12842', 'sản phẩm đóng chai,thực phẩm đóng hộp,dản phẩm khô,sản phẩm trưng bày', '728', '2018-06-02 17:55:15', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('126', 'Nước ngọt Mirinda hươn', 'nuoc-ngot-mirinda-huon-', '8', '/UploadedFiles/images/productImages/mirinda-xaxi-15l_large.jpg', '[\"/UploadedFiles/images/productImages/mirinda-xaxi-15l_master.jpg\",\"/UploadedFiles/images/productImages/mirinda-xaxi-15l1_master.jpg\",\"/UploadedFiles/images/productImages/mirinda-xaxi-15l-5-700x467-1_master.jpg\"]', '22000.00', '19250.00', '7999.99', null, '<p>Thương hiệu Pepsi</p>\n<p>Nước ngọt c&oacute; ga giải kh&aacute;t</p>\n<p>Giải kh&aacute;t, hỗ trợ ti&ecirc;u h&oacute;a</p>\n<p>Vị x&aacute; xị thơm nồng</p>\n<p>Thiết kế chai tiện dụng</p>\n<p>An to&agrave;n cho sức khỏe người d&ugrave;ng</p>', '<p>Thương hiệu Pepsi</p><p>Nước ngọt có ga giải khát</p><p>Giải khát, hỗ trợ tiêu hóa</p><p>Vị xá xị thơm nồng</p><p>Thiết kế chai tiện dụng</p><p>An toàn cho sức khỏe người dùng</p><p>Thành phần nước bão hòa&nbsp;CO2, chất điều chỉnh độ axit, đường mía, hương xá xị tổng hợp, màu thực phẩm</p><p>Sản phẩm có hương xá xị tự nhiên, độc đáo giúp bạn giải nhanh cơn khát,hỗ trợ đầy hơi khi dùng nhiều dầu mỡ. Nước ngọt hương xá xị Mirinda với vị ga nhẹ là thức uống giải khát tuyệt vời dành cho mọi lứa tuổi.</p><p>Được sản xuất trên dây chuyền công nghệ hiện đại, đảm bảo vệ sinh, an toàn cho sức khỏe người tiêu dùng.</p><p>Sản phẩm được đóng chai 1.5 lít dễ dàng sử dụng trong gia đình cũng như mang theo trong các chuyến dã ngoại.</p><p>&nbsp;</p>', '1', '0', '18586', 'sản phẩm đóng chai,thực phẩm đóng hộp,dản phẩm khô,sản phẩm trưng bày', '734', '2018-06-02 17:55:15', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('127', 'Nước uống tinh khiết A', 'nuoc-uong-tinh-khiet-a-', '8', '/UploadedFiles/images/productImages/nuoc-suoi-aquafina-15-l-1_516754c6fd584be085e4c30bfda9b405_large.jpg', '[\"/UploadedFiles/images/productImages/nuoc-suoi-aquafina-15-l-1_516754c6fd584be085e4c30bfda9b405_master.jpg\",\"/UploadedFiles/images/productImages/nuoc-suoi-aquafina-15-l-1_master.jpg\",\"/UploadedFiles/images/productImages/nuoc-suoi-aquafina-15-l-2_master.jpg\"]', '11000.00', '9625.00', '3999.99', null, '<p>Nước tinh khiết Aquafina chai 1,5l&iacute;t</p>\n<p>Thương hiệu Pepsi</p>\n<p>Hương vị nước tinh khiết</p>\n<p>Nguồn nước ngầm chất lượng cao</p>\n<p>D&ugrave;ng để giải kh&aacute;t, bổ sung nước</p>', '<p>Nước tinh khiết Aquafina chai 1,5lít</p><p>Thương hiệu Pepsi</p><p>Hương vị nước tinh khiết</p><p>Nguồn nước ngầm chất lượng cao</p><p>Dùng để giải khát, bổ sung nước</p><p>Giúp điều chỉnh nhiệt độ cơ thể</p><p>Sản xuất tại Việt Nam</p><p>Thành phần và công dụng:</p><p>Nước tinh khiết Aquafina là nước tinh khiết được xử lý qua hệ thống thẩm thấu ngược và ozon, thanh trùng bằng tia cực tím.</p><p>Được khai thác và đóng chai&nbsp;trên dây chuyền công nghệ hiện đại, đảm bảo giữ độ tinh khiết cao mà vẫn chứa các khoáng chất tốt cho sức khỏe.</p><p>Sản phẩm đóng chai tiện lợi, giúp bạn bổ sung nước và khoáng chất nhanh chóng.</p><p>&nbsp;</p>', '1', '0', '3790', 'sản phẩm đóng chai,thực phẩm đóng hộp,dản phẩm khô,sản phẩm trưng bày', '739', '2018-06-02 17:55:16', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('128', 'Nước uống tinh khiết A', 'nuoc-uong-tinh-khiet-a-', '8', '/UploadedFiles/images/productImages/aquafina-500ml_3f49649d3bbd447c992c61f59389889e_large.jpg', '[\"/UploadedFiles/images/productImages/aquafina-500ml_3f49649d3bbd447c992c61f59389889e_master.jpg\",\"/UploadedFiles/images/productImages/aquafina-500m3_master.jpg\",\"/UploadedFiles/images/productImages/aquafina-500ml2_master.jpg\"]', '5000.00', '4375.00', '1818.18', null, '<p>Nước tinh khiết Aquafina chai 500ml</p>\n<p>Thương hiệu Pepsi</p>\n<p>Hương vị nước tinh khiết</p>\n<p>Nguồn nước ngầm chất lượng cao</p>\n<p>D&ugrave;ng để giải kh&aacute;t, bổ sung nước</p>\n<p>Gi&uacute;p điều chỉnh nhiệt độ cơ thể</p>', '<p>Nước tinh khiết Aquafina chai 500ml</p><p>Thương hiệu Pepsi</p><p>Hương vị nước tinh khiết</p><p>Nguồn nước ngầm chất lượng cao</p><p>Dùng để giải khát, bổ sung nước</p><p>Giúp điều chỉnh nhiệt độ cơ thể</p><p>Sản xuất tại Việt Nam</p><p>Thành phần và công dụng:</p><p>Nước tinh khiết Aquafina là nước tinh khiết được xử lý qua hệ thống thẩm thấu ngược và ozon, thanh trùng bằng tia cực tím.</p><p>Được khai thác và đóng chai&nbsp;trên dây chuyền công nghệ hiện đại, đảm bảo giữ độ tinh khiết cao mà vẫn chứa các khoáng chất tốt cho sức khỏe.</p><p>Sản phẩm đóng chai tiện lợi, giúp bạn bổ sung nước và khoáng chất nhanh chóng.</p><p>&nbsp;</p>', '1', '0', '1225', 'sản phẩm đóng chai,thực phẩm đóng hộp,dản phẩm khô,sản phẩm trưng bày', '745', '2018-06-02 17:55:16', null, null, null, null, null, '1');
