INSERT INTO `products` VALUES ('130', 'Pepsi lon thường 330ml', 'Pepsi-lon-thuong-330ml', '8', '/UploadedFiles/images/productImages/pepsi_330ml_large.jpg', '[\"/UploadedFiles/images/productImages/pepsi_330ml_master.jpg\",\"/UploadedFiles/images/productImages/pepsi_330ml2_master.jpg\",\"/UploadedFiles/images/productImages/pepsi_330ml3_master.jpg\",\"/UploadedFiles/images/productImages/pepsi1_330ml_master.jpg\"]', '11000.00', '9625.00', '9000.00', null, '<ul>\n<li class=\"pad\">Nước ngọt c&oacute; ga</li>\n<li class=\"pad\">Gi&uacute;p giải tỏa cơn kh&aacute;t tức th&igrave;</li>\n<li class=\"pad\">Hương vị đặc trưng, hấp dẫn</li>\n<li class=\"pad\">Cung cấp th&ecirc;m năng lượng trong ng&agrave;y</li>\n<li class=\"pad\">Sản xuất tại Việt Nam</li>\n<li class=\"pad\">Pepsi l&agrave; thương hiệu của Mỹ</li>\n<li class=\"pad\">Dung t&iacute;ch 330ml</li>\n</ul>', '<ul><li class=\"pad\">Nước ngọt có ga</li><li class=\"pad\">Giúp giải tỏa cơn khát tức thì</li><li class=\"pad\">Hương vị đặc trưng, hấp dẫn</li><li class=\"pad\">Cung cấp thêm năng lượng trong ngày<br></li><li class=\"pad\">Sản xuất tại Việt Nam</li><li class=\"pad\">Pepsi là thương hiệu của Mỹ</li><li class=\"pad\">Dung tích 330ml</li></ul>', '1', '0', '12842', 'sản phẩm đóng chai,thực phẩm đóng hộp,dản phẩm khô,sản phẩm trưng bày', '757', '2018-06-02 17:55:27', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('131', 'Revive chai 500ml', 'Revive-chai-500ml', '8', '/UploadedFiles/images/productImages/7up-revive-500ml_large.jpg', '[\"/UploadedFiles/images/productImages/7up-revive-500ml_master.jpg\",\"/UploadedFiles/images/productImages/7up-revive-500ml-1_master.jpg\",\"/UploadedFiles/images/productImages/7up-revive-500ml-3_master.jpg\"]', '10000.00', '8750.00', '5454.54', null, '<p>Revive chai 500ml</p>\n<p>Nước ngọt c&oacute; ga giải kh&aacute;t</p>\n<p>Cung cấp năng lượng, chất điện giải</p>\n<p>Vị ngọt dịu, sảng kho&aacute;i</p>\n<p>Bổ sung vitamin B3, B6, B12</p>\n<p>Sản xuất tại Việt Nam</p>', '<p>Revive chai 500ml</p><p>Nước ngọt có ga giải khát</p><p>Cung cấp năng lượng, chất điện giải</p><p>Vị ngọt dịu, sảng khoái</p><p>Bổ sung vitamin B3, B6, B12</p><p>Sản xuất tại Việt Nam</p><p>Sản phẩm được sản xuất trên dây chuyền hiện đại chiết xuất từ nước bão hòa CO2, đường sucrose và destrose, chất điều chỉnh độ axit, chất điện giải... không chứa chất bảo quản và hóa chất độc hại, an toàn cho người sử dụng.</p><p>Với chất điện giải Natri, Kali và vitamin B3, B6, B12 giúp bù nước,&nbsp;muối khoáng bị mất đi nhanh chóng&nbsp;do vận động, chơi thể thao.</p>', '1', '0', '1225', 'sản phẩm đóng chai,thực phẩm đóng hộp,dản phẩm khô,sản phẩm trưng bày', '763', '2018-06-02 17:55:27', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('132', 'Revive chanh muối 390ml', 'Revive-chanh-muoi-390ml', '8', '/UploadedFiles/images/productImages/7up-revive-chanh-muoi-chai-390ml-2_large.jpg', '[\"/UploadedFiles/images/productImages/7up-revive-chanh-muoi-chai-390ml-2_master.jpg\",\"/UploadedFiles/images/productImages/7up-revive-chanh-muoi-chai-390ml_master.jpg\",\"/UploadedFiles/images/productImages/7up-revive-chanh-muoi-chai-390ml-3_master.jpg\"]', '9000.00', '7875.00', '4909.09', null, '<p>Nước ngọt Revive hương Chanh muối chai 390ml</p>\n<p>Thương hiệu Pepsi</p>\n<p>Nước ngọt c&oacute; ga giải kh&aacute;t</p>\n<p>B&ugrave; đắp lượng muối kho&aacute;ng, vi chất</p>\n<p>Hương vị sảng kho&aacute;i</p>\n<p>Sản xuất tại Việt Nam</p>\n<p>Revive l&agrave; nh&atilde;n hiệu của Pesico</p>', '<p>Nước ngọt Revive hương Chanh muối chai 390ml</p><p>Thương hiệu Pepsi</p><p>Nước ngọt có ga giải khát</p><p>Bù đắp lượng muối khoáng, vi chất</p><p>Hương vị sảng khoái</p><p>Sản xuất tại Việt Nam</p><p>Revive là nhãn hiệu của Pesico</p><p>Sản phẩm được sản xuất trên dây chuyền hiện đại chiết xuất từ nước bão hòa CO2, đường sucrose và destrose, chất điều chỉnh độ axit, chất điện giải... không chứa chất bảo quản và hóa chất độc hại, an toàn cho người sử dụng.</p><p>Với chất điện giải Natri, Kali... và vitamin B3, B6, B12 giúp bù nước,&nbsp;muối khoáng bị mất đi&nbsp;nhanh chóng&nbsp;do vận động, chơi thể thao...</p><p>&nbsp;</p><p>&nbsp;</p>', '1', '0', '17767', 'sản phẩm đóng chai,thực phẩm đóng hộp,dản phẩm khô,sản phẩm trưng bày', '768', '2018-06-02 17:55:27', null, null, null, null, null, '1');
