INSERT INTO `products` VALUES ('140', 'Merino Yeah Cacao', 'Merino-Yeah-Cacao', '9', '/UploadedFiles/images/productImages/shopdoan_merino_yeah_cacao_large.jpg', '[\"/UploadedFiles/images/productImages/shopdoan_merino_yeah_cacao_master.jpg\"]', '11000.00', '9625.00', '8000.00', null, '<p>Sản phẩm được cung cấp bởi Thực phẩm an to&agrave;n Sunfood.</p>\n<p>Với các thành ph&acirc;̀n chính là socola, ca cao,và các nguy&ecirc;n li&ecirc;̣u khác. Món kem que&nbsp;merino yeah cacao socola sẽ chắc chắn là món giải khác r&acirc;́t ngon và b&ocirc;̉ dưỡng cho các bạn.</p>', '<h2>Merino Yeah Cacao</h2><p>Sản phẩm được cung cấp bởi Thực phẩm an toàn Sunfood.</p><p><span>Với các thành phần chính là socola, ca cao,và các nguyên liệu khác. Món kem que&nbsp;merino yeah cacao socola sẽ chắc chắn là món giải khác rất ngon và bổ dưỡng cho các bạn!</span></p>', '1', '0', '10919', null, '815', '2018-06-02 17:55:52', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('141', 'Bơ Booth', 'Bo-Booth', '10', '/UploadedFiles/images/productImages/booth_b47281262821496fb77052a04d605a71_large.jpg', '[\"/UploadedFiles/images/productImages/booth_b47281262821496fb77052a04d605a71_master.jpg\",\"/UploadedFiles/images/productImages/boot7_master.jpg\",\"/UploadedFiles/images/productImages/bo-booth-01_master.jpg\"]', '79000.00', '69125.00', '71818.18', null, '<p>Bơ Booth xuất xứ Đắc Lắc- Sản phẩm được cung cấp bởi Thực phẩm an to&agrave;n Sunfood</p>', '<p>Bơ Booth xuất xứ Đắc Lắc- Sản phẩm được cung cấp bởi Thực phẩm an toàn Sunfood</p>', '1', '0', '16355', ',nông sản sạch', '821', '2018-06-02 17:57:34', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('142', 'Bơ Sáp', 'Bo-Sap', '10', '/UploadedFiles/images/productImages/avocado_a550b4f80c754e3db84bf0276025bea2_large.jpg', '[\"/UploadedFiles/images/productImages/avocado_a550b4f80c754e3db84bf0276025bea2_master.jpg\",\"/UploadedFiles/images/productImages/53816041_master.jpg\",\"/UploadedFiles/images/productImages/bo_sap_master.jpg\"]', '60000.00', '52500.00', '54545.45', null, '', '<p>Bơ sáp là loại cây trồng chủ lực của vùng Tây Nguyên, đem lại giá trị kinh tế cực kì to lớn.<br> Bơ sáp hiện nay đã có vài vùng trồng thành công như Đà Lạt - Lâm Đồng nhưng chất lượng nhất vẫn là ở Đắc Lắc - Tây Nguyên.<br></p><p>Bơ sáp thì có nhiều hình thù, nhiều kích thước nhưng chỉ có 2 màu sắc chính là Bơ Chín Xanh và Bơ Chín Tím, 2 loại này đều rất ngon nhưng theo chia sẻ của những người sành ăn thì Bơ Chín Tím cho lượng sáp và vị béo ngậy hơn kha khá.</p><p>Bơ nước thường có vỏ ngoài láng bóng, sờ mịn màng, nhìn rất đẹp mắt còn</p><p>Bơ Sáp&nbsp;Già thì vỏ ngoài sẽ sần sùi, xấu tệ nhưng cực dẻo và ngậy<br> bơ già mùi thơm ngậy hơn hẳn.</p><p>Vỏ trái bơ sáp xanh có lấm tấm đốm vàng thì tỉ lệ&nbsp;sáp sẽ cao hơn rất nhiều.<br></p><p>Công dụng trái bơ sáp</p><p>-Bơ sáp&nbsp;là loại&nbsp;trái cây&nbsp;tốt cho sức khỏe và phù hợp với mọi lứa tuổi.</p><p>-Bơ sáp&nbsp;có chứa lượng axit oleic khá cao giúp ngăn ngừa ung thư vú.<br> -Trong bơ có chứa lượng lutein carotene cao hơn bất cứ loại trái cây nào khác. Chất này giúp chống sự thoái hóa thành các vết đen, bệnh đục nhân mắt và một số bệnh về mắt liên quan đến tuổi thọ.</p><p>-Bơ sáp&nbsp;có chứa rất nhiều beta-sitosterol, là một hợp chất làm giảm tỉ lệ cholesterol. Một nghiên cứu đã cho thấy ăn một quả mỗi ngày sẽ giúp giảm tỉ lệ chất béo xuống khoảng 17% chỉ trong vòng một tuần.<br> -Bơ&nbsp;chứa rất nhiều glutathione - chất chống ôxy hóa rất quan trọng trong quá trình ngăn chặn sự lão hóa, ung thư và bệnh tim.<br> -Theo những nghiên cứu chưa chính thức bơ sáp chưa môt số chất có khả năng ngăn ngừa ung thư thận và ung thư vòm miệng.</p><p>&nbsp;</p>', '1', '0', '2006', ',nông sản sạch', '827', '2018-06-02 17:57:35', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('143', 'Bưởi da xanh', 'Buoi-da-xanh', '10', '/UploadedFiles/images/productImages/buoi_da_xanh_8d16f5f0488f4ef48cafc2fb5aa092cf_large.jpg', '[\"/UploadedFiles/images/productImages/buoi_da_xanh_8d16f5f0488f4ef48cafc2fb5aa092cf_master.jpg\",\"/UploadedFiles/images/productImages/lnphoto_170_master.jpg\",\"/UploadedFiles/images/productImages/buoi_da_xanh1_master.jpg\",\"/UploadedFiles/images/productImages/buoi_da_xanh2_master.jpg\"]', '89000.00', '77875.00', '80909.09', null, '<p>Bưởi da xanh l&agrave; loại tr&aacute;i c&acirc;y thuộc c&ugrave;ng họ với cam,qu&yacute;t. Đ&acirc;y l&agrave; loại tr&aacute;i c&acirc;y h&igrave;nh tr&ograve;n, v&otilde; m&agrave;u xanh, ruột m&agrave;u hồng, mọng nước, ăn bưởi c&oacute; m&ugrave;i thơm, vị hơi chua pha lẫn ngọt thanh. Ăn bưởi da xanh c&oacute; nhiều t&aacute;c dụng c&oacute; lợi cho sức khỏe v&agrave; được người ti&ecirc;u d&ugrave;ng đ&aacute;nh gi&aacute; l&agrave; loại tr&aacute;i c&acirc;y l&agrave;nh nhất trong thế giới hoa quả.&nbsp; Ch&iacute;nh v&igrave; thế m&agrave; v&agrave;i năm trở lại đ&acirc;y bưởi da xanh l&agrave; loại tr&aacute;i c&acirc;y kh&ocirc;ng thể thiếu trong c&aacute;c gia đ&igrave;nh sau bữa ăn, l&agrave;m thức uống h&agrave;ng ng&agrave;y v&agrave; cũng l&agrave; loại tr&aacute;i c&acirc;y thay thế cho tr&aacute;i dưa hấu để c&uacute;ng trong những ng&agrave;y tết cổ truyền của Việt Nam.</p>', '<p>Bưởi da xanh&nbsp;có nguồn gốc từ ông sáu Luông, một người nông dân ở ấp An Thuận, xã Mỹ Thạnh An, thành phố Bến Tre. Từ một người cháu ruột của ông Sáu Luông kể lại rằng: vào những năm 1940 sau một lần đi ăn đám giỗ ở xã Tiên Thũy (Hàm Luông).&nbsp; Sau khi ăn miếng bưởi ông Sáu quá bất ngờ với vị ngon của loại trái cây này và cố tình lấy hạt bỏ vào túi và đem về nhà ương lên và trồng tại vườn nhà. Sau vài năm trồng thì cây đã cho trái và có vị ngon, ngọt như ông đã từng ăn. Thế là cây bưởi được nhân giống ra cho một số người thân quen của ông bằng cách chiếc cành. Dần theo thời gian thì bưởi da xanh được nhân rộng khắp cả nước&nbsp; như ngày hôm nay và thường được gọi với tên bưởi da xanh Bến Tre.</p><p>Bưởi da xanh là loại trái cây thuộc cùng họ với cam,quýt. Đây là loại trái cây hình tròn, võ màu xanh, ruột màu hồng, mọng nước, ăn bưởi có mùi thơm, vị hơi chua pha lẫn ngọt thanh. Ăn bưởi da xanh có nhiều tác dụng có lợi cho sức khỏe và được người tiêu dùng đánh giá là loại trái cây lành nhất trong thế giới hoa quả. Chính vì thế mà vài năm trở lại đây bưởi da xanh là loại trái cây không thể thiếu trong các gia đình sau bữa ăn, làm thức uống hàng ngày và cũng là loại trái cây thay thế cho trái dưa hấu để cúng trong những ngày tết cổ truyền của Việt Nam.</p>', '1', '0', '3441', ',nông sản sạch', '833', '2018-06-02 17:57:35', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('144', 'Bưởi Năm Roi', 'Buoi-Nam-Roi', '10', '/UploadedFiles/images/productImages/namroi_large.jpg', '[\"/UploadedFiles/images/productImages/namroi_master.jpg\",\"/UploadedFiles/images/productImages/buoi-nam-roi_master.png\",\"/UploadedFiles/images/productImages/buoi_nam_roi_master.jpg\",\"/UploadedFiles/images/productImages/buoinamroi_master.jpg\"]', '60000.00', '52500.00', '38181.81', null, '', '<p>Bưởi Năm Roi&nbsp;là một giống bưởi nổi tiếng ở&nbsp;Việt Nam&nbsp;được trồng nhiều ở một số tỉnh&nbsp;miền Tây Nam bộ&nbsp;(nhất là Vĩnh Long). Mỗi năm, giống bưởi này cho thu hoạch hai lần vào tháng Tám và tháng Chạp âm lịch.</p><p>Giống bưởi Năm Roi do ông Trần Văn Bưởi (1918 - 1990) người làng Mái Dầm nay thuộc xã Phú Hữu A, huyện Châu Thành,&nbsp;Hậu Giang) tìm thấy. Sinh thời, ông Bưởi làm nghề buôn bán trên sông. Một tối ông ngủ lại trên ghe bầu ở Tân Châu (vùng Châu Đốc thuộc tỉnh An Giang thời Pháp thuộc) thì vô tình nhặt được một trái cây trên sông. Trái cây da có màu xanh, ruột màu đỏ vàng. Xé ra nếm thử thấy vị ngon, mọng nước ông Bưởi rất thích. Ông lấy hột mang về quê Phú Hữu (chợ Mái Dầm) để trồng.</p><p>Sau khi giống bưởi này được phổ biển khắp vùng quê ông Trần Văn Bưởi, người các nơi khác cũng đến xin giống cây về trồng. Ngày nay, bưởi Năm Roi được trồng nhiều nhất là ở Phú Hữu, Châu Thành, Hậu Giang và Bình Minh,&nbsp;Vĩnh Long. Có thể nói ở trên thế giới chỉ có hai nơi này là trồng bưởi Năm Roi ít bị sâu bệnh, trái ngọt và to. Ở Phú Hữu người tiêu dùng có thể dễ dàng tìm được một trái bưởi 3–4&nbsp;kg có trái còn nặng tới 5&nbsp;kg, những trái lớn như vậy chỉ có vào một hai mùa đầu, người dân gọi là bưởi tơ. Vào các mùa sau thì bưởi cho trái nhiều hơn, thường xuyên hơn. Ngày nay người nông dân có thể cho trái quanh năm, tháng nào cũng có thể được thưởng thức bưởi Năm Roi chín.</p><p>Bưởi Năm Roi có thể ăn không hoặc chấm với muối ớt, muối tiêu sọ thật cay. Bưởi vừa có vị ngọt xen lẫn vị chua rất dịu.</p>', '1', '0', '16357', ',nông sản sạch', '838', '2018-06-02 17:57:36', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('145', 'Cam canh', 'Cam-canh', '10', '/UploadedFiles/images/productImages/1_aadb833de45847a89fa2554dc13b6a7e_large.jpg', '[\"/UploadedFiles/images/productImages/1_aadb833de45847a89fa2554dc13b6a7e_master.jpg\",\"/UploadedFiles/images/productImages/7dd0f5c88ba664f83db7_master.png\",\"/UploadedFiles/images/productImages/58f5cc57e63909675028_master.png\",\"/UploadedFiles/images/productImages/dc508ff1a59f4ac1138e_master.png\",\"/UploadedFiles/images/productImages/e9191e04606a8f34d67b_master.png\"]', '55000.00', '48125.00', '35000.00', null, '<p>Tr&aacute;i kh&ocirc;ng đều, vỏ mỏng, mọng nước, vị ngọt lịm kh&ocirc;ng c&oacute; vị chua.</p>\n<p>C&aacute;ch d&ugrave;ng:</p>\n<p>Lột vỏ ăn ngay hoặc vắt nước uống đều được.</p>\n<p>Vị ngọt tự nhi&ecirc;n kh&ocirc;ng cần pha th&ecirc;m đường.</p>\n<p>Bảo quản:</p>\n<p>Bảo quản trong m&ocirc;i trường tho&aacute;ng m&aacute;t.</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>', '<p>Cam Canh Lục Ngạn</p><p><img src=\"//file.hstatic.net/1000198833/file/1434358760-xdul3_ktpa_large.jpg\" alt=\"Cam Canh Lục Ngạn\" style=\"display: block; margin-left: auto; margin-right: auto;\"></p><p>Nhắc đến xứ sở Lục Ngạn chúng ta thường nghĩ đến vải thiều, nhưng giá vải mỗi năm lên xuống thất thường, trong khi đó huyện vùng cao tỉnh Bắc Giang này lại được thiên nhiên ưu ái phù hợp với nhiều cái tên nổi tiếng khác như Bưởi Diễn, Cam Vinh đặc biệt là Cam đường xuất xứ từ làng Canh - Hà Nội, cũng chính vì thế rất nhiều hộ nông dân đã chuyển từ vải thiều sang trồng các loại cây trái khác cho hiệu quả kinh tế cao hơn.</p><p><span>Lục Ngạn hiện là vùng trồng cây ăn quả lớn nhất miền Bắc. Toàn Huyện có trên 20.000 trái cây ăn quả các loại, trong đó, cây có múi 3.990 ha…</span></p><p><span>Chính quyền địa phương đang tập trung hướng dẫn người dân không phát triển diện tích cây ăn quả có múi theo phong trào, mà cần quan tâm đến chất lượng giống cây bảo đảm nguồn gốc; đồng thời tập trung nâng cao kỹ thuật chăm sóc cây ăn quả theo quy trình VIETGAP, GLOBALGAP nhằm nâng cao năng suất, chất lượng sản phẩm, góp phần nâng cao sức cạnh tranh trên thị trường.</span></p><p>Để tìm được quả Cam Canh chính gốc Hà Nội hiện tại là điều rất khó chính vì vậy Sunfood đã chọn vùng trái cây Lục Ngạn Bắc Giang làm nguồn cung cấp thức quả ngọt lịm gây quyến luyến lòng người này.</p><p><img src=\"//file.hstatic.net/1000198833/file/86a39b28af4640181957_large.jpg\" alt=\"Cam đường làng Canh\" style=\"display: block; margin-left: auto; margin-right: auto;\"></p><p>Yên tâm với những sản phẩm Cam Canh do Sunfood cung cấp, đảm bảo nuôi trồng tự nhiên có sự kiểm soát chặt chẽ về chất lượng.</p><p><br></p>', '1', '0', '10918', ',nông sản sạch', '844', '2018-06-02 17:57:37', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('146', 'Cam Sành Hậu Giang', 'Cam-Sanh-Hau-Giang', '10', '/UploadedFiles/images/productImages/lnphoto_185_large.jpg', '[\"/UploadedFiles/images/productImages/lnphoto_185_master.jpg\",\"/UploadedFiles/images/productImages/kcl1496378111_master.jpg\",\"/UploadedFiles/images/productImages/cam_xanh_web_master.jpg\",\"/UploadedFiles/images/productImages/cam-sanh-6_master.jpg\",\"/UploadedFiles/images/productImages/cam_sanh_1_master.jpg\",\"/UploadedFiles/images/productImages/cam_sanh_2_master.jpg\"]', '35000.00', '30625.00', '22272.72', null, '<p>Cam s&agrave;nh được trồng ở X&atilde; C&aacute;i Tắc, Huyện Vị Thanh, Hậu Giang. Sử dụng ph&acirc;n hữu cơ truyền thống (ph&acirc;n vịt ủ hoai, l&aacute; m&iacute;a,..) v&agrave; sữ dụng ph&acirc;n b&oacute;n sinh học, chế phẩm sinh học để ph&ograve;ng trị bệnh (hơn 1 năm nay kh&ocirc;ng d&ugrave;ng thuốc BVTV h&oacute;a học).</p>\n<p>Được thu h&aacute;i m&ugrave;a đầu ti&ecirc;n nhưng đ&atilde; cho chất lượng ngon ngọt, thanh, vỏ cứng, mỏng. B&ecirc;n trong v&agrave;ng v&agrave; mọng nước. Th&iacute;ch hợp để chế biến thức uống hoặc cắt miếng ra d&ugrave;ng ngay. Gồm 2 mảnh vườn tầm 2 x&agrave;o/vườn cho sản lượng b&oacute;i khoảng 1-1.2 tấn (thu b&oacute;i l&agrave; thu đợt đầu ti&ecirc;n của đời c&acirc;y sau 2 năm kể từ ng&agrave;y trồng-đv cam)</p>', '<p>Cam sành&nbsp;là một giống cây ăn quả thuộc&nbsp;chi Cam chanh, có nguồn gốc từ&nbsp;Việt Nam. Quả cam sành rất dễ nhận ra nhờ lớp vỏ dày, sần sùi giống bề mặt mảnh&nbsp;sành, và thường có màu lục nhạt (khi chín có sắc cam), các múi thịt có màu cam.</p><p>Cam sành được trồng ở Xã Cái Tắc, Huyện Vị Thanh, Hậu Giang. Sử dụng phân hữu cơ truyền thống (phân vịt ủ hoai, lá mía...) và sữ dụng phân bón sinh học, chế phẩm sinh học để phòng trị bệnh (tuyệt đối không dùng thuốc BVTV hóa học).</p><p>Cam sành Hậu Giang Được thu hái mùa đầu tiên nhưng đã cho chất lượng ngon ngọt, thanh, vỏ cứng, mỏng. Bên trong vàng và mọng nước. Thích hợp để chế biến thức uống hoặc cắt miếng ra dùng ngay. Gồm 2 mảnh vườn tầm 2 xào/vườn cho sản lượng bói khoảng 1-1.2 tấn (thu bói là thu đợt đầu tiên của đời cây sau 2 năm kể từ ngày trồng-đv cam)</p>', '1', '0', '3441', ',nông sản sạch', '850', '2018-06-02 17:57:40', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('147', 'Cam Vinh', 'Cam-Vinh', '10', '/UploadedFiles/images/productImages/ab19a847dc45331b6a54_large.jpg', '[\"/UploadedFiles/images/productImages/ab19a847dc45331b6a54_master.jpg\",\"/UploadedFiles/images/productImages/2_868c1bcb237a4b279ce3a0ee58456272_master.jpg\",\"/UploadedFiles/images/productImages/25ec6ee618e4f7baaef5_master.jpg\",\"/UploadedFiles/images/productImages/310ed444a0464f181657_master.jpg\",\"/UploadedFiles/images/productImages/9ca826f052f2bdace4e3_master.jpg\",\"/UploadedFiles/images/productImages/3_52d5e012f8ed4305ae98dbaf1b110cd0_master.jpg\"]', '55000.00', '48125.00', '19999.99', null, '', '<p><b>Cam Vinh</b><span>&nbsp;</span>quả tròn đều, mọng nước, có màu vàng chanh đều bắt mắt, vị ngọt thanh chua nhẹ, có thể nói so với những loại cam ngoại nhập đắt giá nhất Cam Vinh cũng không hề kém cạnh.<br></p><p>Cam chỉ thu hoạch từ tháng 9 âm tới tết. Cam Vinh bán vào mùa khác không phải cam trái mùa mà là cam Trung Quốc giả dạng cam Vinh.</p><p>Cam Vinh thường được dùng để ăn miếng bổ cau, ép lấy nước cam, xay lấy sinh tố. Phần vỏ cam ép lấy tinh dầu. Phần hạt cam cũng được dùng để làm nước gội đầu.</p><p>Trong thời kỳ bao cấp, cam Vinh được xuất sang các nước xã hội chủ nghĩa. Đến thời mở cửa, cam Vinh không xuất khẩu được, thương hiệu dần tàn lụi trên trường quốc tế. Tuy nhiên ở Việt Nam, đây vẫn là loại đặc sản có tiếng.&nbsp;<br></p><p>Nguồn Cam Vinh được trồng chủ yếu trên địa bàn Huyện Quỳ Hợp - Nghệ An.</p><p>Liên hệ ngay Sunfood để thưởng thức hương vị Cam Vinh chính hiệu, đảm bảo nuôi trồng theo phương thức hữu cơ.</p><p><br></p>', '1', '1', '16356', ',nông sản sạch', '856', '2018-06-02 17:57:42', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('148', 'Cam Xoàn', 'Cam-Xoan', '10', '/UploadedFiles/images/productImages/lnphoto_183_31ea2ab3b3ab4ff1bc9e40dd4b0c87e8_large.jpg', '[\"/UploadedFiles/images/productImages/lnphoto_183_31ea2ab3b3ab4ff1bc9e40dd4b0c87e8_master.jpg\",\"/UploadedFiles/images/productImages/lnphoto_184_fd2214220417432288bf373c45ae9bf9_master.jpg\",\"/UploadedFiles/images/productImages/cam_xoan_80ffdacbf05844baaaff4e34f802181a_master.jpg\",\"/UploadedFiles/images/productImages/cam_xoan2_b911922c2e5c4a77bd7673a55cc3d9b2_master.jpg\",\"/UploadedFiles/images/productImages/cam_xoan1_ffde3198b618464d8507a2659cdf35ce_master.jpg\"]', '69000.00', '60375.00', '25090.90', null, '<p>Cam xo&agrave;n l&agrave; giống c&acirc;y ăn tr&aacute;i được trồng nhiều v&agrave; l&acirc;u đời ở một số tỉnh Đồng Bằng S&ocirc;ng Cửu Long. Huyện Tr&agrave; &Ocirc;n, tỉnh Vĩnh Long v&agrave; huyện Long Mỹ, tỉnh Hậu Giang l&agrave; hai trong những địa phương trồng nhiều giống cam n&agrave;y.</p>', '<p>Cam xoàn&nbsp;có cơm màu vàng nhạt, vị ngọt đậm, mùi thơm, trọng lượng trung bình 250 – 300gram.</p><p>Cam xoàn là giống cây ăn trái được trồng nhiều và lâu đời ở một số tỉnh Đồng Bằng Sông Cửu Long. Huyện Trà Ôn, tỉnh Vĩnh Long và huyện Long Mỹ, tỉnh Hậu Giang là hai trong những địa phương trồng nhiều giống cam này. Hiện nay, diện tích trồng cam xoàn ở Trà Ôn đạt trên 30 ha, tập trung ở xã Thiện Mỹ, Tân Mỹ, Thới Hòa, Vĩnh Xuân. Còn tại huyện Long Mỹ có khoảng 100 ha cam xoàn, trong đó trên 50 ha đang cho trái, tập trung nhiều nhất tại 2 xã Long Trị và Long Trị A. Cây cam xoàn rất chắc khoẻ, cho trái sai quanh năm, vỏ mỏng và có những vòng xoáy như đồng tiền.</p><p>Cam xoàn được trồng nhiều nhất ở Vĩnh Long và Hậu Giang</p><p>Cam xoàn là cây cùng một họ với cam mật, dễ trồng hơn cam sành. Mùa nắng không bị nám trái, tán cây to, giá cả ổn định suốt năm, mang lại hiệu quả kinh tế cao hơn gấp 3 lần giá cam sành. Cây sinh trưởng và phát triển mạnh, thích nghi với nhiều vùng đất cao ráo thoát nước tốt, đất không quá nhiễm phèn- mặn.</p><p>Cam xoàn sinh trưởng và phát triển mạnh, thích nghi với nhiều vùng đất cao ráo thoát nước tốt</p><p>Cam xoàn ruột vàng, vị ngọt thanh hơn quít, trái to, cây từ 3 năm tuổi trở lên có trái quanh năm.&nbsp; Ăn cam xoàn thường xuyên giúp tăng cường hệ miễn dịch, tăng cường thể lực, tăng cường sự trắng mịn cho làn da. Vì vậy đây chính là loại trái cây thích hợp cho mọi người, mọi gia đình, đặc biệt là trẻ em và phụ nữ có thai.</p><p>Đặc điểm của cam xoàn là trái càng nhỏ thì vị càng ngọt thanh, có mùi thơm nhẹ, chắc múi so với các loại cam sành, cam mật, thương lái mua cam xoàn đều tính đồng giá, không phân biệt loại 1, loại 2 như các loại trái cây khác. Trồng 1 ha cam xoàn 4 năm tuổi, thu hoạch mỗi năm 200 triệu đồng, từ 5 năm trở lên thu được 300 – 400 triệu đồng .</p><p>Cam xoàn ruột vàng, vị ngọt thanh, cò mùi thơm nhẹ, chắc múi<br> Do ưu điểm ít bị sâu bệnh phá hại, nhẹ công chăm sóc và cho thu nhập cao, thị trường tiêu thụ ổn định nên ngoài việc trồng xen canh cam xoàn, nhiều hộ nông dân đã xây dựng mô hình chuyên canh cam xoàn với diện tích từ 2.000 đến 5.000 m2 mang lại hiệu quả kinh tế cao.</p>', '1', '0', '2786', ',nông sản sạch', '862', '2018-06-02 17:57:44', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('149', 'Chanh Dây', 'Chanh-Day', '10', '/UploadedFiles/images/productImages/lnphoto_274_large.jpg', '[\"/UploadedFiles/images/productImages/lnphoto_274_master.jpg\",\"/UploadedFiles/images/productImages/lnphoto_275_master.jpg\",\"/UploadedFiles/images/productImages/lnphoto_276_master.jpg\",\"/UploadedFiles/images/productImages/lnphoto_277_master.jpg\"]', '35000.00', '30625.00', '15909.09', null, '<p>Chanh d&acirc;y được cung cấp bởi cửa h&agrave;ng thực phẩm an to&agrave;n Sunfood, đảm bảo an to&agrave;n v&agrave; chất lượng.</p>', '<p>Chanh dây được cung cấp bởi cửa hàng thực phẩm an toàn Sunfood, đảm bảo an toàn và chất lượng.</p>', '1', '0', '2787', ',nông sản sạch', '868', '2018-06-02 17:57:45', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('150', 'Chanh không hạt', 'Chanh-khong-hat', '10', '/UploadedFiles/images/productImages/lnphoto_313_large.jpg', '[\"/UploadedFiles/images/productImages/lnphoto_313_master.jpg\",\"/UploadedFiles/images/productImages/lnphoto_315_master.jpg\",\"/UploadedFiles/images/productImages/lnphoto_314_master.jpg\",\"/UploadedFiles/images/productImages/chanh_khong_hat_master.jpg\",\"/UploadedFiles/images/productImages/chanh_kohat_master.jpg\",\"/UploadedFiles/images/productImages/chanh_khong_hat1_master.jpg\"]', '55000.00', '48125.00', '50000.00', null, '<p>Chanh l&agrave; một loại tr&aacute;i c&acirc;y tự nhi&ecirc;n c&oacute; t&aacute;c dụng chữa nhiều bệnh từ tất cả c&aacute;c phần của c&acirc;y chanh, quả chanh, đặc biệt l&agrave; vỏ chanh.</p>\n<p>Những lợi &iacute;ch của chanh kh&ocirc;ng chỉ c&oacute; ở nước chanh (mỗi buổi s&aacute;ng n&ecirc;n uống một cốc nước chanh ấm hoặc uống một cốc tr&agrave; chanh v&agrave;o mỗi tối) m&agrave; ngay cả vỏ chanh cũng c&oacute; lợi cho sức khỏe. Chanh kh&ocirc;ng những k&iacute;ch th&iacute;ch vị gi&aacute;c m&agrave; n&oacute; đặc biệt tốt cho da v&agrave; t&oacute;c, vỏ chanh c&oacute; c&aacute;c tinh dầu v&agrave; chứa c&aacute;c enzyme c&oacute; thể gi&uacute;p cuộc sống của ch&uacute;ng ta l&agrave;nh mạnh hơn nhiều.</p>', '<p>Tác dụng kì diệu của vỏ chanh</p><p>Chanh là một loại trái cây tự nhiên có tác dụng chữa nhiều bệnh từ tất cả các phần của cây chanh, quả chanh, đặc biệt là vỏ chanh.</p><p>Những lợi ích của chanh không chỉ có ở nước chanh (mỗi buổi sáng nên uống một cốc nước chanh ấm hoặc uống một cốc trà chanh vào mỗi tối) mà ngay cả vỏ chanh cũng có lợi cho sức khỏe. Chanh không những kích thích vị giác mà nó đặc biệt tốt cho da và tóc, vỏ chanh có các tinh dầu và chứa các enzyme có thể giúp cuộc sống của chúng ta lành mạnh hơn nhiều.</p><p>Vỏ chanh, vỏ cam có thể sấy khô để chế biến các món ăn hoặc dùng cho các loại mỹ phẩm. Vỏ chanh được cho là có tác dụng ngăn ngừa và chữa đối với các vấn đề về tim, mụn trứng cá, cholesterol, bệnh còi cọc, và nhiều hơn nữa... Nó bao gồm các enzym thiết yếu, vitamin, và khoáng chất như vitamin C, vitamin P, canxi, kali, chất xơ, limonene, axit citric, flavonoid polyphenol, và salvestrol Q40... có tác dụng làm cho cơ thể cũng như tâm trí được sảng khoái. Ngoài vỏ chanh, vỏ cam quýt cũng được cho là tốt cho tâm trạng con người vì chúng cũng chứa các tinh dầu.</p><p>&nbsp;</p>', '1', '0', '15538', ',nông sản sạch', '873', '2018-06-02 17:57:46', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('151', 'Chôm chôm', 'Chom-chom', '10', '/UploadedFiles/images/productImages/chomchom__1__62c3ff80f8064b82bd865704ff2f60a1_large.jpg', '[\"/UploadedFiles/images/productImages/chomchom__1__62c3ff80f8064b82bd865704ff2f60a1_master.jpg\",\"/UploadedFiles/images/productImages/chom_chom_master.jpg\",\"/UploadedFiles/images/productImages/13569731_xl_master.jpg\",\"/UploadedFiles/images/productImages/chomchom_master.jpg\",\"/UploadedFiles/images/productImages/chomchom2_master.jpg\"]', '49000.00', '42875.00', '44545.45', null, '<p>Ch&ocirc;m ch&ocirc;m nh&atilde;n hay c&ograve;n gọi l&agrave; ch&ocirc;m ch&ocirc;m đường v&igrave; khi ăn thịt của ch&ocirc;m ch&ocirc;m nh&atilde;n&nbsp;gi&ograve;n, tr&oacute;c hạt, vị ngọt như đường v&agrave; c&oacute; m&ugrave;i thơm. So với c&aacute;c loại ch&ocirc;m ch&ocirc;m kh&aacute;c th&igrave; ch&ocirc;m ch&ocirc;m nh&atilde;n dễ bảo quản hơn v&agrave; để được l&acirc;u hơn.</p>', '<p>Chôm chôm nhãn được đánh giá là một trong những giống ngon nhất trong họ nhà chôm chôm ở Việt Nam. Đã từ rất lâu đời chôm chôm được trồng chủ yếu ở các vùng Nam Bộ như: Đồng Nai, Bình Dương, Bến Tre…</p><p>Chôm chôm nhãn hay còn gọi là chôm chôm đường vì khi ăn thịt của chôm chôm nhãn&nbsp;giòn, tróc hạt, vị ngọt như đường và có mùi thơm. So với các loại chôm chôm khác thì chôm chôm nhãn dễ bảo quản hơn và để được lâu hơn.</p><p>Chôm chôm nhãn là giống có&nbsp;trái hình cầu, gai ngắn, mã không đẹp, vỏ trái khi chín chuyển dần từ màu xanh sang vàng, hồng và cuối cùng là đỏ.</p>', '1', '0', '2786', ',nông sản sạch', '879', '2018-06-02 17:57:48', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('152', 'Chuối Gold Đà Lạt', 'Chuoi-Gold-Da-Lat', '10', '/UploadedFiles/images/productImages/lnphoto_155_large.jpg', '[\"/UploadedFiles/images/productImages/lnphoto_155_master.jpg\",\"/UploadedFiles/images/productImages/lnphoto_156_master.jpg\",\"/UploadedFiles/images/productImages/lnphoto_157_master.jpg\",\"/UploadedFiles/images/productImages/lnphoto_415_master.jpg\",\"/UploadedFiles/images/productImages/lnphoto_420_master.jpg\",\"/UploadedFiles/images/productImages/lnphoto_422_master.jpg\"]', '28000.00', '24500.00', '25454.54', null, '<p>Chuối Gold Đ&agrave; Lạt, sản phẩm được cung cấp bởi Thực phẩm an to&agrave;n Sunfood</p>', '<p>Chuối Gold Đà Lạt, sản phẩm được cung cấp bởi Thực phẩm an toàn Sunfood</p>', '1', '0', '2786', ',nông sản sạch', '885', '2018-06-02 17:57:49', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('153', 'Chuối Sứ', 'Chuoi-Su', '10', '/UploadedFiles/images/productImages/lnphoto_161_large.jpg', '[\"/UploadedFiles/images/productImages/lnphoto_161_master.jpg\",\"/UploadedFiles/images/productImages/lnphoto_163_master.jpg\"]', '26000.00', '22750.00', '9454.54', null, '', '<p>Chuối sứ được cung cấp bởi Cửa hàng thực phẩm an toàn Sunfood</p>', '1', '0', '15537', ',nông sản sạch', '891', '2018-06-02 17:58:02', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('154', 'Dưa lưới Taki', 'Dua-luoi-Taki', '10', '/UploadedFiles/images/productImages/lnphoto_177_large.jpg', '[\"/UploadedFiles/images/productImages/lnphoto_177_master.jpg\",\"/UploadedFiles/images/productImages/lnphoto_179_master.jpg\",\"/UploadedFiles/images/productImages/lnphoto_181_master.jpg\"]', '81000.00', '70875.00', '29454.54', null, '', '', '1', '0', '4222', ',nông sản sạch', '897', '2018-06-02 17:58:03', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('155', 'Hồng Giòn Đà Lạt', 'Hong-Gion-Da-Lat', '10', '/UploadedFiles/images/productImages/hong_ngam_dspl3_large.jpg', '[\"/UploadedFiles/images/productImages/hong_ngam_dspl3_master.jpg\",\"/UploadedFiles/images/productImages/hong-gion-da-lat4_c7c27e8584734b71ae653cf59e23713c_master.jpg\",\"/UploadedFiles/images/productImages/hong-gion-da-lat-1_master.jpg\",\"/UploadedFiles/images/productImages/hong_gion_1_master.jpg\"]', '15000.00', '13125.00', '5454.54', null, '', '<h1 style=\"text-align: justify;\"><span>Hồng Giòn Đà Lạt</span></h1><p><img src=\"//file.hstatic.net/1000198833/file/hong_gion_1_large.jpg\" style=\"display: block; margin-left: auto; margin-right: auto;\"></p><p style=\"text-align: justify;\">Cây hồng có mặt tại Đà Lạt, Lâm Đồng từ lâu, khá nổi tiếng với món hồng treo. Nhưng gần đây, do nhận thấy vị ngon ngọt rất riêng của trái hồng khi mới ngả vàng, người dân đã mạnh dạng đưa loại hồng này lên hàng đặc sản.</p><p style=\"text-align: justify;\">Loại hồng này là món quà mà tự nhiên ban tặng cho Đà Lạt vì không kì công chăm sóc, không kén nơi trồng, không ngại mưa gió, cứ lớn tự nhiên và ra trái ngọt mỗi khi mùa thu hoạch đến.&nbsp;Tháng 7 đến tháng 11 là mùa hồng rộ, không chỉ trên những khu vườn trồng hồng, mà hồng còn rộ trên gánh hàng của các cô bán rong, trên các sạp trái cây ngoài chợ, và rộ trên những chuyến xe đưa khách về lại nhà sau khi tham quan Đà Lạt.</p><p style=\"text-align: justify;\">Mùa hồng cũng là dịp thu sang, không được sắc vàng của lá thì màu vàng của hồng cũng thay thế duyên dáng và khéo léo. Phải đến tận nơi, tiếp xúc với những chủ nhân vườn hồng thân thiện, mến khách, tham quan vườn hộng trĩu quả mới cảm hết cái đẹp, vị ngọt của một thứ qủa đặc sản. Bạn có thể tới những khu vườn ở gần khu vực Dinh III Bảo Đại hay chạy xe khoảng 5km theo hướng đông nam tới đèo Mimosa, tuy diên tích những khu vườn ở đây không lớn, nhưng vườn luôn trĩu quả, bạn có thể chụp hình lưu niệm, thưởng thức tại chỗ và mua về làm quà cho người thân.</p><p style=\"text-align: justify;\">Hồng đến tuổi thu hoạch được hái từ trên cây xuống, lựa chon kĩ càng, không cần dùng nước vôi để ủ, không cần sử dụng máy móc hay bất cứ loại hóa chất nào, chỉ cần được gói trong túi ni lông trắng, sạch rồi cột chặt là đủ, sau 10 ngày hồng sẽ mất hẳn vị chát, đọng lại vị giòn giòn ngọt ngọt.</p><p style=\"text-align: justify;\">Không chỉ là một thức quà ăn vặt hấp dẫn, trái hồng giòn còn có rất nhiều giá trị. Phấn hồng, cuống hồng, vỏ hồng và thịt trái hồng đều là những vị thuốc. Trái hồng có thể trị được nhiều loại bệnh như: chữa nấc, chữa viêm ruột, kiết lị, chữa lở môi và lưỡi, dị ứng da… Hồng giòn từ lâu đã trở thành vị khá quen thuộc trong các bài thuốc Đông y.</p><p style=\"text-align: justify;\">Mùa thu, đến thành phố Đà Lạt, lãng đãng bước chân dạo quanh chợ Đà Lạt, cái cảm giác gió se lạnh phảng phất trên vai, dư vị của cơn mưa ngọt lành đêm qua như còn đọng lại đôi chút. Nhấm nháp miếng hồng giòn, mọi điều như tan biến, chỉ còn vị ngọt ngào của Đà Lạt mùa thu. Bạn có thể dễ dàng tìm mua hồng giòn ở khắp nơi ở Đà Lạt với mức giá tùy thời điểm.</p><p style=\"text-align: justify;\">Sản phẩm được cung cấp bởi Thực phẩm an toàn Sunfood</p>', '1', '0', '10427', ',nông sản sạch', '902', '2018-06-02 17:58:05', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('156', 'Khóm Miền Tây', 'Khom-Mien-Tay', '10', '/UploadedFiles/images/productImages/khom_large.jpg', '[\"/UploadedFiles/images/productImages/khom_master.jpg\",\"/UploadedFiles/images/productImages/lnphoto_427_master.jpg\",\"/UploadedFiles/images/productImages/dua14_master.jpg\",\"/UploadedFiles/images/productImages/tai_xuong_master.jpg\"]', '18000.00', '15750.00', '14727.27', null, '', '<p>Khóm (Thơm) Miền Tây, Sản phẩm được cung cấp bởi Thực phẩm an toàn Sunfood.</p>', '1', '0', '15537', ',nông sản sạch', '908', '2018-06-02 17:58:05', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('157', 'Mận đỏ', 'Man-do', '10', '/UploadedFiles/images/productImages/lnphoto_243_large.jpg', '[\"/UploadedFiles/images/productImages/lnphoto_243_master.jpg\",\"/UploadedFiles/images/productImages/lnphoto_242_master.jpg\"]', '35000.00', '30625.00', '22272.72', null, '<p>Mận đỏ, tr&aacute;i c&acirc;y Việt Nam, Sunfood cung cấp, đảm bảo an to&agrave;n.</p>', '<p>Mận đỏ, trái cây Việt Nam, Sunfood cung cấp, đảm bảo an toàn.</p>', '1', '0', '4222', ',nông sản sạch', '914', '2018-06-02 17:58:07', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('158', 'Nhãn Ido', 'Nhan-Ido', '10', '/UploadedFiles/images/productImages/nhan_1_large.jpg', '[\"/UploadedFiles/images/productImages/nhan_1_master.jpg\",\"/UploadedFiles/images/productImages/nhan_master.jpg\"]', '59000.00', '51625.00', '26818.18', null, '', '<p><br data-mce-bogus=\"1\"></p>', '1', '0', '4222', ',nông sản sạch', '920', '2018-06-02 17:58:07', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('159', 'Nho xanh Ninh Thuận', 'Nho-xanh-Ninh-Thuan', '10', '/UploadedFiles/images/productImages/grape1_large.jpg', '[\"/UploadedFiles/images/productImages/grape1_master.jpg\",\"/UploadedFiles/images/productImages/12_master.jpg\",\"/UploadedFiles/images/productImages/2_master.png\"]', '63000.00', '55125.00', '57272.72', null, '', '<h2>Giới thiệu</h2><p>Nho xanh Ninh Thuận-dòng cây ăn quả dịu ngọt, thơm lừng hấp dẫn biết bao du khách trong nước và quốc tế. Ninh Thuận - miền đất cực Nam Trung Bộ đầy cát trắng và nắng vàng được biết đến là một vùng nho nổi tiếng của nước ta.</p><h2>Diện tích vùng</h2><p>Hiện tại, diện tích vườn nho của tỉnh Ninh Thuận có khoảng 1.100ha, tập trung chủ yếu ở các huyện Ninh Phước, Ninh Hải, Ninh Sơn và TP. Phan Rang - Tháp Chàm. Các giống nho xanh, nho đỏ, nho tím đều được trồng đại trà bởi phù hợp với hơi đất, khí trời Ninh Thuận và cũng đã cho năng suất cao hơn các giống nho nhập khẩu. Thực tế các nhà vườn ở Ninh Thuận đã thu lãi bình quân từ 100 - 150 triệu đồng/ha nho/năm, một số chủ trang trại thâm canh giỏi còn đạt trên dưới 300 triệu đồng/ha/năm đối với giống nho xanh.</p><p>Theo quy hoạch tổng thể phát triển kinh tế - xã hội tỉnh Ninh Thuận, đến năm 2015 là 2000ha và năm 2020 tăng lên 2200ha, trong đó có 1000ha giống mới chất lượng cao và 1200ha giống nho Red Cardinal trên cơ sở giống đã phục tráng, nâng tổng sản lượng bình quân lên 55.000 tấn/năm.</p><h2>Thực phẩm an toàn Sunfood</h2><p>Nho Xanh Phan Rang được cung cấp bởi <a href=\"http://sunfood.com.vn/\">cửa hàng thực phẩm sạch Sunfood</a>, đảm bảo an toàn chất lượng, không sử dụng thuốc trừ sâu và các loại thuốc bảo vệ thực vật.</p><p>&nbsp;</p><p><img src=\"//file.hstatic.net/1000198833/file/12_b6fe871392474e14b55ab134d6b16498_large.jpg\" alt=\"Nho xanh Phan Rang Ninh Thuận\" style=\"display: block; margin-left: auto; margin-right: auto;\"></p>', '1', '0', '15537', ',nông sản sạch', '926', '2018-06-02 17:58:08', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('160', 'Ổi Đường', 'Oi-Duong', '10', '/UploadedFiles/images/productImages/lnphoto_167_large.jpg', '[\"/UploadedFiles/images/productImages/lnphoto_167_master.jpg\",\"/UploadedFiles/images/productImages/lnphoto_168_master.jpg\",\"/UploadedFiles/images/productImages/lnphoto_169_master.jpg\"]', '22000.00', '19250.00', '20000.00', null, '', '<p>Ổi đường sunfood cung cấp, đảm bảo an toàn.</p><p><br></p>', '1', '1', '10427', ',nông sản sạch', '932', '2018-06-02 17:58:09', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('161', 'Quýt đường', 'Quyt-duong', '10', '/UploadedFiles/images/productImages/quyt_duong_large.jpg', '[\"/UploadedFiles/images/productImages/quyt_duong_master.jpg\",\"/UploadedFiles/images/productImages/quyt_duong1_master.jpg\",\"/UploadedFiles/images/productImages/quyt_duong2_master.jpg\"]', '70000.00', '61250.00', '63636.36', null, '<p>Qu&yacute;t chẳng những đẹp mắt, m&ugrave;i thơm dễ chịu, m&agrave; lại ngon v&agrave; bổ.&nbsp;Theo tiếng H&aacute;n, qu&yacute;t đồng &acirc;m với \"c&aacute;t\" c&oacute; nghĩa l&agrave; may mắn v&agrave; đo&agrave;n tụ. Ở nhiều địa phương Trung Quốc, trong đ&ecirc;m t&acirc;n h&ocirc;n, c&ocirc; d&acirc;u ch&uacute; rể tục ăn qu&yacute;t với &yacute; nghĩa mong sớm sinh ra qu&yacute; tử.<br /> </p>', '<p>Quýt chẳng những đẹp mắt, mùi thơm dễ chịu, mà lại ngon và bổ.&nbsp;Theo tiếng Hán, quýt đồng âm với \"cát\" có nghĩa là may mắn và đoàn tụ. Ở nhiều địa phương Trung Quốc, trong đêm tân hôn, cô dâu chú rể tục ăn quýt với ý nghĩa mong sớm sinh ra quý tử.<br> Dưỡng chất trong quýt rất phong phú, trong 100g quýt có hàm lượng&nbsp;protein gấp 9 lần lê, hàm lượng canxi gấp 5 lần lê, hàm lượng photpho gấp 5.5 lần lê, vitamin B1 gấp 8 lần, vitamin B2 gấp 3 lần, vitamin C cũng gấp 10 lần. Quýt chứa thành phần chống oxy hóa, có thể tăng cao khả năng miễn dich, chống sự phát triển của u bướu. Ngoài ra, quýt còn có tác dụng chống lại tia bức xạ của máy tính, trong quýt chứa nhiều vitamin A và beta carotin, có thể bảo vệ da cho những người thường sử dụng máy tính. Hơn nữa, các thành phần dinh dưỡng trong quýt còn giúp chống lại sự phá vỡ acid uric trong máu. Các loại acid hữu cơ và vitamin trong quýt điều hòa chức năng trao đổi chất trong cơ thể đặc biệt là người già mắc bệnh tim.<br> Vỏ quýt chứa vitamin D có thể duy trì tính dẻo của huyết quản mao mạch, phòng chống mạch máu vỡ và thấm máu. Vỏ Quýt xanh vị đắng, cay, tính ấm; có tác dụng hành khí, khai uất, tán kết, trừ thấp, giảm đau và tăng tiêu hoá. Vỏ Quýt chín vị đắng the, mùi thơm tính ấm; có tác dụng hành khí, tiêu đờm trệ, kiện tỳ, táo thấp. Nó kết hợp với vitamin C có thể tăng hiệu quả trị liệu đối với người mắc bệnh máu xấu. Cho nên người xơ cứng mạch máu và thiếu vitamin C nên thường xuyên uống nước vỏ quýt ngâm.<br> Múi quýt có các thành phần dinh dưỡng không thể thiếu được đối với sức khỏe, bao gồm đường, protein, lipid, vitamin, axit hữu cơ, chất khoáng... Người bị cao huyết áp, bệnh mạch vành, đau dạ dày, suy dinh dưỡng, cơ thể suy nhược sau khi ốm... ăn quýt rất có lợi.<br> Xơ quýt vị đắng, tính bình, có vitamin P, giúp phòng chữa cao huyết áp, rất có ích đối với người cao tuổi. Nó cũng có tác dụng điều hòa khí, tan đờm, thông lạc, thông kinh, thường dùng trị các chứng khí trệ kinh lạc, ho tức ngực, ho ra máu...<br> Hạt quýt vị đắng, tính bình, có công hiệu điều hòa khí, giảm đau, tan u cục, thường dùng chữa sa nang, sưng đau tinh hoàn, đau lưng, viêm tuyến sữa, ung thư vú giai đoạn đầu... Lá quýt vị đắng, tính bình, có tác dụng trợ gan, hành khí, tiêu thũng, tan u cục, dùng chữa các chứng đau mạng sườn, sa nang, đau vú, u cục ở vú.<br> Tất cả các phần của quả quýt đều có thể dùng làm thuốc trị bệnh rất hiệu quả. Bởi vậy mà người ta gọi quýt là “Ngọc màu vàng”.</p><p>&nbsp;</p>', '1', '0', '3567', ',nông sản sạch', '937', '2018-06-02 17:58:10', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('162', 'Sa-Pô-Chê', 'Sa-Po-Che', '10', '/UploadedFiles/images/productImages/sapo1_large.jpg', '[\"/UploadedFiles/images/productImages/sapo1_master.jpg\",\"/UploadedFiles/images/productImages/sapo_master.jpg\",\"/UploadedFiles/images/productImages/sapo2_master.jpg\"]', '39000.00', '34125.00', '10636.36', null, '<p>Tr&aacute;i sa p&ocirc; ch&ecirc; l&agrave; một loại tr&aacute;i c&acirc;y được sử dụng rất phổ biến ở Việt Nam. Sa p&ocirc; ch&ecirc; c&oacute; t&aacute;c dụng ngăn ngừa t&aacute;o b&oacute;n, ti&ecirc;u chảy, tốt cho mắt, khỏe xương, kh&aacute;ng vi&ecirc;m,...</p>', '<p>Sa pô chê, hay còn gọi là hồng xiêm, lồng mứt, sabôchê, xa pô chê, là một loại ăn trái lâu năm, có nguồn gốc từ Mexico, Trung Mỹ và Caribbe</p><p>Quả sa pô chê &nbsp;là loại quả mọng, hình cầu hoặc hình quả trứng hoặc hình thon dài, đường kính 4–8&nbsp;cm và chứa từ 2–10 hạt. Vỏ có màu nâu-vàng nhạt. Bên trong là lớp cùi thịt có màu nâu ánh đỏ.&nbsp;Hạt có màu đen.</p><p>Chỉ nên ăn khi sa pô chê đã chín hẳn.&nbsp;Để biết chắc chắn là nó đã chín người ta hay nắn vỏ xem còn cứng hay đã mềm vì màu vỏ gần như không thay đổi từ lúc mới tạo quả đến khi chín.&nbsp;Hương vị của nó tương tự như mùi đường đen.<br></p><p>Trái sa pô chê là một loại trái cây được sử dụng rất phổ biến ở Việt Nam. Sa pô chê có tác dụng ngăn ngừa táo bón, tiêu chảy, tốt cho mắt, khỏe xương, kháng viêm,...</p><p>Cách dùng</p><p>Sa pô chê chín dùng để ăn ngay hoặc làm sinh tố sa pô chê.</p><p>&nbsp;</p>', '1', '0', '19130', ',nông sản sạch', '943', '2018-06-02 17:58:11', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('163', 'Sầu riêng Ri6', 'Sau-rieng-Ri6', '10', '/UploadedFiles/images/productImages/lnphoto_152_d4cf4ef7555d4a679e319e8f10566229_large.jpg', '[\"/UploadedFiles/images/productImages/lnphoto_152_d4cf4ef7555d4a679e319e8f10566229_master.jpg\",\"/UploadedFiles/images/productImages/sau_rieng_ri_6_2_master.jpg\",\"/UploadedFiles/images/productImages/sau_rieng_ri_61_master.jpg\"]', '109000.00', '95375.00', '79272.72', null, '', '<p>Sầu riêng Ri 6 là giống cây được sản xuất theo phương pháp ghép với nguyên liệu lấy từ cành ở những vườn cây đầu dòng. Giống cho năng suất ổn định khoảng 150 trái/cây/năm với năng suất trung bình 25 – 30 tấn/năm.</p><p>Giống RI6 có khả năng thích nghi với nhiều vùng sinh thái khác nhau, cây có thể sinh trưởng và phát triển tốt ở độ cao dưới 1200 m so với mặt nước biển, nhiệt độ thích hợp là 18 – 32 độ C. Nhiệt độ tối ưu là 25 độ C. Cây cần khá nhiều nước với lượng mưa trung bình là 1500 mm/năm được phân bố đều trong năm.</p><p>Cây có thể cho trái sau 3 năm trồng. Trái phân bố đều trên cây, với trọng lượng trung bình là từ 2 đến 3 kg một trái. Dạng trái hình trục, có phần đáy trái hẹp. Vỏ trái mỏng, có màu vàng xanh.</p><p>Tỷ lên cơm trên trái là trên 30%. Màu cơm vàng hấp dẫn, mùi thơm, béo và có vị ngọt đậm. Hạt bé hoặc lép hoàn toàn. Được đánh giá là một trong những giống sầu riêng ngon nhất hiện nay.</p><p>Giống sầu riêng RI6&nbsp;có tán rộng, đẹp với tuổi thọ cao từ 25 – 30 năm, cây cho năng suất ổn định với doanh thu cao từ 400- 500 triệu/ha. Bạn có thể trồng xen với các loại cây ăn trái khác như ổi, ca cao hay quýt để tăng thêm thu nhập trên cùng một đơn vị diện tích khi cây đã bắt đầu khép tán.</p><p>&nbsp;</p>', '1', '0', '3567', ',nông sản sạch', '949', '2018-06-02 17:58:11', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('164', 'Thanh Long Hữu Cơ (ruộ', 'thanh-long-huu-co-ruo-', '10', '/UploadedFiles/images/productImages/lnphoto_159_large.jpg', '[\"/UploadedFiles/images/productImages/lnphoto_159_master.jpg\",\"/UploadedFiles/images/productImages/lnphoto_432_master.jpg\"]', '39000.00', '34125.00', '24818.18', null, '<p>Thanh Long Hữu Cơ ruột t&iacute;m hồng, sản phẩm được cung cấp bởi Thực phẩm an to&agrave;n Sunfood.</p>', '<p>Thanh Long Hữu Cơ ruột tím hồng, sản phẩm được cung cấp bởi Thực phẩm an toàn Sunfood.</p>', '1', '0', '3568', ',nông sản sạch', '955', '2018-06-02 17:58:12', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('165', 'Thanh Long ruột trắng', 'Thanh-Long-ruot-trang', '10', '/UploadedFiles/images/productImages/upload_c111941bb6544dcd87b7002dc42196ca_large.jpg', '[\"/UploadedFiles/images/productImages/upload_c111941bb6544dcd87b7002dc42196ca_master.jpg\",\"/UploadedFiles/images/productImages/upload_b11e1c140a854ed1a015fa92cf1724a8_master.jpg\",\"/UploadedFiles/images/productImages/upload_7592a20ab9fb454f8fefa713b9c36a82_master.jpg\",\"/UploadedFiles/images/productImages/upload_0e5c071eb5194c3db431b3775a85bd3c_master.jpg\"]', '29000.00', '25375.00', '18454.54', null, '<p><strong>Thanh long</strong>&nbsp;l&agrave; một loại tr&aacute;i c&acirc;y mềm, c&oacute; vị ngon ngọt, m&aacute;t bổ, được nhiều người y&ecirc;u th&iacute;ch. Thực phẩm thường được d&ugrave;ng l&agrave;m m&oacute;n tr&aacute;ng miệng, mời kh&aacute;ch hay l&agrave;m sinh tố, nước giải kh&aacute;t uống h&agrave;ng ng&agrave;y.&nbsp;Thanh long c&oacute; chứa vitamin C, B1, B2 v&agrave; B3, c&aacute;c kho&aacute;ng chất thiết yếu bao gồm phốt pho, sắt v&agrave; canxi, rất tốt cho sức khỏe. Thực phẩm c&oacute; t&aacute;c dụng l&agrave;m đẹp da, chống ung thư, cải thiện sức khỏe tim mạch, kiểm so&aacute;t v&agrave; ph&ograve;ng chống bệnh tiểu đường, cải thiện hệ thống ti&ecirc;u h&oacute;a v&agrave; đặc biệt rất tốt cho mắt.</p>\n<p>&nbsp;</p>', '<p><img src=\"//file.hstatic.net/1000198833/file/lnphoto_432_large.jpg\" alt=\"Thanh long\" style=\"display: block; margin-left: auto; margin-right: auto;\"></p><p><strong>Thanh long</strong>&nbsp;là một loại trái cây mềm, có vị ngon ngọt, mát bổ, được nhiều người yêu thích. Thực phẩm thường được dùng làm món tráng miệng, mời khách hay làm sinh tố, nước giải khát uống hàng ngày.&nbsp;Thanh long có chứa vitamin C, B1, B2 và B3, các khoáng chất thiết yếu bao gồm phốt pho, sắt và canxi, rất tốt cho sức khỏe. Thực phẩm có tác dụng làm đẹp da, chống ung thư, cải thiện sức khỏe tim mạch, kiểm soát và phòng chống bệnh tiểu đường, cải thiện hệ thống tiêu hóa và đặc biệt rất tốt cho mắt.</p><p><strong>Thanh long</strong>&nbsp;do VinMart phân phối&nbsp;được trồng và chăm sóc bằng phương pháp truyền thống, có nguồn gốc đảm bảo. Thực phẩm tuyệt đối không sử dụng thuốc trừ sâu, các thành phần hóa học, đã được Bộ Y tế kiểm duyệt chất lượng, đảm bảo cho sức khỏe người tiêu dùng.</p><hr><p><strong>Lợi ích sức khỏe tuyệt vời từ thanh long</strong>&nbsp;</p><p><strong>Thanh long</strong>&nbsp;là một nguồn cung cấp vitamin C tuyệt vời. Vitamin C có một vai trò quan trọng hỗ trợ hệ miễn dịch và thậm chí có thể giúp nhanh khỏi và giảm mức độ nghiêm trọng của cảm lạnh thông thường.</p><p>Một trong những lợi ích sức khỏe tốt nhất của&nbsp;<strong>thanh long</strong>&nbsp;là giúp giảm viêm khớp.&nbsp;<strong>Thanh long</strong>&nbsp;được gọi là trái cây chống viêm. Những người bị viêm khớp được khuyến khích thêm thanh long trong chế độ ăn uống lành mạnh của họ.</p><p><strong>Thanh long</strong>&nbsp;rất giàu vitamin A ở dạng carotene- loại chất cần thiết cho võng mạc, độ sáng và tầm nhìn của mắt. Nhiều vấn đề về mắt, đặc biệt là thoái hóa điểm vàng liên quan đến tuổi tác, có thể được gây ra bởi sự thiếu hụt vitamin A. Thanh long có tác dụng duy trì và cải thiện thị lực.</p><p><strong>Thanh long</strong>&nbsp;có thể giúp cải thiện sức khỏe tim mạch bằng cách giảm mức cholesterol xấu và bổ sung thêm cholesterol tốt. Trái cây này rất giàu chất béo không bão hòa đơn giúp trái tim được nghỉ ngơi trong tình trạng tốt nhất</p><p>&nbsp;</p>', '1', '0', '19125', ',nông sản sạch', '961', '2018-06-02 17:58:19', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('166', 'Cam Cara Mỹ', 'Cam-Cara-My', '11', '/UploadedFiles/images/productImages/cam-cara_be56c53a95f8497db96939a99aa18f92_large.jpg', '[\"/UploadedFiles/images/productImages/cam-cara_be56c53a95f8497db96939a99aa18f92_master.jpg\",\"/UploadedFiles/images/productImages/cam-cara_master.jpg\",\"/UploadedFiles/images/productImages/cara-cara-oranges_master.jpg\",\"/UploadedFiles/images/productImages/cara-cara-orange_master.jpg\"]', '129000.00', '112875.00', '46909.09', null, '<p>Cam ruột đỏ kh&ocirc;ng hạt Mỹ thuộc giống Cara Cara c&oacute; vị ngọt đặc biệt, hương thơm của cam ruột đỏ dễ l&agrave;m người ta li&ecirc;n tưởng đến hương bưởi. Với đặc trưng nhiều nước v&agrave; vị ngọt kh&aacute; lạ, Cam ruột đỏ được ưa chuộng hơn nhiều so với người anh em Navel.</p>\n<p>Thuộc giống Cara cara, lớp vỏ của cam ruột đỏ kh&ocirc;ng hạt dễ l&agrave;m người ta li&ecirc;n tưởng tới cam navel, nhưng kh&aacute;c với navel, cam cara cara kh&ocirc;ng hề c&oacute; phần &ldquo;rốn&rdquo; v&agrave; nếu để &yacute; kỹ, c&aacute;c bạn sẽ thấy phần vỏ trơn l&aacute;ng của cam ruột đỏ kh&ocirc;ng hạt hơi c&oacute; sắc hồng.</p>', '<h4 style=\"text-align: center;\">CAM CARA RUỘT ĐỎ<br></h4><h4>LỢI ÍCH KHI ĂN CAM CAM CARA RUỘT ĐỎ</h4><h4>► Chống lão hóa da</h4><p>Trong quả cam cara ruột đỏ chứa hàm lượng vitamin C rất lớn 130% nhu cầu vitamin C hàng ngày nên rất tốt cho da, chống lão hóa rất thích hợp cho người mệt mỏi vì tăng cường sức đề kháng</p><h4>► Ngăn ngừa ung thư</h4><p>Chất Lycopene là một loại chất chống oxy hóa giúp ngăn ngừa các bệnh ung thư và giúp hệ tim mạch luôn khỏe mạnh</p><h4>►Phòng chống táo bón</h4><p>Chất xơ trong cam giúp phòng chống táo bón, giúp hệ tiêu hóa khỏe mạnh, giúp làn da luôn khỏe khoắn</p><p>Ngoài ra trong cam cara này còn chứa nhiều chất dinh dưỡng khác như vitamin A,B, canxi, Magie, sắt, đồng, iot..</p><p>&nbsp;</p>', '1', '0', '3567', 'hàng nhập khẩu,đặc sản,nông sản sạch', '967', '2018-06-02 17:58:37', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('167', 'Cam Vàng', 'Cam-Vang', '11', '/UploadedFiles/images/productImages/oranges_large.jpg', '[\"/UploadedFiles/images/productImages/oranges_master.jpg\"]', '69000.00', '60375.00', '25090.90', null, '<p>Cam ruột đỏ &Uacute;c kh&ocirc;ng hạt&nbsp;c&oacute; chứa nhiều Vitamin C, tốt cho da, chống l&atilde;o h&oacute;a, giảm Cholesterol, c&oacute; t&aacute;c dụng hồi phục sức khỏe nhanh, tăng cường chức năng tạo hồng huyết cầu, giảm căng thẳng thần kinh.&nbsp;</p>', '<p><span><strong></strong></span><span><strong>1.&nbsp;&nbsp; &nbsp;Giống và chủng loại:</strong></span><br><span>Cam phát triển ở những khu vực khí hậu nhiệt đới, và cận nhiệt đới ấm nóng và được chia thành hai loại: cam ngọt và cam đắng. Cam ngọt được ưa chuộng hơn. Các chủng loại phổ biến của cam ngọt bao gồm cam Valencia, Navel và Jaffa và cam đỏ Cara. Hiện nay, cam Cara được trồng rộng rãi ở Úc, Mỹ, Brazil, Bắc Phi, Địa Trung Hải.<br>&nbsp;Nhiệt độ lý tưởng để trồng cam là 13oC đến 18oC vào mùa đông, và lên đến 35oC vào mùa hè.<br>Cam đỏ Cara Úc loại quả to, ngoài vỏ màu vàng đậm, ruột có màu đỏ, vị ngọt, mọng nước, không hạt và dễ bóc vỏ. Một quả cam trung bình 180g có 200kJ.<br><strong>2.&nbsp;&nbsp; &nbsp;Xuất xứ và mùa vụ:&nbsp;</strong><br><strong>•&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; Xuất xứ:&nbsp;</strong>Úc<br><strong>•&nbsp;&nbsp; &nbsp; Mùa vụ:</strong><br>&nbsp;Cam Cara thu hoạch từ tháng 5 đến tháng 10.<br><strong>3.&nbsp;&nbsp; Thông tin dinh dưỡng:&nbsp;</strong><br>Cam Úc chứa nhiều Vitamin C, tốt cho da, chống lão hóa, giảm Cholesterol, có tác dụng hồi phục sức khỏe nhanh, tăng cường chức năng tạo hồng huyết cầu, giảm căng thẳng thần kinh. Việc tiêu thụ vitamin C ở liều cao (khoảng 500mg mỗi ngày) rất tốt cho người ốm.<br>Quả cam Cara mọng nước chứa một hàm lượng Vitamin C cao đến mức chỉ cần ăn một quả cũng đáp ứng được 130% nhu cầu vitamin C hàng ngày của chúng ta. Ngoài ra, cam Navel còn được biết tới như một loại đồ ăn kiêng giàu chất xơ, Vitamin A, B, Canxi, Magnesium, Sắt, Đồng, I ốt…<br>Ăn cam thường xuyên sẽ giúp phòng tránh các bệnh truyền nhiễm do virus; giảm đáng kể nguy cơ mắc bệnh sỏi thận. Để tránh lượng calo dư thừa, hãy bổ sung Cam Cara Úc vào chế độ dinh dưỡng hàng ngày của mình.<br><strong>4.&nbsp;&nbsp; &nbsp;Lưu ý bảo quản và sử dụng:</strong><br>-&nbsp;&nbsp; &nbsp;Cam có thể được bảo quản ở nhiệt độ phòng hoặc trong tủ lạnh. Nếu bảo quản trong tủ lạnh, nhiệt độ thích hợp nhất từ 7oC – 10oC. Đối với cả hai phương pháp bảo quản, cam thường sẽ để được trong khoảng 2 tuần, và hầu như sẽ giữ được cùng hàm lượng vitamin. &nbsp;<br>-&nbsp;&nbsp; &nbsp;Cách tốt nhất để bảo quản cam là để tự nhiên thay vì cho vào túi nhựa vì nếu tiếp xúc với độ ẩm, cam có thể dễ dàng xuất hiện nấm mốc.<br>-&nbsp;&nbsp; &nbsp;Cam Cara Úc không có hạt, vị ngọt thanh, ít xơ thường dùng để ăn tươi chứ không nên ép nước.&nbsp;&nbsp; &nbsp;<br>-&nbsp;&nbsp; &nbsp;Nước cam ép và vỏ cam cũng có thể được bảo quản để sử dụng sau này. Cho nước cam mới ép vào các khay làm đá rồi cho vào tủ làm đá, sau đó bảo quản chúng trong các túi nhựa đặt vào tủ làm đá. Vỏ cam phơi khô nên được bảo quản ở những nơi khô ráo trong hộp đựng có nắp đậy kín.</span></p>', '1', '0', '1002', 'hàng nhập khẩu,đặc sản,nông sản sạch', '972', '2018-06-02 17:58:38', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('168', 'Cam vàng Nam Phi', 'Cam-vang-Nam-Phi', '11', '/UploadedFiles/images/productImages/cam_nam_phi-02_6ed26df7066e425ab2b78a532a98f6bc_large.jpg', '[\"/UploadedFiles/images/productImages/cam_nam_phi-02_6ed26df7066e425ab2b78a532a98f6bc_master.jpg\",\"/UploadedFiles/images/productImages/cam_nam_phi-01_master.jpg\",\"/UploadedFiles/images/productImages/cam_nam_phi-03_master.jpg\"]', '74000.00', '64750.00', '26909.09', null, '<p>Tr&aacute;i c&acirc;y nhập khẩu do Sunfood cung cấp</p>', '<p>Cam vàng Nam Phi&nbsp;có màu vàng rất đẹp được phủ sẽ trên bề mặt của quả cam, lớp vỏ phía ngoài trơn và mềm mại. Ruột có màu vàng tươi, nhiều nước và ngọt, đặc biệt có vị thơm đặc trưng. Sản phẩm&nbsp;Cam vàng Nam Phi&nbsp; được lựa chọn từ những trái cam ngon nhất tại những nông trại sạch tại Nam Phi, được chuyển đổi vận và bảo quản theo quy trình công nghệ hiện đại. Người tiêu dùng có thể toàn hoàn tâm yên và tin tưởng vào sự lựa chọn của mình.</p><p>Cam vàng Nam Phi&nbsp;có hình dáng hơi thuôn dài hơn một&nbsp;chút khác với&nbsp;giống cam khác thường thấy ở Việt Nam, có&nbsp;trọng lượng từ 340g to 400g mỗi&nbsp;quả. Cam Nam Phi&nbsp; được thu hoạch từ tháng 5 đến tháng 10 hàng năm.</p><p><strong>Cam vàng Nam Phi tốt cho sức khỏe<br> Giúp ngăn ngừa ung thư</strong></p><p>Trong quả cam có một lượng lớn hợp chất D – limonene. Đây là chất có tác dụng bảo vệ cơ thể khỏi nguy cơ phát triển các bệnh ung thư như ung thư phổi, ung thư vú, ung thư da, ung thư dạ dày, đại tràng…</p><p><strong>Ngăn ngừa bệnh thận</strong></p><p>Uống nước cam thường xuyên ngăn ngừa các bệnh về thận và làm giảm nguy cơ sỏi thận.</p><p>Lưu ý: uống nước trái cây với lượng vừa phải. Hàm lượng đường cao trong nước ép trái cây có thể gây sâu răng và hàm lượng axit cao có thể làm hỏng men nếu tiêu thụ quá nhiều.</p><p><strong>Bảo vệ tim</strong></p><p>Cam có chứa kali, một khoáng chất điện giải có tác dụng bảo vệ tim. Khi nồng độ kali bổ sung vào cơ thể quá thấp, bạn có thể gặp vấn đề về tim như là rối loạn nhịp tim.</p><p><strong>Kiểm soát huyết áp</strong></p><p>Các hesperidin flavonoid có trong cam giúp điều chỉnh huyết áp cao và magie có trong cam giúp duy trì huyết áp luôn ở mức ổn định.</p><p><strong>Cam chống lão hóa cho làn da</strong></p><p>Cam có đầy đủ hàm lượng beta-carotene là một chất chống ôxy hóa mạnh mẽ, giúp bảo vệ các tế bào khỏi bị thiệt hại, đồng thời bảo vệ da khỏi các gốc tự do và ngăn ngừa các dấu hiệu lão hóa.</p><p><strong>Giảm nguy cơ bệnh tật</strong></p><p>Cam có chứa đầy đủ vitamin C giúp bảo vệ các tế bào bằng cách trung hòa các gốc tự do. Các gốc tự do chính là nguyên nhân gây ra các bệnh mãn tính như ung thư và bệnh tim mạch.</p><p><strong>Tăng cường thể lực</strong></p><p>Trong nước cam có 1 lượng đường fructoza rất tốt và khoảng 85% lượng nước có tác dụng giải khát và giúp bồi bổ thể lực. Bởi vậy sau khi luyện tập hoặc vận động ra nhiều mồ hôi, cách tốt nhất là uống một nước cam có bỏ thêm muối.</p><p>&nbsp;</p>', '1', '0', '19125', 'hàng nhập khẩu,đặc sản,nông sản sạch', '978', '2018-06-02 17:58:38', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('169', 'Cherry đỏ nhập khẩu', 'Cherry-do-nhap-khau', '11', '/UploadedFiles/images/productImages/lnphoto_237_large.jpg', '[\"/UploadedFiles/images/productImages/lnphoto_237_master.jpg\",\"/UploadedFiles/images/productImages/lnphoto_238_master.jpg\",\"/UploadedFiles/images/productImages/lnphoto_241_master.jpg\"]', '462000.00', '404250.00', '209999.99', null, '<p><strong>Cherry đỏ mỹ</strong>&nbsp;được trồng ở c&aacute;c khu vực Bakerfield, Arvin, Lodi, Stockton v&agrave; Linden. Bởi đ&acirc;y l&agrave; nhưng nơi c&oacute; kh&iacute; hậu ph&ugrave; hợp cho c&acirc;y cherry ph&aacute;t triển. Kh&iacute; hậu kh&ocirc; n&oacute;ng, đặc biệt trong 2 tuần trước khi thu hoạch</p>\n<p><strong>Cherry đỏ mỹ</strong>&nbsp;l&agrave; một loại quả đắt tiền thường được d&ugrave;ng để l&agrave;m qu&agrave; biếu. M&ugrave;a vụ thường bắt đầu từ th&aacute;ng 5 đến th&aacute;ng 8</p>', '<p>Cherry đỏ mỹ&nbsp;được trồng ở các khu vực Bakerfield, Arvin, Lodi, Stockton và Linden. Bởi đây là nhưng nơi có khí hậu phù hợp cho cây cherry phát triển. Khí hậu khô nóng, đặc biệt trong 2 tuần trước khi thu hoạch</p><p>Cherry đỏ mỹ&nbsp;là một loại quả đắt tiền thường được dùng để làm quà biếu. Mùa vụ thường bắt đầu từ tháng 5 đến tháng 8</p><ul><li>Đặc điểm</li></ul><p>Bên ngoài:&nbsp;Cherry đỏ mỹ&nbsp; to, chắc, có màu vàng kết hợp với màu đỏ tươi, khi chín có màu đỏ gụ đậm.</p><p>Bên trong: Phần thịt nhiều nước có màu vàng đỏ nhạt óng ả như ngọc, thịt chắc giòn, hạt nhỏ khi ăn không bị dính thịt vào hạt tạo cảm giác rất sảng khoái</p><p>Hương vị:&nbsp; Vị ngọt đậm đà, hương thơm dịu nhẹ, lượng đường tự nhiên tốt cho sức khỏe đem đến cảm giác thư giãn, thoải mái</p><ul><li>Dinh dưỡng và sức khỏe</li></ul><p>Với Vitamin A, Sắt, Chất xơ, không cholesterol, Natri&nbsp;cherry đỏ mỹ&nbsp;đúng là loại hoa quả tốt cho sức khỏe con người đặc biệt là hệ miễn dịch vầ hệ tiêu hóa.</p><p>Chất chống oxy hóa trong cherry có khả năng làm giảm nồng độ Acid uric ngăn chặn bệnh gout hiệu quả</p><p>Cherry&nbsp;rất tốt cho hệ tim mạch, ngăn ngừa ung thư và là một loại quả giúp giảm đau, giảm viêm.</p><p>Điều hòa giấc ngủ ngon nhờ chất melatonin có trong cherry.</p><ul><li>Làm đẹp</li></ul><p>Cherry đỏ mỹ&nbsp;có hàm lượng chất chống oxy hóa cao nhất với 17 hợp chất chống oxy hóa khác nhau. Vì vậy nó có khả năng đẩy lùi các gốc tự do cái mà khiến con người trông già đi.</p><p>Giàu vitamin A với đặc tính kháng khuẩn, giúp loại bỏ độc tố trong máu và vi khuẩn mắc kẹt dưới da ngăn chặn, chữa trị mụn xảy ra. Và giúp da sáng mịn.</p><p>Cách làm mặt nạ&nbsp;cherry</p><p>Nghiền nguyễn 5 đến 6 trái</p><p>Trộng cùng 2 thìa cà phê mật ong</p><p>Thoa đều nên mặt và để trong khoảng từ 20 đến 30 phút</p><p>Tửa lại mặt với nước ấm</p><p>Với cách này bạn sẽ loại bỏ các vấn đề về mụn cũng như giúp da trở lên sáng khỏe hơn rất nhiều.</p><p>&nbsp;</p>', '1', '0', '1002', 'hàng nhập khẩu,đặc sản,nông sản sạch', '984', '2018-06-02 17:58:39', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('170', 'Kiwi New Zealand Vàng 22', 'Kiwi-New-Zealand-Vang-22', '11', '/UploadedFiles/images/productImages/lnphoto_191_large.jpg', '[\"/UploadedFiles/images/productImages/lnphoto_191_master.jpg\",\"/UploadedFiles/images/productImages/lnphoto_189_master.jpg\",\"/UploadedFiles/images/productImages/lnphoto_193_master.jpg\",\"/UploadedFiles/images/productImages/kiwi-nzl-02_60eaf1de41e5482589bc241154a25cac_master.jpg\",\"/UploadedFiles/images/productImages/kiwi-nzl-01_master.jpg\",\"/UploadedFiles/images/productImages/kiwi-nzl-03_master.jpg\"]', '239000.00', '209125.00', '108636.36', null, '<p>Tr&aacute;i c&acirc;y nhập khẩu do Sunfood cung cấp</p>', '<p>Thông tin sản phẩm</p><p>Kiwi vàng&nbsp;là loại trái cây đỉnh cao, có hình bầu dục, kích thước bằng 1 quả trứng gà lớn , từ 5 – 8 cm chiều dài và 4,5 – 5,5 cm đường kính. Kiwi vàng hơi chua, chín có vị ngọt.</p><p>Lợi ích sức khỏe</p><p>- Vitamin C: trong 1 quả kiwi vàng có hàm lượng bằng 02 quả cam, do đó mỗi ngày bạn chỉ cần ăn một quả kiwi vàng là đã có đủ lượng Vitamin C cần thiết cho cơ thể, hàm lượng 92,7mg/100g</p><p>-Trong 1 quả kiwi vàng có cùng lượng kali so với 1 quả chuối, nhưng lượng calo lại chỉ bằng một nửa nên hàm lượng muối rất thấp mà vẫn đảm bảo lượng kali cao, hàm lượng 40,3 mg/100g</p><p>- Kiwi vàng còn là nguồn cung cấp chất xơ và Vitamin E rất tốt cho cơ thể với hàm lượng 1,46 mg/100g</p><p>- Ăn 2 – 3 quả kiwi vàng mỗi ngày trong vòng 28 ngày sẽ giúp bạn giảm đáng kể sự kết tập của tiểu huyết cầu, có khả năng làm giảm nguy cơ máu đông cục – đây là một yếu tố có nguy cơ cao dẫn tới làm tắc động mạch và các mạch máu.</p><p>Hiện nay Kiwi có 2 giống chính: Kiwi vàng và Kiwi vàng, trong đó kiwi vàng là giống thuần chủng (nguyên sơ từ thời cổ đại), còn kiwi vàng là giống lai tạo (do con người tạo ra).</p><p>&nbsp;</p>', '1', '0', '10427', 'hàng nhập khẩu,đặc sản,nông sản sạch', '990', '2018-06-02 17:58:39', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('171', 'Lê má hồng Nam Phi', 'Le-ma-hong-Nam-Phi', '11', '/UploadedFiles/images/productImages/lnphoto_225_large.jpg', '[\"/UploadedFiles/images/productImages/lnphoto_225_master.jpg\",\"/UploadedFiles/images/productImages/le-ma-hong-nam-phi-01_master.jpg\",\"/UploadedFiles/images/productImages/le-ma-hong-nam-phi-02_master.jpg\",\"/UploadedFiles/images/productImages/le-ma-hong-nam-phi-03_master.jpg\"]', '129000.00', '112875.00', '117272.72', null, '<p>Tr&aacute;i c&acirc;y nhập khẩu do Sunfood cung cấp</p>', '<p>Đặc điểm sản phẩm:&nbsp;Lê má hồng Nam Phi là quả nhỏ, màu sắc đẹp, ăn giòn, ngọt, vỏ có vị hơi chát.</p><p>Giá trị dinh dưỡng: Cung cấp vitamin C và pectin giúp tăng sức đề kháng, cải thiện bệnh lý về hô hấp, tiêu hóa, giảm cholesterol trong máu đồng thời ổn định huyết áp.Thường xuyên ăn lê phòng chữa được chứng hay mệt, sưng đau họng, lợi, lưỡi, đi tiểu vàng, táo bón, mắt sưng đỏ, phòng chữa bệnh tăng huyết áp thể can thượng cang hoặc hỏa thượng viêm. ..</p><p>Cách sử dụng: Lê có thể ăn trực tiếp hoặc chế biến thành các món ăn ngon. Lê&nbsp;có thể ăn cho bữa sáng, bữa trưa và bữa tối.</p><p>&nbsp;</p>', '1', '0', '18307', 'hàng nhập khẩu,đặc sản,nông sản sạch', '996', '2018-06-02 17:58:41', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('172', 'Lê Nâu Hàn Quốc', 'Le-Nau-Han-Quoc', '11', '/UploadedFiles/images/productImages/le-han-quoc-01_large.jpg', '[\"/UploadedFiles/images/productImages/le-han-quoc-01_master.jpg\",\"/UploadedFiles/images/productImages/le-han-quoc-02_master.png\"]', '89000.00', '77875.00', '56636.36', null, '<p>L&ecirc; n&acirc;u H&agrave;n Quốc&nbsp;l&agrave;&nbsp;hoa quả nhập khẩu&nbsp;c&oacute; d&aacute;ng quả tr&ograve;n to, k&iacute;ch thước lớn, mỗi quả nặng từ 600- 750 gram. Vỏ kh&aacute; mỏng, mịn v&agrave; c&oacute; m&agrave;u v&agrave;ng n&acirc;u nhạt, khi bổ ra c&oacute; m&agrave;u trắng mọng nước.</p>', '<p>Lê nâu Hàn Quốc&nbsp;là&nbsp;hoa quả nhập khẩu&nbsp;có dáng quả tròn to, kích thước lớn, mỗi quả nặng từ 600- 750 gram. Vỏ khá mỏng, mịn và có màu vàng nâu nhạt, khi bổ ra có màu trắng mọng nước.</p><p>Lê nâu Hàn Quốc không những thơm ngon mà còn có nhiều tác dụng chữa bệnh mà nhiều người chưa biết đến:</p><ul><li><h4>Ngăn ngừa bệnh tiểu đường.</h4></li></ul><p>Trong lê nâu có chứa nhiều chất xơ dễ hòa tan nên ngăn ngừa được sự phát triển của bệnh tiểu đường.&nbsp;Đối với các bệnh nhân bệnh tiểu đường thì lê nâu vừa là loại trái cây ngon miệng lại vừa chữa bệnh rất tốt.</p><ul><li><h4>Thanh nhiệt, giải độc, tăng cường sức khỏe.</h4></li></ul><p>Là loại trái cây có nhiều vitamin A, E, C, nước, lê nâu giúp tăng cường sức khỏe, bổ sung dưỡng chất, nước cho cơ thể. Đặc biệt, đối với những người lao động nặng hoặc vận động nhiều thì việc ăn lê nâu Hàn Quốc thường xuyên sẽ vô cùng tốt.</p><ul><li><h4>Làm đẹp da</h4></li></ul><p>Thường xuyên ăn lê nâu sẽ giúp làn da căng mịn, sáng bóng do được bổ sung vitamin E và nước từ quả lê.Bên cạnh đó, chị em có thể sử dụng lê nâu để làm mặt nạ dưỡng da giúp căng da, giảm nếp nhăn, ngăn ngừa mụn, giảm độ nhờn và trắng da.</p><p>Lê nâu Hàn Quốc&nbsp;là sản phẩm rất được người dân hàn Quốc yêu thích. Đến nay, sản phẩm này đã xuất hiện nhiều ở Việt Nam và ngày càng được người tiêu dùng ưa chuộng.&nbsp;Hãy bổ sung sản phẩm này&nbsp;vào thực đơn hằng ngày để đảm bảo sức khỏe cho cả gia đình, đặc biệt là trẻ nhỏ và người lao động với cường độ cao.</p>', '1', '0', '1002', 'hàng nhập khẩu,đặc sản,nông sản sạch', '1002', '2018-06-02 17:58:41', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('173', 'Lựu Peru', 'Luu-Peru', '11', '/UploadedFiles/images/productImages/lnphoto_244_large.jpg', '[\"/UploadedFiles/images/productImages/lnphoto_244_master.jpg\",\"/UploadedFiles/images/productImages/luu-peru_0482520a905b4389b9c91af266d178f8_master.jpg\",\"/UploadedFiles/images/productImages/luu-peru1_master.jpg\",\"/UploadedFiles/images/productImages/luu-peru-2_master.jpg\"]', '349000.00', '305375.00', '285545.45', null, '', '<h4>Ngăn ngừa&nbsp;bệnh tim mạch</h4><p>Nước ép quả lựu rất giàu polyphenol và chất chống oxy hóa cùng với chất xơ và các hợp chất có giá trị khác có khả năng làm giảm nồng độ cholesterol, ngăn ngừa bệnh tim.Thúc đẩy lưu lượng máu lưu thông tốt hơn: Giảm nguy cơ bệnh mạch vành, thiếu máu cục bộ, ngăn ngừa thiếu máu cơ tim.</p><h4>Phòng chống ung thư</h4><p>Các nghiên cứu cho biết hàm lượng cao chất chống oxy hóa và polyphenol trong lựu ngoài khả năng bảo vệ tim còn có đặc tính chống ung thư hiệu quả. Thường xuyên uống nước ép lựu là điều rất tốt. Việc này có thể ức chế sự tăng trưởng và phát triển của khối u, tế bào ung thưvà cũng thúc đẩy tác dụng của phương pháp điều trị chống ung thư hoặc các phương pháp điều trị bệnh khác.</p><p>Vào năm 2005, các nhà nghiên cứu thuộc Đại học Y Cape Western Reserve phát hiện ra một loại enzyme trong quả lựu có thể làm giảm sự suy thoái của sụn dẫn đến viêm xương khớp.</p><p>Nên thường xuyên ăn lựu để nâng cao sức khỏe và trẻ hóa làn da. Có rất nhiều cách để chế biến món lựu cho bớt nhàm chán: Ăn trực tiếp, làm salad, sinh tố...</p>', '1', '0', '2438', 'hàng nhập khẩu,đặc sản,nông sản sạch', '1007', '2018-06-02 17:58:42', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('174', 'Mận cherry', 'Man-cherry', '11', '/UploadedFiles/images/productImages/man-cherry-1_fa22adb778a04e4893d60bbc4d0a9695_large.jpg', '[\"/UploadedFiles/images/productImages/man-cherry-1_fa22adb778a04e4893d60bbc4d0a9695_master.jpg\",\"/UploadedFiles/images/productImages/man-cherry_master.jpg\",\"/UploadedFiles/images/productImages/man-cherry-3_master.jpg\",\"/UploadedFiles/images/productImages/man-cherry-4_master.jpg\"]', '217000.00', '189875.00', '177545.45', null, '<p>Mận cherry Mỹ l&agrave; sự kết hợp giữa mận v&agrave; cherry Mỹ, do đ&oacute;, c&oacute; h&igrave;nh d&aacute;ng quả mận v&agrave; vị ngọt của cherry.</p>\n<p>Đặc điểm ch&iacute;nh của mận cherry:</p>\n<p>Vỏ đỏ.</p>\n<p>Ruột v&agrave;ng.</p>\n<p>Vị ngọt m&aacute;t, gi&ograve;n, thơm.</p>\n<p>Đ&acirc;y l&agrave; loại tr&aacute;i c&acirc;y c&oacute; m&agrave;u sắc bắt mắt, hương vị rất đặc biệt. &nbsp;H&atilde;y thưởng thức v&agrave; cảm nhận, chắc chắn bạn sẽ vừa l&ograve;ng với loại tr&aacute;i c&acirc;y n&agrave;y.</p>\n<p>&nbsp;</p>', '<p>Mận cherry Mỹ là sự kết hợp giữa mận và cherry Mỹ, do đó, có hình dáng quả mận và vị ngọt của cherry.</p><p>Đặc điểm chính của mận cherry:</p><p>Vỏ đỏ.</p><p>Ruột vàng.</p><p>Vị ngọt mát, giòn, thơm.</p><p>Đây là loại trái cây có màu sắc bắt mắt, hương vị rất đặc biệt. &nbsp;Hãy thưởng thức và cảm nhận, chắc chắn bạn sẽ vừa lòng với loại trái cây này.</p><p>&nbsp;</p>', '1', '0', '18307', 'hàng nhập khẩu,đặc sản,nông sản sạch', '1013', '2018-06-02 17:58:42', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('175', 'Nho đen MidNight Beauty', 'Nho-den-MidNight-Beauty', '11', '/UploadedFiles/images/productImages/lnphoto_213_large.jpg', '[\"/UploadedFiles/images/productImages/lnphoto_213_master.jpg\",\"/UploadedFiles/images/productImages/nho-den-midnight-beauty_master.jpg\",\"/UploadedFiles/images/productImages/nho-den-midnight-beauty-1_master.jpg\",\"/UploadedFiles/images/productImages/nho-den-midnight-beauty-2_master.jpg\"]', '219000.00', '191625.00', '119454.54', null, '<p>Nho đen kh&ocirc;ng hạt&nbsp;Midnight Beauty Mỹ&nbsp;l&agrave; loại tr&aacute;i c&acirc;y được trồng tại Mỹ, l&agrave; một trong những chủng ch&iacute;nh của nho đen kh&ocirc;ng hạt Mỹ.</p>', '<p>Nho đen không hạt&nbsp;Midnight Beauty Mỹ&nbsp;là loại trái cây được trồng tại Mỹ, là một trong những chủng chính của nho đen không hạt Mỹ.</p><p>Mùa vụ của loại trái cây này là từ tháng 5 đến tháng 1 năm sau. Nho đen không hạt Mỹ cung cấp chất chống oxy hóa rất tốt cho tim mạch, huyết áp cao. Loại trái cây Nho này chúng cũng rất tốt cho mắt, não và trí nhớ. Việc ăn nho thường xuyên giúp cơ thể khỏe mạnh, giúp nhanh phục hồi đối với những người bị thiếu máu kinh niên, những bệnh nhân bị huyết áp cao, viêm phế quản, gout, viêm dạ dày và táo bón.</p><p>Nho đen không hạt&nbsp; Mỹ sau khi nhập về được bảo quản bằng hệ thống bảo quản lạnh liên tục nên giữ được độ tươi ngon và dưỡng chất tự nhiên của trái nho.</p><p>Nho thích hợp ăn chơi, ăn vặt, bổ sung dưỡng chất, làm quà tặng sang trọng hay quà tặng sinh nhật. Ngoài ra, loại trái cây này là một trong những loại trái cây tốt cho bà bầu.</p><p>&nbsp;</p>', '1', '0', '10427', 'hàng nhập khẩu,đặc sản,nông sản sạch', '1019', '2018-06-02 17:58:43', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('176', 'Nho đỏ không hạt', 'Nho-do-khong-hat', '11', '/UploadedFiles/images/productImages/nho-do-01_large.jpg', '[\"/UploadedFiles/images/productImages/nho-do-01_master.jpg\",\"/UploadedFiles/images/productImages/nho-do-02_master.jpg\",\"/UploadedFiles/images/productImages/nho-do-03_master.jpg\"]', '147000.00', '128625.00', '93545.45', null, '<p>Tr&aacute;i c&acirc;y nhập khẩu do Sunfood cung cấp</p>', '<h4 style=\"padding-left: 30px;\">Giới thiệu<br></h4><p style=\"padding-left: 30px;\">Nho đỏ không hạt&nbsp;được nhập khẩu trực tiếp từ Nam Phi, canh tác theo đúng quy trình sản xuất nho an toàn, không sử dụng hóa chất nên tuyệt đối an toàn cho sức khỏe người tiêu dùng. Sản phẩm không chỉ&nbsp;thích hợp dùng làm món ăn tráng miệng sau bữa cơm gia đình mà còn&nbsp;là loại trái cây thích hợp dùng làm quà biếu tặng.</p><ol><li style=\"display: inline !important;\"><h4>&nbsp;Đặc điểm</h4></li></ol><p style=\"padding-left: 30px;\"> Nho đỏ không hạt Nam Phi có quả màu đỏ tươi, vỏ mỏng, thịt dày giòn, hương vị thơm ngọt ngào và mọng nước đem đến cảm giác sảng khoái tuyệt vời mỗi khi ăn.&nbsp;Quả nho thon dài, vỏ bóng và màu sắc chín đều.&nbsp;Bạn có thể ăn trực tiếp hoặc ép nước dùng hàng ngày đều tận hưởng được hương vị cũng như giá trị dinh dưỡng của quả.&nbsp;<br></p><h4 style=\"display: inline !important; padding-left: 30px;\">&nbsp;Giá trị dinh dưỡng</h4><p style=\"padding-left: 30px;\">Nho đỏ không hạt Nam Phi​ không chỉ là loại trái cây được nhiều người ưa thích bởi hương vị tự nhiên tươi ngon mà&nbsp;nó còn chứa nhiều vitamin và khoáng chất tốt cho cơ thể. Hợp chất quan trọng nhất chứa trong trái nho tươi là những hợp chất flavonoids - những hợp chất chống oxy hóa tự nhiên có tác dụng phòng ngừa ung thư và bệnh xơ vữa động mạch, bệnh mạch vành. Trong vỏ nho tươi chứa resveratrol có tác dụng làm gia tăng nồng độ cholesterol tốt trong máu.<br> - Cứ 100g thịt nho đỏ không hạt có chứa khoảng 68 calo, 10-12g đường dễ hấp thụ, 11mg vitamin C, cùng polyphenol, chất xơ, kali, vitamin A, vitamin B, chất chống oxy hóa… nên là thực phẩm cực lành mạnh và tốt cho sức khỏe của con người<br> - &nbsp; Ăn nho hàng ngày giúp mạch máu giãn nở, máu lưu thông dễ dàng hơn, ổn định huyết áp, giảm nguy cơ đau tim<br> - &nbsp; Khoa học đã chứng minh, lượng nước, kali, chất xơ cao nên nho Úc là trái cây giải độc tuyệt vời cho cơ thể, phòng chống ung thư gan<br> - &nbsp; Ngoài ra, nho đỏ Nam Phi còn chữa chứng đau nửa đầu, tăng cường hệ miễn dịch, giảm tác hại của thuốc lá với phổi<br></p><h4 style=\"display: inline !important; padding-left: 30px;\">&nbsp;Sử dụng và bảo quản</h4><p style=\"padding-left: 30px;\">Nho là trái cây nhạy cảm với nước và nhiệt độ nên nếu không biết sử dụng và bảo quản sẽ rất nhanh hỏng. Nhiệt độ bảo quản tốt nhất là từ 0 – 4 độ C, luôn để nho ở tình trạng khô ráo (không rửa trước) trong hộp kín để bảo vệ lớp phấn tự nhiên của quả.<br></p><p>&nbsp;</p>', '1', '0', '2438', 'hàng nhập khẩu,đặc sản,nông sản sạch', '1025', '2018-06-02 17:58:44', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('177', 'Nho Ngón Tay Mỹ', 'Nho-Ngon-Tay-My', '11', '/UploadedFiles/images/productImages/lnphoto_195_large.jpg', '[\"/UploadedFiles/images/productImages/lnphoto_195_master.jpg\",\"/UploadedFiles/images/productImages/nho-den-ngon-tay-my-01_master.png\",\"/UploadedFiles/images/productImages/lnphoto_199_master.jpg\",\"/UploadedFiles/images/productImages/1_img_1777_master.jpg\",\"/UploadedFiles/images/productImages/lnphoto_196_master.jpg\",\"/UploadedFiles/images/productImages/lnphoto_198_master.jpg\"]', '259000.00', '226625.00', '164818.18', null, '<p>Nho Ng&oacute;n Tay Mỹ m&agrave;u đen sậm cũng như c&aacute;c loại nho đen kh&ocirc;ng hạt kh&aacute;c, b&ecirc;n ngo&agrave;i vỏ được bọc lớp phấn phủ gi&uacute;p bảo vệ quả nho.</p>', '<p>Nho ngón tay&nbsp;100% Tươi Ngon Nhập Khẩu Từ Mỹ</p><p>Với hình dáng thật đặc biệt những quả nho ngón tay Mỹ thần thánh này trở nên đắc giá và được săn lùng nhiều nhất bởi vị ngọt dịu và giòn của quả nho. Nhìn hình quả như ngón tay với kích thước khoảng 3-4 cm</p><p>Màu đen sậm cũng như các loại nho đen không hạt khác bên ngoài vỏ được bọc lớp phấn phủ giúp bảo vệ quả nho.</p><p>DINH DƯỠNG NHO NGÓN TAY MỸ</p><p>Nho ngón tay Mỹ chứa nhiều thành phần dinh dưỡng rất tốt cho cơ thể và đẹp da. Đặc biệt là vỏ nho chứa chất chống oxy hóa giúp tăng cường đề kháng.</p><p>Nho có thể làm nước ép, bánh, salad …. Và loại trái cây giàu dinh dưỡng này rất tốt cho bà mẹ và thai nhi</p><p>BẢO QUẢN NHO NGÓN TAY MỸ</p><p>Nho ngón tay Mỹ&nbsp;cũng như nhiều loại trái cây nhập khẩu khác là rất nhạy cảm bởi nhiệt độ nên chúng cần được bảo quản ở nhiệt độ 0-4 oC để luôn tươi ngon.</p><p>Tránh chồng lên nhau, dễ bị nhiễm mùi và nhiễm khuẩn nếu thấm nước nên chỉ rửa ngay khi ăn.</p>', '1', '0', '18307', 'hàng nhập khẩu,đặc sản,nông sản sạch', '1031', '2018-06-02 17:58:44', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('178', 'Nho xanh nhập khẩu', 'Nho-xanh-nhap-khau', '11', '/UploadedFiles/images/productImages/upload_01ee2bfdae7d461b815defb92476944e_large.jpg', '[\"/UploadedFiles/images/productImages/upload_01ee2bfdae7d461b815defb92476944e_master.jpg\",\"/UploadedFiles/images/productImages/upload_1014257a591f4df6a5557e26606574c7_master.jpg\",\"/UploadedFiles/images/productImages/upload_2aa9304ef25c4ef5a38fb2c391813a0d_master.jpg\",\"/UploadedFiles/images/productImages/upload_bb1b3be2318a400c9d6d16fb99d1779d_master.jpg\",\"/UploadedFiles/images/productImages/upload_91c90fb5d4a546cdb242e9cb2326d3fb_master.jpg\",\"/UploadedFiles/images/productImages/upload_b656e605da724b1caec0b4582ff5c736_master.jpg\",\"/UploadedFiles/images/productImages/cottoncandy_master.jpg\"]', '249000.00', '217875.00', '90545.45', null, '<p>Nho xanh nhập khẩu từ Mỹ &Uacute;c, với những giống nho nổi tiếng thế giới như Autumn crisp, Bella, Sugar Crunch, Pristine. Những d&ograve;ng nho c&oacute; độ ngọt thanh, gi&ograve;n rụm, k&iacute;ch th&iacute;ch vị gi&aacute;c người d&ugrave;ng, một lần nếm thử kh&oacute; m&agrave; qu&ecirc;n được hương vị tuyệt vời ấy.</p>\n<p>Lưu &yacute; chọn loại Nho th&iacute;ch hợp trước khi mua h&agrave;ng.</p>\n<p><img src=\"http://file.hstatic.net/1000198833/file/untitled_ed769cdcf8214652af764de97cfc6d36.png\" alt=\"Lựa chọn loại nho trước khi th&ecirc;m v&agrave;o giỏ h&agrave;ng\" width=\"757\" height=\"300\" /></p>\n<p>Xem <a title=\"Hướng dẫn mua h&agrave;ng tr&ecirc;n Sunfood\" href=\"https://www.youtube.com/watch?v=1ryHO1_IosM&amp;t=5s\">hướng dẫn mua h&agrave;ng tr&ecirc;n Sunfood tại đ&acirc;y</a>!</p>', '<p style=\"text-align: justify;\">Nho xanh nhập khẩu từ Mỹ Úc, với những giống nho nổi tiếng thế giới như Autumn crisp, Bella, Sugar Crunch, Pristine. Những dòng nho có độ ngọt thanh, giòn rụm, kích thích vị giác người dùng, một lần nếm thử khó mà quên được hương vị tuyệt vời ấy.</p><h2 style=\"text-align: justify;\">Tác dụng của nho xanh không hạt nhập khẩu:</h2><p style=\"text-align: justify;\"><img src=\"//product.hstatic.net/1000198833/product/nho-xanh-03_large.jpg\" alt=\"Nho xanh nhập khẩu Mỹ Úc\" style=\"display: block; margin-left: auto; margin-right: auto;\"></p><p style=\"text-align: justify;\"><span>Trong nho có chứa polyphenol có thể loại bỏ các nhân tố gây ung thư. Trong vỏ nhỏ có chứa resveratrol có thể ức chế tế bào ung thư phát triển và tiêu diệt tế bào ung thư. Trong hạt và vỏ nho có chứa tannin, catechin, polyphenol và anthocyanidin, tác dụng có thể tốt gấp 20 lần vitamin C, 50 lần vitamin E, chúng có hàm lượng đặc biệt phong phú trong vỏ nhỏ.</span></p><h2 style=\"text-align: justify;\">Đặc điểm nho xanh không hạt nhập khẩu:</h2><p style=\"text-align: justify;\"><img src=\"https://product.hstatic.net/1000198833/product/cottoncandy_grande.jpg\" alt=\"Nho xanh nhập khẩu chất lượng\" style=\"display: block; margin-left: auto; margin-right: auto;\"></p><p style=\"text-align: justify;\"><span>Nho xanh khi chưa chín thường xanh mướt, khi chín sẽ ngả màu xanh nhạt, có nhiều phấn trắng. Nho xanh rất giàu beta-caroten và vitamin A, rất thích hợp với những người làm việc nhiều bằng mắt và dễ viêm nhiễm đường hô hấp trên. Trong Đông y, nho có tác dụng bổ phổi, thanh nhiệt, giải độc.</span></p><p style=\"text-align: justify;\"><span>Liên hệ ngay <a href=\"http://sunfood.com.vn/\" title=\"Cửa hàng thực phẩm sạch Sunfood\">Cửa hàng thực phẩm sạch Sunfood</a> để mua nho xanh không hạt nhập khẩu đảm bảo an toàn chất lượng.</span></p><p style=\"text-align: justify;\">Khám phá quầy <a href=\"http://sunfood.com.vn/collections/trai-cay-nhap-khau\" title=\"trái cây nhập khẩu\">trái cây nhập khẩu Sunfood tại đây</a>.</p><p style=\"text-align: justify;\">Lựa chọn trái cây trong nước đảm bảo chất lượng an toàn tại link: <a href=\"http://sunfood.com.vn/collections/trai-cay-viet-nam\" title=\"Trái cây Việt Nam\">Trái cây Việt Nam</a>.</p><p style=\"text-align: justify;\">Tìm hiểu mùa vụ trái cây trong bài viết: <a href=\"http://sunfood.com.vn/blogs/song-khoe-moi-ngay/mua-trai-cay-viet-nam-va-trai-cay-nhap-khau-theo-mua-vu\" title=\"Trái cây theo mùa\">Trái cây theo mùa</a>.</p>', '1', '0', '2438', 'hàng nhập khẩu,đặc sản,nông sản sạch', '1036', '2018-06-02 17:59:20', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('179', 'Ổi ruột đỏ Đài Loan', 'Oi-ruot-do-Dai-Loan', '11', '/UploadedFiles/images/productImages/lnphoto_215_large.jpg', '[\"/UploadedFiles/images/productImages/lnphoto_215_master.jpg\",\"/UploadedFiles/images/productImages/lnphoto_214_master.jpg\",\"/UploadedFiles/images/productImages/lnphoto_216_master.jpg\",\"/UploadedFiles/images/productImages/lnphoto_217_master.jpg\"]', '26000.00', '22750.00', '21272.72', null, '<p><strong>Ổi ruột đỏ Đ&agrave;i Loan&nbsp;</strong>l&agrave; giống ổi&nbsp;c&oacute; hương vị thơm ngon v&agrave; gi&ograve;n, chứa nhiều chất xơ, vitamin C, A, kẽm, kali v&agrave; mangan c&oacute; t&aacute;c dụng bồi dưỡng hệ ti&ecirc;u h&oacute;a. Theo c&aacute;c nh&agrave; dinh dưỡng, vitamin C trong vỏ ổi gi&uacute;p k&iacute;ch hoạt sự sản xuất chất collagen, hoạt chất cần thiết củng cố độ bền cho khớp xương, sụn, c&oacute; &iacute;ch cho cấu tr&uacute;c của da, gi&uacute;p duy tr&igrave; lượng collagen trong da, giữ cho da lu&ocirc;n ổn định.&nbsp;</p>', '<p><strong>Ổi ruột đỏ Đài Loan&nbsp;</strong>là giống ổi&nbsp;có hương vị thơm ngon và giòn, chứa nhiều chất xơ, vitamin C, A, kẽm, kali và mangan có tác dụng bồi dưỡng hệ tiêu hóa. Theo các nhà dinh dưỡng, vitamin C trong vỏ ổi giúp kích hoạt sự sản xuất chất collagen, hoạt chất cần thiết củng cố độ bền cho khớp xương, sụn, có ích cho cấu trúc của da, giúp duy trì lượng collagen trong da, giữ cho da luôn ổn định.&nbsp;</p><p>Đặc biệt trong ổi còn có nhiều lycopen là một chất chống oxy hoá giúp phòng ngừa ung thư tuyến tiền liệt và rất nhiều kali (một quả ổi cỡ vừa cung cấp được 688mg kali, nhiều hơn 63% kali trong chuối).&nbsp;Sản phẩm <strong>Ổi ruột đỏ Đài Loan&nbsp;</strong>do Sunfood cung cấp, đảm bảo vệ sinh an toàn thực phẩm.</p>', '1', '0', '2438', 'hàng nhập khẩu,đặc sản,nông sản sạch', '1042', '2018-06-02 17:59:21', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('180', 'Táo Envy', 'Tao-Envy', '11', '/UploadedFiles/images/productImages/lnphoto_208_large.jpg', '[\"/UploadedFiles/images/productImages/lnphoto_208_master.jpg\",\"/UploadedFiles/images/productImages/lnphoto_207_master.jpg\",\"/UploadedFiles/images/productImages/lnphoto_209_master.jpg\",\"/UploadedFiles/images/productImages/tao-envy-01_master.jpg\",\"/UploadedFiles/images/productImages/tao-envy-02_master.jpg\",\"/UploadedFiles/images/productImages/tao-envy-03_master.jpg\"]', '269000.00', '235375.00', '195636.36', null, '<p>Tr&aacute;i c&acirc;y nhập khẩu do Sunfood cung cấp</p>', '<p>Táo Envy của New Zealand được trồng ở Vịnh Hawke phía Bắc của đảo Nelson. Năm 1985 Táo Envy Size lớn được ghép thành công bởi Scilate (gốc) với MM106. Hiện nay, táo Envy được độc quyền ở New Zealand, bang Washington (Mỹ) và Chile. Envy New Zealand bắt đầu được thu hoạch vào tháng 02 đến tháng 08 hàng năm.</p><h4>Đặc điểm</h4><p>Táo&nbsp;Envy size lớn hình trái tim bắt mắt, vỏ màu đỏ ruby, căng mịm, cuống màu xanh lá cây, chắc thịt, rất giòn và nhiều nước.</p><h4>Thông tin dinh dưỡng</h4><p>-Táo chứa nhiều chất chống oxy hóa ngăn chặn tế bào và tổn thương mô khỏi các gốc tự do trong cơ thể bằng cách ngăn chặn hoặc làm giảm quá trình oxy hóa.&nbsp;Quả táo giúp giảm nguy cơ bệnh tim, tiểu đường và ung thư.</p><p>-Vitamin và các khoáng chất trong táo cung cấp 2.000 calo mỗi ngày, một quả táo Envy, trung bình cung cấp &nbsp;cho 8% giá trị vitamin C, 2% Fe và Vitamin A, 5% kali.</p><p>-Carbohydrate và chất xơ tự nhiên có trong&nbsp;táo&nbsp;Envy là pectin.&nbsp;Pectin có nhiều trong táo giúp làm giảm huyết áp và ngăn ngừa ung thư ruột kết.&nbsp;Ngoài táo cũng chứa Phytochemical và Flavonoids có chức năng chống dị ứng, chống viêm, chống khối u và các hiệu ứng chất chống oxy hóa trên cơ thể và bảo vệ chống lại quá trình lão hóa.</p>', '1', '0', '15101', 'hàng nhập khẩu,đặc sản,nông sản sạch', '1048', '2018-06-02 17:59:22', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('181', 'Táo Hữu Cơ Gala', 'Tao-Huu-Co-Gala', '11', '/UploadedFiles/images/productImages/gala-apple__1__large.jpg', '[\"/UploadedFiles/images/productImages/gala-apple__1__master.jpg\",\"/UploadedFiles/images/productImages/gala-apple_master.jpg\",\"/UploadedFiles/images/productImages/gala-apple__2__master.jpg\",\"/UploadedFiles/images/productImages/gala-apple__3__master.jpg\"]', '74000.00', '64750.00', '33636.36', null, '<p>T&aacute;o Gala c&oacute; 2 loại ch&iacute;nh l&agrave; Royal Gala v&agrave; Pale Gala.T&aacute;o Gala c&oacute; nguồn gốc Newzealand du nhập v&agrave;o Mỹ năm 1965. Những sọc hồng cam tr&ecirc;n nền v&agrave;ng l&agrave; những dấu hiệu để nhận biết loại t&aacute;o ngọt v&agrave; đầy hương vị n&agrave;y.</p>', '<ol><li>&nbsp;Giống và chủng loại</li></ol><p>Táo Gala có 2 loại chính là Royal Gala và Pale Gala.Táo Gala có nguồn gốc Newzealand du nhập vào Mỹ năm 1965. Những sọc hồng cam trên nền vàng là những dấu hiệu để nhận biết loại táo ngọt và đầy hương vị này.<br></p><ol><li>&nbsp;Xuất xứ và mùa vụ</li></ol><p>Mỹ, tiểu bang Washington là vùng trồng nhiều táo nhất.<br> Ðất đai ở Tiểu bang Washington rất màu mỡ nhờ tro dung nham núi lửa. Một năm trung bình có hơn 300 ngày nắng. Khí hậu khô và nóng nên rất ít gặp các vấn đề về côn trùng và dịch bệnh. Ở đây có một hệ thống tưới tiêu rộng khắp và nguồn cung cấp nước dồi dào từ sông Columbia và vùng núi Cascade. Nên rất thuận lợi cho việc trồng táo.</p><p>Táo Gala bắt đầu được thu hoạch vào giữa tháng 8 và kéo dài đến đầu tháng 9. Gala được bán trên thị trường từ tháng 9 đến tháng 5 năm sau.</p><p>&nbsp;</p><ol><li>&nbsp;Thông tin dinh dưỡng<br> Táo Gala cũng như táo khác, chứa nhiều chất pectin, một chất xơ hòa tan làm giảm cholesterol và chất chống oxy hóa, ngăn ngừa bệnh tim.</li></ol><p>Lượng magiê và kali trong táo giúp điều chỉnh áp suất máu và giữ cho nhịp đập tim ở mức ổn định, chất chống ôxy hoá tự nhiên giúp bảo vệ thành mạch máu.<br> Vỏ táo giàu chất xơ và có lợi cho hệ tiêu hóa, hơn 1 nửa lượng vitamin C của quả táo đều nằm ở vỏ.<br> Đường tự nhiên trong táo không ảnh hưởng tới bệnh nhân tiểu đường.<br> Chất kẽm trong táo làm tăng khả năng ghi nhớ của não người. Mặt khác, kẽm còn phối hợp với một số chất để tạo ra kháng thể, nâng cao khả năng đề kháng của cơ thể. Ngoài ra táo còn chứa các nguyên tố vi lượng khác như canxi, kali, sắt, phốtpho, các vitamin C, B1, B2.</p><p>&nbsp;</p><p>&nbsp;</p>', '1', '0', '1783', 'hàng nhập khẩu,đặc sản,nông sản sạch', '1054', '2018-06-02 17:59:24', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('182', 'Táo Red Delicious Mỹ', 'Tao-Red-Delicious-My', '11', '/UploadedFiles/images/productImages/tao-red-delicious_large.png', '[\"/UploadedFiles/images/productImages/tao-red-delicious_master.png\",\"/UploadedFiles/images/productImages/tao-red-delicious2_master.png\",\"/UploadedFiles/images/productImages/tao-red-delicious_2_master.jpg\"]', '111000.00', '97125.00', '60545.45', null, '<p>Quả t&aacute;o Red Deliciuos l&agrave; loại t&aacute;o Mỹ nhập khẩu nổi tiếng đ&atilde; nổi tiếng từ l&acirc;u ở Việt Nam. T&aacute;o Red Delicious được thu hoạch v&agrave;o th&aacute;ng 9 v&agrave; th&aacute;ng 10. Cũng như đa số c&aacute;c loại t&aacute;o kh&aacute;c, quả t&aacute;o Red Delicious chứa nhiều pectin-l&agrave; một chất xơ h&ograve;a tan l&agrave;m giảm cholesterol v&agrave; chất chống oxy h&oacute;a, ngăn ngừa bệnh tim. Ngo&agrave;i ra loại tr&aacute;i c&acirc;y nhập khẩu n&agrave;y c&ograve;n gi&agrave;u Magie, Kali. Đặc biệt vỏ quả t&aacute;o gi&agrave;u chất xơ, hơn một nửa lượng Vitamin C của quả t&aacute;o đều nằm ở vỏ.</p>', '<p>Quả táo Red Deliciuos là loại táo Mỹ nhập khẩu nổi tiếng đã nổi tiếng từ lâu ở Việt Nam. Táo Red Delicious được thu hoạch vào tháng 9 và tháng 10. Cũng như đa số các loại táo khác, quả táo Red Delicious chứa nhiều pectin-là một chất xơ hòa tan làm giảm cholesterol và chất chống oxy hóa, ngăn ngừa bệnh tim. Ngoài ra loại trái cây nhập khẩu này còn giàu Magie, Kali. Đặc biệt vỏ quả táo giàu chất xơ, hơn một nửa lượng Vitamin C của quả táo đều nằm ở vỏ.</p><p>Quả Táo sau khi nhập về được bảo quản bằng hệ thống bảo quản lạnh liên tục nên giữ được độ tươi ngon và dưỡng chất tự nhiên của quả táo.</p><p>Loại trái cây này thích hợp ăn chơi, ăn vặt, bổ sung dưỡng chất, làm quà tặng sang trọng hay quà tặng sinh nhật. Ngoài ra, loại trái cây này là một trong những loại trái cây tốt cho bà bầu và được nhiều bà bầu lựa chọn</p>', '1', '0', '1783', 'hàng nhập khẩu,đặc sản,nông sản sạch', '1060', '2018-06-02 17:59:24', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('183', 'Táo Rockit', 'Tao-Rockit', '11', '/UploadedFiles/images/productImages/lnphoto_220_large.jpg', '[\"/UploadedFiles/images/productImages/lnphoto_220_master.jpg\",\"/UploadedFiles/images/productImages/lnphoto_218_master.jpg\",\"/UploadedFiles/images/productImages/lnphoto_219_master.jpg\",\"/UploadedFiles/images/productImages/tao-roc-kit-02_45f112fa6f2b4de886e95d8f0e19e551_master.png\",\"/UploadedFiles/images/productImages/tao-roc-kit-03_e540462798ae42af8f17cfba8351fe7f_master.png\",\"/UploadedFiles/images/productImages/tao-roc-lit-01_c82004f98faa49b79b95a2702ce7b25a_master.png\"]', '147000.00', '128625.00', '66818.18', null, '<p>T&aacute;o Rockit nhập khẩu do Sunfood cung cấp</p>', '<p>Ngày nay, lượng trái cây từ các nước du nhập vào Việt Nam đang ngày một nhiều. Một những loại trái cây đặc sản đến từ New Zealand chính là&nbsp;táo Rockit, được trồng khá phổ biến ở vịnh Hawke.&nbsp;Táo Rockit&nbsp;phải trải qua thời gian nuôi trồng và chăm sóc kéo dài tới ba năm mới có thể thu hoạch được những quả táo ngon nhất, nhưng ngày nay chúng đã được nhân giống ở nhiều nơi trên thế giới.</p><ol><li>ĐẶC ĐIỂM</li></ol><p>Trong thực tế, táo rockit là&nbsp;dòng táo biến đổi gen, được lai tạo từ nhiều giống táo khác nhau để tạo sự độc đáo và riêng biệt của chính mình. Rất dễ dàng để nhận ra táo Rockit có hình dáng nhỏ, vỏ ngoài màu hồng đậm pha chút sắc vàng nhìn qua khá giống với quả xuân đào, căng bóng và cầm rất chắc tay. Đặc biệt là thịt Rockit chắc giòn, hàm lượng nước cao, phần thịt màu trắng ngà như kem,vị ngọt đậm tưởng như đang ăn Envy nhưng cũng thoang thoảng vị của Fuji hay táo Queen.</p><ol><li>CÔNG DỤNG GIẢM CÂN</li></ol><p>Một trong những công dụng chính khiến cho các chị em phụ nữ vô cùng ưa thích đó chính là có tác dụng&nbsp;hỗ trợ giảm cân.&nbsp;Táo được đóng gói riêng biệt trong một gói lưu trữ dạng xi lanh thuận tiện với năm quả táo ngon ngọt cung cấp nguồn dưỡng chất thiết yếu cho chị em trong quá trình giảm cân. Các chị em muốn giảm cân nhanh thường lựa chọn táo Rockit như phần chính trong thực đơn của mình vì&nbsp;hàm lượng dưỡng chất đầy đủ nhưng không dư thừa calo.</p><p>&nbsp;</p>', '1', '0', '15102', 'hàng nhập khẩu,đặc sản,nông sản sạch', '1066', '2018-06-02 17:59:25', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('184', 'Táo xanh Green Dragon Mỹ', 'Tao-xanh-Green-Dragon-My', '11', '/UploadedFiles/images/productImages/green-dragon-apples-1_large.png', '[\"/UploadedFiles/images/productImages/green-dragon-apples-1_master.png\",\"/UploadedFiles/images/productImages/green-dragon-apples-2_master.jpg\",\"/UploadedFiles/images/productImages/green-dragon-apples_master.jpg\"]', '77000.00', '67375.00', '34999.99', null, '<p>T&aacute;o xanh l&agrave; loại t&aacute;o nhiều dinh dưỡng v&agrave; vitamin nhất trong c&aacute;c loại t&aacute;o, th&ocirc;ng thường t&aacute;o xanh vị chua, nhưng t&aacute;o xanh Green Dragon của Mỹ lại ngọt ng&acirc;y, thơm nức nở v&agrave; c&ograve;n gi&ograve;n nữa.</p>\n<p>T&aacute;o xanh Green Dragon l&agrave; giống t&aacute;o được lai trộn giữa t&aacute;o Japanese Orin v&agrave; Golden Delicious.</p>', '<p>Táo xanh là loại táo nhiều dinh dưỡng và vitamin nhất trong các loại táo, thông thường táo xanh vị chua, nhưng táo xanh Green Dragon của Mỹ lại ngọt ngây, thơm nức nở và còn giòn nữa.</p><p>Táo xanh Green Dragon là giống táo được lai trộn giữa táo Japanese Orin và Golden Delicious.</p>', '1', '0', '1783', 'hàng nhập khẩu,đặc sản,nông sản sạch', '1071', '2018-06-02 17:59:26', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('185', 'Táo xanh Pháp', 'Tao-xanh-Phap', '11', '/UploadedFiles/images/productImages/lnphoto_230_large.jpg', '[\"/UploadedFiles/images/productImages/lnphoto_230_master.jpg\",\"/UploadedFiles/images/productImages/lnphoto_228_master.jpg\",\"/UploadedFiles/images/productImages/lnphoto_229_master.jpg\"]', '79000.00', '69125.00', '71818.18', null, '<p>T&aacute;o xanh New Zealand được cung cấp bởi Thực phẩm an to&agrave;n Sunfood, đảm bảo chất lượng.</p>', '<p>Táo xanh Pháp được cung cấp bởi Thực phẩm an toàn Sunfood, đảm bảo chất lượng.</p>', '1', '0', '11504', 'hàng nhập khẩu,đặc sản,nông sản sạch', '1077', '2018-06-02 17:59:27', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('186', 'Táo Premium Star New ', 'tao-premium-star-new-', '11', '/UploadedFiles/images/productImages/tao-star1_42ae54b816d14fa8ba45592d95d0e3cc_large.jpg', '[\"/UploadedFiles/images/productImages/tao-star1_42ae54b816d14fa8ba45592d95d0e3cc_master.jpg\",\"/UploadedFiles/images/productImages/tao-star1_master.jpg\",\"/UploadedFiles/images/productImages/tao-star2_master.jpg\",\"/UploadedFiles/images/productImages/tao-star3_master.jpg\",\"/UploadedFiles/images/productImages/tao-star_master.jpg\"]', '77000.00', '67375.00', '70000.00', null, '<p>T&aacute;o Star cũng như đa số c&aacute;c loại t&aacute;o kh&aacute;c, chứa nhiều pectin-l&agrave; một chất xơ h&ograve;a tan l&agrave;m giảm cholesterol v&agrave; chất chống oxy h&oacute;a, ngăn ngừa bệnh tim.</p>\n<p>Ngo&agrave;i ra loại tr&aacute;i c&acirc;y nhập khẩu n&agrave;y c&ograve;n gi&agrave;u Magie, Kali. Đặc biệt vỏ t&aacute;o gi&agrave;u chất xơ, hơn một nửa lượng Vitamin C của quả t&aacute;o đều nằm ở vỏ.</p>\n<p>Quả T&aacute;o sau khi nhập về được bảo quản bằng hệ thống bảo quản lạnh li&ecirc;n tục n&ecirc;n giữ được độ tươi ngon v&agrave; dưỡng chất tự nhi&ecirc;n của quả t&aacute;o.</p>\n<p>Loại tr&aacute;i c&acirc;y n&agrave;y th&iacute;ch hợp ăn chơi, ăn vặt, bổ sung dưỡng chất, l&agrave;m qu&agrave; tặng sang trọng hay qu&agrave; tặng sinh nhật. Ngo&agrave;i ra, loại tr&aacute;i c&acirc;y n&agrave;y l&agrave; một trong những loại tr&aacute;i c&acirc;y tốt cho b&agrave; bầu v&agrave; được nhiều b&agrave; bầu lựa chọn.</p>\n<p>&nbsp;</p>', '<p>Táo Star cũng như đa số các loại táo khác, chứa nhiều pectin-là một chất xơ hòa tan làm giảm cholesterol và chất chống oxy hóa, ngăn ngừa bệnh tim.</p><p>Ngoài ra loại trái cây nhập khẩu này còn giàu Magie, Kali. Đặc biệt vỏ táo giàu chất xơ, hơn một nửa lượng Vitamin C của quả táo đều nằm ở vỏ.</p><p>Quả Táo sau khi nhập về được bảo quản bằng hệ thống bảo quản lạnh liên tục nên giữ được độ tươi ngon và dưỡng chất tự nhiên của quả táo.</p><p>Loại trái cây này thích hợp ăn chơi, ăn vặt, bổ sung dưỡng chất, làm quà tặng sang trọng hay quà tặng sinh nhật. Ngoài ra, loại trái cây này là một trong những loại trái cây tốt cho bà bầu và được nhiều bà bầu lựa chọn.</p><p>&nbsp;</p>', '1', '0', '15102', 'hàng nhập khẩu,đặc sản,nông sản sạch', '1083', '2018-06-02 17:59:28', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('187', 'Táo Queen Mỹ', 'Tao-Queen-My', '11', '/UploadedFiles/images/productImages/lnphoto_234_large.jpg', '[\"/UploadedFiles/images/productImages/lnphoto_234_master.jpg\",\"/UploadedFiles/images/productImages/lnphoto_233_master.jpg\",\"/UploadedFiles/images/productImages/tao-queen-01_master.jpg\",\"/UploadedFiles/images/productImages/tao-queen-02_master.jpg\"]', '99000.00', '86625.00', '63000.00', null, '<p>T&aacute;o Queen do Sunfood cung cấp, đảm bảo an to&agrave;n, chất lượng, được nhập khẩu từ Mỹ</p>\n<p>&nbsp;</p>', '<h3>1. Giống và chủng loại</h3><p><br> Táo Nữ hoàng Mỹ được lai tạo giữa táo Gala và táo Splendour. Táo Nữ Hoàng nổi tiếng về độ ngọt, rất giòn nhưng không quá cứng, màu sắc đỏ thẫm. Táo Nữ Hoàng Mỹ còn rất thơm, nhiều nước và được xem là một trong những loại Táo Mỹ phù hợp nhất với khẩu vị của người Việt Nam.<br></p><p><br> Một quả táo cỡ trung bình chứa khoảng 4g chất xơ. Một phần trong số chất xơ đó ở dạng Pectin - loại chất xơ hòa tan có tác dụng giảm lượng cholesterol ; Chất xơ phức tạp của táo giúp no lâu hơn mà không bị tiêu thụ nhiều calo (một quả táo bình thường chỉ chứa khoảng 95 calo). Một loại axit có trong vỏ táo là Axit Ursolic làm giảm nguy cơ béo phì, Axit Ursolic thúc đẩy cơ thể đốt cháy calo, tăng việc hình thành cơ và giảm chất béo lâu năm trong cơ thể. Táo là nguồn cung cấp vitamin C tuyệt vời, có tác dụng tăng cường hệ thống miễn dịch. Mỗi quả táo chứa khoảng 8mg vitamin này, vì thế chúng sẽ cung cấp khoảng 14% nhu cầu vitamin C hàng ngày của cơ thể. Cũng giống như quả lê và quả việt quất, táo có mối liên hệ với việc giảm thiểu nguy cơ mắc bệnh tiểu đường type 2 nhờ chất chống oxy hóa có tên Anthocyanins, hơn nữa trong táo có chất Triterpenoids có khả năng chống lại các bệnh ung thư gan, ruột kết và ung thư vú.</p><p>&nbsp;</p>', '1', '0', '1783', 'hàng nhập khẩu,đặc sản,nông sản sạch', '1089', '2018-06-02 17:59:29', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('188', 'Hạt Giống Hoa', 'Hat-Giong-Hoa', '12', '/UploadedFiles/images/productImages/hat_giong_hoa_large.jpg', '[\"/UploadedFiles/images/productImages/hat_giong_hoa_master.jpg\",\"/UploadedFiles/images/productImages/63d1dd0372149e4ac705_master.jpg\",\"/UploadedFiles/images/productImages/ab0792cf3dd8d18688c9_25a6c3bd1c4548e1b22e7f1b8d3a9eb5_master.jpg\"]', '20000.00', '17500.00', '12727.27', null, '<p>Hạt giống hoa Sao Việt, sản phẩm được cung cấp bởi thực phẩm an to&agrave;n Sunfood.</p>', '<p>Hạt giống hoa Sao Việt, sản phẩm được cung cấp bởi thực phẩm an toàn Sunfood.</p>', '1', '0', '3219', null, '1095', '2018-06-02 18:03:13', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('189', 'Hoa BaBy', 'Hoa-BaBy', '12', '/UploadedFiles/images/productImages/hoa-baby_large.jpg', '[\"/UploadedFiles/images/productImages/hoa-baby_master.jpg\",\"/UploadedFiles/images/productImages/hoa-baby__1__master.jpg\"]', '57138.00', '49995.75', '46749.27', null, '<p>Hoa Baby&nbsp;l&agrave; loại hoa tượng trưng cho t&igrave;nh y&ecirc;u tinh khiết, ng&acirc;y thơ, trong trắng.</p>', '<p>Hoa baby&nbsp;thuộc loài thân bụi cây phân nhiều cành, những bông hoa nhỏ mọc đầu các cành ấy, hoa baby thường có màu trắng và màu hồng nhạt rất dễ thương. Hoa Baby khá phù hợp với khí hậu Việt Nam và được trồng rất phổ biên, Thời gian cây hoa baby sinh trưởng là khá nhanh, nảy mầm sau&nbsp;5-7&nbsp;ngày và sau&nbsp;30 -40&nbsp;ngày là cây đã bắt đầu ra hoa</p><p>Hoa Baby&nbsp;là loại hoa tượng trưng cho tình yêu tinh khiết, ngây thơ, trong trắng.</p><p>Hoa baby&nbsp;có thể trồng quanh năm, Đất trồng cần phải giàu dinh dưỡng, xốp, thoáng khí, ưa ẩm, có thể dùng đất tribat loại dành cho hoa và rau ăn lá để trồng</p><p>Nước: Cây hoa baby không cần quá nhiều nước, 1-2 ngày nên tưới một lần</p>', '1', '0', '19283', null, '1101', '2018-06-02 18:03:14', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('190', 'Hoa Cẩm Chướng', 'Hoa-Cam-Chuong', '12', '/UploadedFiles/images/productImages/hoa-cam-chuong1_large.jpg', '[\"/UploadedFiles/images/productImages/hoa-cam-chuong1_master.jpg\",\"/UploadedFiles/images/productImages/hoa-cam-chuong_master.jpg\"]', '72753.00', '63658.87', '52911.27', null, '<p><strong>&Yacute; nghĩa chung:&nbsp;</strong>Sự &aacute;i mộ - Sự th&ocirc;i mi&ecirc;n, quyến rũ - T&igrave;nh y&ecirc;u của phụ nữ - Niềm tự h&agrave;o - Sắc đẹp - T&igrave;nh y&ecirc;u trong s&aacute;ng v&agrave; s&acirc;u đậm, thiết tha.</p>', '<p>Ý nghĩa chung:&nbsp;Sự ái mộ - Sự thôi miên, quyến rũ - Tình yêu của phụ nữ - Niềm tự hào - Sắc đẹp - Tình yêu trong sáng và sâu đậm, thiết tha.</p><p>Hoa cẩm chướng&nbsp;thuần một màu:&nbsp;Đồng ý<br> Hoa cẩm chướng&nbsp;có vằn, sọc:&nbsp;Lời từ chối tình yêu<br> Hoa cẩm chướng&nbsp;hồng:&nbsp;Anh sẽ không quên em<br> Hoa cẩm chướng&nbsp;đỏ: Ái mộ<br> Hoa cẩm chướng&nbsp;đỏ thẫm:&nbsp;Trái tim tôi đau nhói vì em<br> Hoa cẩm chướng&nbsp;vàng:&nbsp;Sự từ chối, sự khinh thường, thất vọng, hối hận.<br> Hoa cẩm chướng&nbsp;trắng:&nbsp;Ngọt ngào và đáng yêu, ngây thơ, tình yêu trong sáng, món quà may mắn cho phụ nữ.<br> Hoa cẩm chướng tím:&nbsp;Tính khí&nbsp;thất thường.</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>', '1', '0', '12581', null, '1106', '2018-06-02 18:03:15', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('191', 'Hoa Cát Tường  (bó lớn)', 'hoa-cat-tuong-bo-lon-', '12', '/UploadedFiles/images/productImages/hoa-cat-tuong_large.jpg', '[\"/UploadedFiles/images/productImages/hoa-cat-tuong_master.jpg\"]', '72753.00', '63658.87', '52911.27', null, '<p>C&aacute;t tường thuộc loại c&acirc;y th&acirc;n thảo, chiều cao khoảng 15-120cm, thời gian gieo hạt đến khi nở hoa mất khoảng 7-8 th&aacute;ng. Th&acirc;n c&acirc;y mảnh v&agrave; d&agrave;i.&nbsp;</p>', '<p>Ngắm nhìn cát tường&nbsp; mềm mỏng như lụa người ta thường liên tưởng tới vẻ e ấp, dịu dàng của thiếu nữ mới lớn. Bề ngoài gợi sự mỏng manh nhưng sự vươn lên mạnh mẽ trong thời tiết khắc nghiệt tháng 6 khiến cát tường không hổ danh là loài hoa mang đến may mắn trải qua thử thách chông gai.</p><p>Cũng là loài hoa của tình yêu, không mạnh mẽ như bông bồng, nhưng tượng trưng cho tình yêu tinh tế, mềm mỏng và nhẹ nhàng là đóa cát tường. Toát lên vẻ đẹp quý phái, dịu dàng, cát tường được người Á Đông và Nhật Bản ưa chuộng với ý nghĩa may mắn.</p><p>Trong phong thủy: Trong phong thủy hoa cát tường là hoa vượng tài, hoa mang lại may mắn tài lộc cho gia chủ. Theo văn hóa phương đông thì mỗi khi tết đến xuân về nhà nào trang trí làm đẹp bằng hoa cát tường thì sẽ có một năm đầy may mắn, tài lộc.</p>', '1', '0', '3218', null, '1112', '2018-06-02 18:03:15', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('192', 'Hoa Cúc', 'Hoa-Cuc', '12', '/UploadedFiles/images/productImages/hoa-cuc-doa-trang_large.jpg', '[\"/UploadedFiles/images/productImages/hoa-cuc-doa-trang_master.jpg\",\"/UploadedFiles/images/productImages/hoa-cuc-trang_master.jpg\",\"/UploadedFiles/images/productImages/hoa-cuc-vang_master.jpg\"]', '21457.00', '18774.87', '5851.90', null, '<p>C&acirc;y hoa c&uacute;c đại đ&oacute;a mang &yacute; nghĩa &ldquo;lạc quan tr&ecirc;n nghịch cảnh\"</p>', '<p>Hoa Cúc Đại Đóa là cây sống hàng năm, mọc thành bụi, phân nhiều nhánh, hoa to mọc trên đỉnh. Hoa Cúc Đại Đóa có nhiều màu, vàng, trắng, tím, lai thứ sinh… Cây hoa cúc đại đóa mang ý nghĩa “lạc quan trên nghịch cảnh\", cây thường trồng chậu trang trí nội thất, sân nhà hoặc trồng vườn hoa trang trí sân vườn…</p><p>&nbsp;</p>', '1', '0', '19284', null, '1118', '2018-06-02 18:03:16', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('193', 'Hoa Đồng Tiền', 'Hoa-Dong-Tien', '12', '/UploadedFiles/images/productImages/hoa-dong-tien_large.jpg', '[\"/UploadedFiles/images/productImages/hoa-dong-tien_master.jpg\",\"/UploadedFiles/images/productImages/hoa-dong-tien1_master.jpg\",\"/UploadedFiles/images/productImages/hoa-dong-tien-do_master.jpg\"]', '23983.00', '20985.12', '15261.90', null, '<p>Hoa Đồng Tiền tượng trưng cho hạnh ph&uacute;c, n&oacute; mang &yacute; nghĩa về vẻ đẹp v&agrave; sự diệu k&igrave;.</p>', '<p>Hoa Đồng Tiền tượng trưng cho hạnh phúc, nó mang ý nghĩa về vẻ đẹp và sự diệu kì. Nó mang đến cho chúng ta sự tươi sáng và vui vẻ, không những thế nó còn thể hiện sự ngây thơ, tình yêu và lòng ca ngợi.&nbsp;</p><p>Bạn có thể tìm thấy dược dự trong trắng, tinh khiết nơi đồng tiền trắng, tình yêu ở những bông hoa màu đỏ, niềm hạnh phúc của hoa đồng tiền vàng hay sự ca ngợi khích lệ của đồng tiền hồng.&nbsp;</p><p>Có rất nhiều loài hoa có thể bày tỏ suy nghĩ và tình cảm của bạn nhưng hoa đồng tiền luôn nổi bật hẳn lên bởi sự rực rỡ đầy tươi vu của chúng. Khi bạn tặng cho ai những bông hoa này, chúng không những truyền đạt cho họ những thông điệp sâu sắc đầy ý nghĩa mà còn giúp đêm lại một ấn tượng khó quên.</p><p>Hoa đồng tiền tượng trưng cho sự tin tưởng và sự sôi nổi.</p><p>Nếu bạn muốn chinh phục trái tim của một cô gái cá tính, tự tin và sôi nổi hãy tặng cô ấy một chậu hoa đồng tiền. Những bông hoa màu hồng dễ thương vươn thẳng lên từ tán lá xanh thẫm thể hiện một cá tính độc lập nhưng vẫn dịu dàng, mềm mại. Cánh hoa xoè rộng, màu sắc tươi sáng thể hiện sức sống mãnh liệt, sự nhiệt tình đến tuyệt vời.<br> &nbsp;Đặc biệt, hoa đồng tiền có thể nở quanh năm. Do cây dễ trồng và chăm sóc nên chỉ cần tưới nước cho cây ngày 1-2 lần là cây có thể cho hoa.</p><p>Ngoài ra hoa đồng tiền còn gọi là cây kim tiền. Trong những dịp đầu xuân năm mới, nếu trồng hoa hoặc cắm hoa sẽ mang đến nhiều may mắn, tài lộc và tiền của cho gia đình</p>', '1', '0', '3218', null, '1124', '2018-06-02 18:03:17', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('194', 'Hoa Hồng các loại', 'Hoa-Hong-cac-loai', '12', '/UploadedFiles/images/productImages/hoa-hong-cam_large.jpg', '[\"/UploadedFiles/images/productImages/hoa-hong-cam_master.jpg\",\"/UploadedFiles/images/productImages/hoa-hong-cam-lua_master.jpg\",\"/UploadedFiles/images/productImages/hoa-hong-do-ha-lan1_master.jpg\",\"/UploadedFiles/images/productImages/hoa-hong-trang2_master.jpg\",\"/UploadedFiles/images/productImages/hoa-hong-vang-anh-trang1_master.jpg\",\"/UploadedFiles/images/productImages/hoa-hong-do-ha-lan_master.jpg\",\"/UploadedFiles/images/productImages/hoa-hong-trang_master.jpg\",\"/UploadedFiles/images/productImages/hoa-hong-tim-co_master.jpg\",\"/UploadedFiles/images/productImages/hoa-hong-sen-moi_master.jpg\",\"/UploadedFiles/images/productImages/hoa-hong-do-sasa_master.jpg\"]', '81391.00', '71217.12', '29596.72', null, '<p>Trong ng&agrave;y lễ t&igrave;nh nh&acirc;n hay mỗi dịp kỉ niệm t&igrave;nh y&ecirc;u, hoa hồng l&agrave; một m&oacute;n qu&agrave; kh&ocirc;ng thể thiếu. Bởi lẽ đ&oacute; l&agrave; loại hoa tượng trưng cho t&igrave;nh y&ecirc;u được nhiều người biết đến nhất tr&ecirc;n thế giới, l&agrave; loại hoa ngọt ng&agrave;o, nồng thắm m&agrave; t&igrave;nh y&ecirc;u đ&atilde; len lỏi v&agrave;o từng c&aacute;nh hoa, nhị hoa v&agrave; cả hương thơm dịu nhẹ phảng phất...</p>', '<p>Mỗi màu sắc hoa hồng lại mang đến một ý nghĩa biểu đạt khác nhau.</p><p>Cùng Sunfood &nbsp;tìm hiểu xem bó hoa mình tặng mang thông điệp gì nhé!</p><p>Hoa hồng đỏ: tượng trưng cho một tình yêu nồng cháy và lãng mạn. Hoa hồng đỏ đã có từ rất lâu đời, trải qua nhiều nền văn hóa - cả phương tây và phương đông.Nhưng ở bất kì đâu, nó cũng luôn là loài hoa được yêu thích nhất, và biểu tượng cho một thứ tình cảm vô cùng thiêng liêng: Tình yêu.</p><p>Hoa hồng trắng: tượng trưng cho sự ngây thơ, duyên dáng và sự cảm thông. Hồng trắng không chỉ biểu tượng cho một tình yêu thuần khiết, cao thượng mà mặt khác, nó còn là loài hoa dành để bày tỏ lời xin lỗi đến người yêu nếu chẳng may bạn có mắc lỗi lầm.</p><p>Hoa hồng vàng: Có lẽ đây là loài hoa làm người nhận khá đau đầu bởi ý nghĩa khá đa dạng của nó: Hoa hồng vàng không chỉ tượng trưng cho một tình yêu kiêu sa đầy rực rỡ, mà nó còn là loài hoa của tình bạn, thể hiện sự quan tâm và tiến triển trong mối quan hệ, chẳng hạn như: \"anh quan tâm đến em\" hoặc \"hãy nhớ đến anh\". Tặng một bó hồng vàng có thể là mừng ngày khởi đầu, và cả mừng ngày trở về. Đôi khi,hồng vàng lại là một lời bày tỏ sự ghen tuông, tình yêu giảm sút, và sự phản bội. Bên cạnh đó, hoa hồng vàng cũng là loài hoa lý tưởng để dành tặng mẹ và bà, bởi lẽ nó còn có ý nghĩa của sự biết ơn và tôn kính.</p><p>Hoa hồng phớt: Màu hồng phớt nhẹ nhàng của hoa hồng ngụ ý về sự bắt đầu của một tình yêu đầy mơ mộng, lãng mạn và dịu dàng. Bên cạnh đó, nó còn thể hiện một hạnh phúc tròn đầy với lời nhắn nhủ: \"Hãy tin anh nhé! \"</p><p>Hoa hồng đậm: hoa hồng màu hồng đậm mang ý nghĩa của sự sang trọng, sự biết ơn và để bày tỏ lời cảm ơn. Ngoài ra, hồng đậm còn ngụ ý về một người đẹp kiêu kì.</p><p>Hoa hồng phấn: Màu hồng phấn dịu nhẹ của hoa mang đến thông điệp về sự trìu mến, về một tình yêu lãng mạn và nhẹ nhàng.</p><p>Hoa hồng nhung: tượng trưng cho một tình yêu say đắm và nồng nhiệt.</p><p>Hoa hồng cam: Thể hiện sự nhiệt tình và đam mê cháy bỏng. Màu cam đầy rực rỡ thể hiện một tình yêu nồng nhiệt nhưng cũng hòa lẫn với sự ghen tuông. Hay một ý nghĩa khác, nó là cầu nối giữa tình bạn và tình yêu (bởi sự hòa trộn giữa vàng và đỏ) và ngụ ý rằng \"tôi tự hào về bạn\".</p><p>Hoa hồng tím: Bên cạnh sự sang trọng vốn có, hoa hồng tím còn thể hiện lòng say mê, chung thủy, và là tình yêu mãnh liệt ngay từ cái nhìn đầu tiên.</p><p>Hoa hồng xanh: tượng trưng cho một tình yêu bất diệt.</p><p>Hoa hồng tỉ muội: Đúng như cái tên của hoa, hồng tỉ muội tượng trưng cho tình chị em thắm thiết. Cho tình cảm gia đình. Bày tỏ sự biết ơn, yêu thương trìu mến. Và nếu người được tặng là một chàng trai, thông điệp được trao gửi ở đây chính là: Bạn là một đứa em ngoan.</p><p>&nbsp;</p><p>&nbsp;</p>', '1', '0', '3218', null, '1130', '2018-06-02 18:03:17', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('195', 'Hoa Hướng Dương', 'Hoa-Huong-Duong', '12', '/UploadedFiles/images/productImages/hoa_huong_duong_3_large.jpg', '[\"/UploadedFiles/images/productImages/hoa_huong_duong_3_master.jpg\"]', '68302.00', '59764.25', '55883.45', null, '<p>Hoa Hướng Dương Đ&agrave; Lạt - được cung cấp bởi Sunfood</p>', '<p>Hoa Hướng Dương luôn hướng về phía mặt trời nên thường là biểu tượng của lòng trung thành, chung thủy sâu sắc, sự kiên định đó cũng biểu thị cho sức mạnh, uy quyền, sự ấm áp, nuôi dưỡng (tất cả những thuộc tính của mặt trời) và cả sự kiêu kỳ, vẻ đẹp hào nhoáng bên ngoài hay một tình yêu bất hạnh. Những cây hoa Hướng Dương thấp tượng trưng cho sự đam mê trong ngôn ngữ của loài hoa.</p>', '1', '0', '19284', null, '1136', '2018-06-02 18:03:18', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('196', 'Hoa Lay ơn', 'Hoa-Lay-on', '12', '/UploadedFiles/images/productImages/hoa-lay-on__2__large.jpg', '[\"/UploadedFiles/images/productImages/hoa-lay-on__2__master.jpg\",\"/UploadedFiles/images/productImages/hoa-lay-on_master.jpg\"]', '97006.00', '84880.25', '26456.18', null, '<p>B&ocirc;ng lay ơn được xem l&agrave; lo&agrave;i hoa của người đấu sĩ v&agrave; từ l&acirc;u đ&atilde; được xem l&agrave; gắn liền với thanh gươm. Những b&ocirc;ng hoa oai vệ n&agrave;y được d&ugrave;ng trong những l&atilde;ng hoa trưng b&agrave;y tại những dịp đặc biệt v&agrave; l&agrave; lo&agrave;i hoa được y&ecirc;u th&iacute;ch nhất trong vườn quốc gia.</p>', '<p>Bông lay ơn được xem là loài hoa của người đấu sĩ và từ lâu đã được xem là gắn liền với thanh gươm. Những bông hoa oai vệ này được dùng trong những lãng hoa trưng bày tại những dịp đặc biệt và là loài hoa được yêu thích nhất trong vườn quốc gia. Chúng được đánh giá là những bông hoa cổ điển, do thường được những người phụ nữ ở Mỹ trồng ở phía sau khu vườn hoa của họ để tạo nên một nền hoa đầy màu sắc. Chúng thường được trồng dọc theo hàng rào bởi vì thân hoa dài cần được hổ trợ để có thể đứng thẳng.</p><p>Giống hoa lay ơn bao gồm 260 loài với 10,000 giống đã đăng kí có màu sắc tương tự các màu trong cầu vồng. Mỗi bông hoa có thể có một màu hoặc được trộn lẫn bởi nhiều màu và có nhiều sắc khác nhau của hồng, đỏ, tím, vàng, cam, trắng và xanh lá.</p><p>Hầu hết lay ơn có nguồn gốc từ châu Phi và châu Á và không được biết đến ở châu Âu cho đến giữa năm 1739 và 1745 khi chúng được giới thiệu bởi du khách theo con đường trao đổi từ Ấn Độ. Những nhà thực vật học châu Âu sớm bắt đầu trồng và nhân giống lay ơn. Đến năm 1806, William Herbert giới thiệu loài lay tạo đầu tiên. Đến năm 1840 và 1850, hàng trăm loài lay ơn đã được nhân giống.</p>', '1', '1', '4654', null, '1141', '2018-06-02 18:03:19', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('197', 'Hoa Ly Đỏ', 'Hoa-Ly-Do', '12', '/UploadedFiles/images/productImages/hoa-lyly-do_large.jpg', '[\"/UploadedFiles/images/productImages/hoa-lyly-do_master.jpg\"]', '45711.00', '39997.12', '24933.27', null, '<p>Lily, B&aacute;ch Hợp, Loa K&egrave;n hay hoa Huệ T&acirc;y trắng l&agrave; b&ocirc;ng hoa rất quan trọng v&agrave; &yacute; nghĩa đối với Cơ Đốc gi&aacute;o</p>', '<p>Ý nghĩa hoa ly và cách nhìn của người phương đông</p><p>Ở Trung Quốc cũng có 1 giống hoa ly gọi là hoa bách hợp có từ rất lâu đời. Hoa trắng thơm, dùng để là thuốc, củ có thể ăn được như hành tây. Nhưng dân thường cũng không được nếm củ đó. Chính vì thế mà hoa ly được tượng trưng cho sự tinh khiết, quý phái.<br> Vì cái tên bách hợp (trong từ Bách niên hảo hợp – trăm năm hạnh phúc hòa hợp) nên hoa ly hay được dùng trong các tiệc cưới của Trung Quốc.</p><p>cách nhìn của người phương tây</p><p>Lily, Bách Hợp, Loa Kèn hay hoa Huệ Tây trắng là bông hoa rất quan trọng và ý nghĩa đối với Cơ Đốc giáo, biểu tượng cho sự trinh trắng và đức hạnh. Trong Kinh Thánh, Lily được nhắc đến bằng cái tên “vị tông đồ khoác áo choàng trắng hy vọng”. Lily mọc trong vườn Gethsemane sau khi Chúa bị đóng đinh trên thập tự giá. Easter Lily được cắm trong nhà thờ suốt mùa lễ Phục Sinh để mừng sự hồi sinh của Chúa Jesus.</p><p>Ý nghĩa của hoa ly : Sắc đẹp – Đức hạnh – Thanh cao, quý phái – Kiêu hãnh<br> Lily trắng : Thanh khiết, trinh nguyên, ngọt ngào, chân thành.<br> Thông điệp : Thật tuyệt vời khi bên em</p><p>Ý nghĩa Lily vàng : Lòng biết ơn, sự vui vẻ.</p><p>Y nghĩa Lily cam : Sự căm hờn.</p><p>Lily Tiger : Sự giàu có, kiêu hãnh.</p>', '1', '0', '4654', null, '1147', '2018-06-02 18:03:19', null, null, null, null, null, '1');
