INSERT INTO `products` VALUES ('199', 'Hoa ly vàng', 'Hoa-ly-vang', '12', '/UploadedFiles/images/productImages/hoa-lyly-vang_large.jpg', '[\"/UploadedFiles/images/productImages/hoa-lyly-vang_master.jpg\"]', '76940.00', '67322.50', '27978.18', null, '<p>Lily trắng : Thanh khiết, trinh nguy&ecirc;n, ngọt ng&agrave;o, ch&acirc;n th&agrave;nh.</p>\n<p>Th&ocirc;ng điệp : Thật tuyệt vời khi b&ecirc;n em</p>\n<p>&Yacute; nghĩa Lily v&agrave;ng : L&ograve;ng biết ơn, sự vui vẻ.</p>\n<p>Y nghĩa Lily cam : Sự căm hờn.</p>\n<p>Lily Tiger : Sự gi&agrave;u c&oacute;, ki&ecirc;u h&atilde;nh.</p>\n<p>&nbsp;</p>', '<p>Ý nghĩa hoa ly và cách nhìn của người phương đông</p><p>Ở Trung Quốc cũng có 1 giống hoa ly gọi là hoa bách hợp có từ rất lâu đời. Hoa trắng thơm, dùng để là thuốc, củ có thể ăn được như hành tây. Nhưng dân thường cũng không được nếm củ đó. Chính vì thế mà hoa ly được tượng trưng cho sự tinh khiết, quý phái.<br> Vì cái tên bách hợp (trong từ Bách niên hảo hợp – trăm năm hạnh phúc hòa hợp) nên hoa ly hay được dùng trong các tiệc cưới của Trung Quốc.</p><p>cách nhìn của người phương tây</p><p>Lily, Bách Hợp, Loa Kèn hay hoa Huệ Tây trắng là bông hoa rất quan trọng và ý nghĩa đối với Cơ Đốc giáo, biểu tượng cho sự trinh trắng và đức hạnh. Trong Kinh Thánh, Lily được nhắc đến bằng cái tên “vị tông đồ khoác áo choàng trắng hy vọng”. Lily mọc trong vườn Gethsemane sau khi Chúa bị đóng đinh trên thập tự giá. Easter Lily được cắm trong nhà thờ suốt mùa lễ Phục Sinh để mừng sự hồi sinh của Chúa Jesus.</p><p>Ý nghĩa của hoa ly : Sắc đẹp – Đức hạnh – Thanh cao, quý phái – Kiêu hãnh<br> Lily trắng : Thanh khiết, trinh nguyên, ngọt ngào, chân thành.<br> Thông điệp : Thật tuyệt vời khi bên em</p><p>Ý nghĩa Lily vàng : Lòng biết ơn, sự vui vẻ.</p><p>Y nghĩa Lily cam : Sự căm hờn.</p><p>Lily Tiger : Sự giàu có, kiêu hãnh.</p><p>&nbsp;</p><p>&nbsp;</p>', '1', '0', '4654', null, '1159', '2018-06-02 18:03:20', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('200', 'Hoa Salem', 'Hoa-Salem', '12', '/UploadedFiles/images/productImages/hoa-salem_large.jpg', '[\"/UploadedFiles/images/productImages/hoa-salem_master.jpg\",\"/UploadedFiles/images/productImages/hoa-salem1_master.jpg\"]', '25645.00', '22439.37', '13988.18', null, '<p>Một b&oacute; hoa sẽ c&oacute; được vẻ đẹp mặn m&agrave; quyến rũ hơn khi được t&ocirc; điểm bởi những b&ocirc;ng hoa Salem. Ch&uacute;ng ta c&oacute; thể bắt gặp h&igrave;nh ảnh hoa Salem đẹp trong những b&oacute; hoa cưới.</p>', '<p><br> Nếu muốn nói với người yêu của bạn rằng bạn nhớ họ, hãy tặng người ấy một bó hoa Salem. Nó sẽ truyền thông điệp ngọt ngào tới cho họ rằng “Anh nhớ em da diết”. Ngoài ra nó còn mang tới cho người yêu của bạn thông điệp “Tình yêu của chúng ta sẽ bền vững và luôn tươi đẹp như hoa Salem cho dù cuộc sống này không còn nữa”.<br> Một bó hoa để nói thay lời yêu thương của mình.</p><p>trong ngày Valentine hay 8/3 sẽ luôn là một món quà có giá trị tinh thần sâu sắc. Bởi lẽ hoa luôn có một ý nghĩa nào đó đối với người được tặng. Nếu hoa Hồng là sứ giả của tình yêu hay Lay-ơn mang ý nghĩa của sự hẹn hò thì hoa Salem chính là biểu tượng tô điểm, nhấn mạnh thêm cho sự bền vững của muôn đời, mãi mãi.<br> Một ý nghĩa khác của hoa Salem ít người biết đến đó là sự khiêm tốn. Hoa Salem thường làm nền, tô thêm vẻ đẹp cho các loài hoa khác vì vậy mà Salem mang trên mình vẻ đẹp khiêm tốn, hỗ trợ cho đồng loại mặc dù khi đứng một mình thì hoa Salem vẫn có một nét đẹp rất riêng, đặc biệt là khi hoa đã khô.<br> Hoa Salem tươi không cắm 1 mình mà thường dùng để cắm chen vào các hoa khác làm nền trang trí, tô điểm cho các hoa khác. Một bó hoa sẽ có được vẻ đẹp mặn mà quyến rũ hơn khi được tô điểm bởi những bông hoa Salem. Chúng ta có thể bắt gặp hình ảnh hoa Salem đẹp trong những bó hoa cưới, hoa tình yêu hay hoa sinh nhật, loại hoa thường kết hợp với các loại hoa khác như hoa hồng, hoa lan để làm tăng sự sang trọng và ý nghĩa cho bó hoa.</p><p>&nbsp;</p>', '1', '1', '12581', null, '1165', '2018-06-02 18:03:50', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('201', 'Hoa Sao Tím', 'Hoa-Sao-Tim', '12', '/UploadedFiles/images/productImages/sao_tim_large.jpg', '[\"/UploadedFiles/images/productImages/sao_tim_master.jpg\"]', '92555.00', '80985.62', '25242.27', null, '<p>Hoa sao t&iacute;m một lo&agrave;i hoa phơn phớt m&agrave;u mộng mơ C&aacute;nh hoa mỏng manh dịu nhẹ &nbsp;tạo&nbsp;n&ecirc;n một cảm gi&aacute;c&nbsp;ưu tư&nbsp;xao xuyến.</p>', '<p>Hoa sao tím một loài hoa phơn phớt màu mộng mơ Cánh hoa mỏng manh dịu nhẹ &nbsp;tạo&nbsp;nên một cảm giác&nbsp;ưu tư&nbsp;xao xuyến. Đây là một cây thân cỏ, thường mọc thành những bụi cây lớn, được bán thành từng bó. Cuối tháng tư, thời tiết mát mẻ của mùa xuân lặng lẽ nhường chỗ cho mùa hè ấm áp, đó cũng là lúc loài hoa li ti bé nhỏ nhưng mạnh mẽ khiêm nhường- hoa sao phủ khắp phố phường Hà Nội</p>', '1', '0', '16077', null, '1170', '2018-06-02 18:03:51', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('202', 'Thạch Thảo Tím', 'Thach-Thao-Tim', '12', '/UploadedFiles/images/productImages/thach-thao-tim_large.jpg', '[\"/UploadedFiles/images/productImages/thach-thao-tim_master.jpg\",\"/UploadedFiles/images/productImages/thach-thao-tim1_master.jpg\"]', '69964.00', '61218.50', '50882.90', null, '<p>Thạch thảo&nbsp;tượng trưng cho một t&igrave;nh y&ecirc;u nhẹ nh&agrave;ng v&agrave; b&igrave;nh dị. Trong t&igrave;nh y&ecirc;u ấy, t&igrave;nh cảm đong đầy v&agrave; lu&ocirc;n ẩn hiện đ&ocirc;i mắt d&otilde;i theo nhau, những lời hứa hẹn sẽ kh&ocirc;ng bao giờ qu&ecirc;n, sẽ m&atilde;i m&atilde;i đi c&ugrave;ng nhau tr&ecirc;n những s&oacute;ng gi&oacute;, gập ghềnh...</p>', '<p>Hoa thạch thảo&nbsp;là loài hoa thường mọc thành bụi, những đóa hoa với cánh mỏng, dài, xòe rộng tạo nên một vẻ dịu dàng, mộc mạc. Thạch thảo có nguồn gốc từ nước Ý, khi về Việt Nam, hoa được trồng nhiều ở Đà Lạt và xứ lạnh, đôi khi nó còn mọc dại ở ven đường. Cũng có thể vì vậy, mà ở nước ta, hoa thạch thảo còn phủ lên mình một lớp ý nghĩa đượm buồn: đó là sự lẻ loi trong tình yêu.</p><p><br> Tuy nhiên, nếu đi sâu vào tìm hiểu, người ta sẽ nhận ra những ý nghĩa cao đẹp mà loài hoa mỏng manh này mang lại:&nbsp;Thạch thảo&nbsp;tượng trưng cho một tình yêu nhẹ nhàng và bình dị. Trong tình yêu ấy, tình cảm đong đầy và luôn ẩn hiện đôi mắt dõi theo nhau, những lời hứa hẹn sẽ không bao giờ quên, sẽ mãi mãi đi cùng nhau trên những sóng gió, gập ghềnh...</p><p>Thạch thảo còn tượng trưng cho vẻ đẹp mỏng manh, thanh tú và tràn đầy nữ tính nhưng cũng rất cần sự che chở từ vòng tay ấm áp yêu thương.</p><p>Và, có một điều đặc biệt, dù thạch thảo gợi lên vẻ mỏng manh, có chút yếu đuối, nhưng đôi lúc, nó lại mang ý nghĩa của sự chín chắn. Bởi thạch thảo tự nhiên thường nở vào cuối mùa thu - khi mà những loài hoa khác đã tàn.</p><p>&nbsp;</p>', '1', '0', '4654', null, '1176', '2018-06-02 18:03:51', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('203', 'Cabernet Sauvignon Fat', 'cabernet-sauvignon-fat-', '13', '/UploadedFiles/images/productImages/cabernet_sauvignon_fat_bastard_red_7ee56bce1b634edd935f3e5044a056f8_large.jpg', '[\"/UploadedFiles/images/productImages/cabernet_sauvignon_fat_bastard_red_7ee56bce1b634edd935f3e5044a056f8_master.jpg\"]', '320000.00', '280000.00', '116363.63', null, '<p>Fat Bastard Cabernet Sauvignon hương vị mạnh mẽ v&agrave; &ecirc;m &aacute;i, đ&acirc;y l&agrave; loại rượu đậm với dư vị cam thảo v&agrave; ớt đỏ. Ngon nhất khi d&ugrave;ng chung với c&aacute;c m&oacute;n thịt nướng v&agrave; c&agrave; ri cừu.</p>', '<p>Fat Bastard Cabernet Sauvignon hương vị mạnh mẽ và êm ái, đây là loại rượu đậm với dư vị cam thảo và ớt đỏ. Ngon nhất khi dùng chung với các món thịt nướng và cà ri cừu.<br><br></p><p>Các giống nho: Cabernet Sauvignon 100%</p><p>Nồng độ cồn: 13 độ</p><p>Dung tích: 750mlx12</p><p>SKU: 449GMFR<br></p>', '1', '0', '3999', 'hàng nhập khẩu,đặc sản', '1182', '2018-06-02 18:04:28', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('204', 'Chardonnay Fat Bastard', 'chardonnay-fat-bastard-', '13', '/UploadedFiles/images/productImages/chardonnay_fat_bastard_white_a432bd31d5e445d18d8dc8b441c07312_large.jpg', '[\"/UploadedFiles/images/productImages/chardonnay_fat_bastard_white_a432bd31d5e445d18d8dc8b441c07312_master.jpg\"]', '320000.00', '280000.00', '232727.27', null, '<p>Rượu Vang&nbsp;Trắng&nbsp;Chardonnay Fat&nbsp;Bastard&nbsp;nồng độ 13% c&oacute; vị&nbsp;hoa keo&nbsp;v&agrave;&nbsp;m&ugrave;i hương cam, qu&yacute;t quyến rũ&nbsp;c&oacute; thể uống khi ăn c&aacute;c m&oacute;n phomai, thịt g&agrave;, vịt, x&agrave; l&aacute;ch, xốt pasta,... Kh&ocirc;ng những c&oacute; thể khai vị gi&uacute;p k&iacute;ch th&iacute;ch ti&ecirc;u h&oacute;a, ăn ngon miệng m&agrave; c&ograve;n gi&uacute;p qu&yacute; kh&aacute;ch cảm thấy hưng phấn, thoải m&aacute;i tinh thần.</p>', '<p>Rượu Vang&nbsp;Trắng&nbsp;Chardonnay Fat&nbsp;Bastard&nbsp;nồng độ 13% có vị&nbsp;hoa keo&nbsp;và&nbsp;mùi hương cam, quýt quyến rũ&nbsp;có thể uống khi ăn các món phomai, thịt gà, vịt, xà lách, xốt pasta,... Không những có thể khai vị giúp kích thích tiêu hóa, ăn ngon miệng mà còn giúp quý khách cảm thấy hưng phấn, thoải mái tinh thần.</p><p>Uống&nbsp;rượu Vang&nbsp;Trắng&nbsp;Chardonnay Fat&nbsp;Bastard&nbsp;điều độ từ 1 -2 ly/ngày rất tốt cho sức khỏe, giúp giảm xơ vữa động mạnh tăng cường chức năng tim mạch, chống lại một số tác nhân gây lão hóa, kéo dài tuổi thọ.</p>', '1', '0', '17871', 'hàng nhập khẩu,đặc sản', '1188', '2018-06-02 18:04:29', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('205', 'Croix Du Pin Cabernet ', 'croix-du-pin-cabernet-', '13', '/UploadedFiles/images/productImages/croix_du_pin_cabernet_sauvignon_red_1d55337d1c924cc28d0774be286f7820_large.jpg', '[\"/UploadedFiles/images/productImages/croix_du_pin_cabernet_sauvignon_red_1d55337d1c924cc28d0774be286f7820_master.jpg\"]', '250000.00', '218750.00', '136363.63', null, '<p>Rượu vang đỏ La Croix du Pin Cabernet Sauvignon tr&ograve;n trịa, pha lẫn nhiều hương vị với một ch&uacute;t ch&aacute;t nhẹ. Hương vị hoa quả h&ograve;a quyện với oliu, ớt v&agrave; thảo mộc. Tuyệt vời khi d&ugrave;ng với c&aacute;c m&oacute;n g&agrave; quay, thịt nướng, ức vịt nướng, hoặc ph&ocirc; mai đậm.</p>\n<p>&nbsp;</p>', '<p>Rượu vang đỏ La Croix du Pin Cabernet Sauvignon tròn trịa, pha lẫn nhiều hương vị với một chút chát nhẹ. Hương vị hoa quả hòa quyện với oliu, ớt và thảo mộc. Tuyệt vời khi dùng với các món gà quay, thịt nướng, ức vịt nướng, hoặc phô mai đậm.</p><p>&nbsp;</p><p>Các giống nho: Cabernet Sauvignon 100%</p><p>Nồng độ cồn: 12,5 độ</p><p>Dung tích: 750mlx6</p><p>SKU: 438FDFR</p>', '1', '0', '12090', 'hàng nhập khẩu,đặc sản', '1194', '2018-06-02 18:04:29', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('206', 'Croix Du Pin Sauvignon', 'croix-du-pin-sauvignon-', '13', '/UploadedFiles/images/productImages/croix_du_pin_sauvignon_white_309f840c12b54137b1a25c890369ddb8_large.jpg', '[\"/UploadedFiles/images/productImages/croix_du_pin_sauvignon_white_309f840c12b54137b1a25c890369ddb8_master.jpg\"]', '250000.00', '218750.00', '90909.09', null, '<p>Rượu vang trắng La Croix du Pin Sauvignon Blanc ng&agrave;o ngạt hương hoa cỏ, với hậu vị tươi m&aacute;t, tinh tế. Tuyệt vời khi d&ugrave;ng chung với c&aacute;c m&oacute;n hải sản, s&ograve; nướng, c&aacute; m&ograve;i nướng hoặc với s&uacute;p c&aacute;.</p>', '<p>Rượu vang trắng La Croix du Pin Sauvignon Blanc ngào ngạt hương hoa cỏ, với hậu vị tươi mát, tinh tế. Tuyệt vời khi dùng chung với các món hải sản, sò nướng, cá mòi nướng hoặc với súp cá.</p><p>Các giống nho: Sauvignon Blanc 100%</p><p>Nồng độ cồn: 12 độ</p><p>Dung tích: 750mlx6</p><p>SKU: 437FDFR</p>', '1', '0', '3999', 'hàng nhập khẩu,đặc sản', '1200', '2018-06-02 18:04:29', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('207', 'Esprit De Tursan Aoc Red', 'Esprit-De-Tursan-Aoc-Red', '13', '/UploadedFiles/images/productImages/esprit_de_tursan_aoc_red_7fcc552712764672a276ec445b16300a_large.jpg', '[\"/UploadedFiles/images/productImages/esprit_de_tursan_aoc_red_7fcc552712764672a276ec445b16300a_master.jpg\"]', '290000.00', '253750.00', '263636.36', null, '<p>Esprit đỏ tr&ograve;n trịa, phong ph&uacute; trong hương vị với vị ch&aacute;t mượt m&agrave; v&agrave; dư vị cam thảo. L&agrave; sự kết hợp ho&agrave;n hảo với c&aacute;c m&oacute;n thịt chi&ecirc;n, nướng, c&agrave; ri cay v&agrave; c&aacute;c bữa tiệu Buffet kiểu Ch&acirc;u &Aacute;.&nbsp;</p>', '<p>Esprit đỏ tròn trịa, phong phú trong hương vị với vị chát mượt mà và dư vị cam thảo. Là sự kết hợp hoàn hảo với các món thịt chiên, nướng, cà ri cay và các bữa tiệu Buffet kiểu Châu Á.&nbsp;<br><br></p><p>Các giống nho: Cabernet Franc 60%, Tannat 35%, Fer Servadou 5%</p><p>Nồng độ cồn: 12.5 độ</p><p>Dung tích: 750mlx6</p><p>SKU: 430TSFR</p>', '1', '0', '17871', 'hàng nhập khẩu,đặc sản', '1205', '2018-06-02 18:04:30', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('208', 'Esprit De Tursan Aoc Rose', 'Esprit-De-Tursan-Aoc-Rose', '13', '/UploadedFiles/images/productImages/esprit_de_tursan_aoc_rose_f8c25f7c634143a895e4906afd5b8055_large.png', '[\"/UploadedFiles/images/productImages/esprit_de_tursan_aoc_rose_f8c25f7c634143a895e4906afd5b8055_master.png\"]', '290000.00', '253750.00', '158181.81', null, '<p>Rượu vang Esprit l&agrave; d&ograve;ng rượu đặc trưng từ nh&agrave; sản xuất Tursan AOC, ra đời năm 1958 tại &ldquo;Les Landes&rdquo;-khu rừng lớn nhất Ch&acirc;u &Acirc;u, ph&iacute;a Nam Bordeaux. A.O.C (Appellation d&rsquo;Origine Contr&ocirc;l&eacute;e) chỉ ra nguồn gốc địa l&yacute;, chất lượng v&agrave; phong c&aacute;ch của c&aacute;c sản phẩm rượu. AOC l&agrave; ti&ecirc;u chuẩn cao nhất của rượu vang. Nhờ vậy, Esprit de Tursan l&agrave; sự lựa chọn l&yacute; tưởng cho ẩm thực kết hợp, được b&igrave;nh chọn bởi c&aacute;c đầu bếp t&agrave;i năng, những chuy&ecirc;n gia thử rượu v&agrave; c&aacute;c nh&agrave; h&agrave;ng đạt chuẩn Michelin.</p>', '<p>Rượu vang Esprit là dòng rượu đặc trưng từ nhà sản xuất Tursan AOC, ra đời năm 1958 tại “Les Landes”-khu rừng lớn nhất Châu Âu, phía Nam Bordeaux. A.O.C (Appellation d’Origine Contrôlée) chỉ ra nguồn gốc địa lý, chất lượng và phong cách của các sản phẩm rượu. AOC là tiêu chuẩn cao nhất của rượu vang. Nhờ vậy, Esprit de Tursan là sự lựa chọn lý tưởng cho ẩm thực kết hợp, được bình chọn bởi các đầu bếp tài năng, những chuyên gia thử rượu và các nhà hàng đạt chuẩn Michelin.</p><p>Rượu Vang Hồng - Pháp - hiệu Esprit de Tursan AOC ROSE&nbsp; nồng độ 12% có vị nho và hương trái cây và hương thảo dược có thể uống khi ăn các món Nhật, Thái, Việt, tiệc buffet hoặc dùng chung với các món nướng, cuốn, salad, hải sản, các món thịt nướng và gà nướng...</p><p>Sản phẩm giúp kích thích tiêu hóa, ăn ngon miệng mà còn mang đến hưng phấn, thoải mái tinh thần.</p><p>Uống rượu Vang Đỏ Esprit de Tursan điều độ từ 1 -2 ly/ngày rất tốt cho sức khỏe, giúp giảm xơ vữa động mạnh tăng cường chức năng tim mạch, chống lại một số tác nhân gây lão hóa, kéo dài tuổi thọ.</p><p>Các giống nho: Cabernet Franc 60%, Tannat 30%, Fer Servadou 5%, Sauvignon Blanc 5%&nbsp;</p><p>Nồng độ cồn: 12 độ</p><p>&nbsp;</p>', '1', '0', '1434', 'hàng nhập khẩu,đặc sản', '1211', '2018-06-02 18:04:30', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('209', 'Esprit De Tursan Aoc W', 'esprit-de-tursan-aoc-w-', '13', '/UploadedFiles/images/productImages/esprit_de_tursan_aoc_white_7385e6a704534191aa2b6429fedbf849_large.jpg', '[\"/UploadedFiles/images/productImages/esprit_de_tursan_aoc_white_7385e6a704534191aa2b6429fedbf849_master.jpg\"]', '290000.00', '253750.00', '263636.36', null, '<p>Rượu vang Esprit l&agrave; d&ograve;ng rượu đặc trưng từ nh&agrave; sản xuất Tursan AOC, ra đời năm 1958 tại &ldquo;Les Landes&rdquo;-khu rừng lớn nhất Ch&acirc;u &Acirc;u, ph&iacute;a Nam Bordeaux. A.O.C (Appellation d&rsquo;Origine Contr&ocirc;l&eacute;e) chỉ ra nguồn gốc địa l&yacute;, chất lượng v&agrave; phong c&aacute;ch của c&aacute;c sản phẩm rượu. AOC l&agrave; ti&ecirc;u chuẩn cao nhất của rượu vang. Nhờ vậy, Esprit de Tursan l&agrave; sự lựa chọn l&yacute; tưởng cho ẩm thực kết hợp, được b&igrave;nh chọn bởi c&aacute;c đầu bếp t&agrave;i năng, những chuy&ecirc;n gia thử rượu v&agrave; c&aacute;c nh&agrave; h&agrave;ng đạt chuẩn Michelin.</p>', '<p>Rượu vang Esprit là dòng rượu đặc trưng từ nhà sản xuất Tursan AOC, ra đời năm 1958 tại “Les Landes”-khu rừng lớn nhất Châu Âu, phía Nam Bordeaux. A.O.C (Appellation d’Origine Contrôlée) chỉ ra nguồn gốc địa lý, chất lượng và phong cách của các sản phẩm rượu. AOC là tiêu chuẩn cao nhất của rượu vang. Nhờ vậy, Esprit de Tursan là sự lựa chọn lý tưởng cho ẩm thực kết hợp, được bình chọn bởi các đầu bếp tài năng, những chuyên gia thử rượu và các nhà hàng đạt chuẩn Michelin.</p><p>Rượu Vang Trắng Esprit de Tursan AOC White&nbsp; nồng độ 12% có vị nho mang đến sự cô đọng và tươi mát. Rượu càng tăng hương vị khi kết hợp hoàn hảo với các món Sushi, Sashimi, hải sản tươi sống và hải sản nướng.</p><p>Sản phẩm giúp kích thích tiêu hóa, ăn ngon miệng mà còn mang đến hưng phấn, thoải mái tinh thần.</p><p>Rượu Vang Trắng Esprit de Tursan AOC White&nbsp;điều độ từ 1 -2 ly/ngày rất tốt cho sức khỏe, giúp giảm xơ vữa động mạnh tăng cường chức năng tim mạch, chống lại một số tác nhân gây lão hóa, kéo dài tuổi thọ.</p><p>&nbsp;</p><p>Các giống nho: Baroque 35%, Sauvignon Blanc 35%, Manseng 30%</p><p>Nồng độ cồn: 12 độ</p><p>&nbsp;</p>', '1', '0', '1434', 'hàng nhập khẩu,đặc sản', '1217', '2018-06-02 18:04:30', null, null, null, null, null, '1');
