INSERT INTO `products` VALUES ('215', 'Sauvignon Blanc Fat Ba', 'sauvignon-blanc-fat-ba-', '13', '/UploadedFiles/images/productImages/sauvignonblancfatbastardwhite_b76fca79a575480e88b6e50f8453e6b9_large.jpg', '[\"/UploadedFiles/images/productImages/sauvignonblancfatbastardwhite_b76fca79a575480e88b6e50f8453e6b9_master.jpg\"]', '320000.00', '280000.00', '232727.27', null, '<p>Fat Bastard Sauvignon Blanc sự h&ograve;a quyện tuyệt vời giữa vị chua của cam qu&yacute;t v&agrave; quả bưởi, dư vị đọng lại v&agrave; tan dần trong v&ograve;m miệng. D&ugrave;ng chung với rượu khai vị v&agrave; ho&agrave;n hảo nhất khi d&ugrave;ng với cả c&aacute;c loại s&ograve; v&agrave; tr&aacute;i c&acirc;y tươi.</p>', '<p>Fat Bastard Sauvignon Blanc sự hòa quyện tuyệt vời giữa vị chua của cam quýt và quả bưởi, dư vị đọng lại và tan dần trong vòm miệng. Dùng chung với rượu khai vị và hoàn hảo nhất khi dùng với cả các loại sò và trái cây tươi.</p><p>Các giống nho:<span>&nbsp;</span><span>Sauvignon Blanc</span>&nbsp;100%</p><p>Nồng độ cồn: 13 độ</p><p>Dung tích: 750mlx12</p><p>SKU: 447GMFR</p>', '1', '0', '12090', 'hàng nhập khẩu,đặc sản', '1252', '2018-06-02 18:04:40', null, null, null, null, null, '1');
