INSERT INTO `products` VALUES ('219', 'Shiraz Fat Bastard Red', 'Shiraz-Fat-Bastard-Red', '13', '/UploadedFiles/images/productImages/shiraz_fat_bastard_red_large.jpeg', '[\"/UploadedFiles/images/productImages/shiraz_fat_bastard_red_master.jpeg\"]', '320000.00', '280000.00', '174545.45', null, '<p>Rượu Vang&nbsp;Đỏ Shiraz&nbsp;Fat&nbsp;Bastard&nbsp;nồng độ 13% c&oacute; vị&nbsp;của nho kh&ocirc;, cam thảo, oliu đen v&agrave; hương thơm quyến rũ từ anh đ&agrave;o đen v&agrave; quế,&nbsp;c&oacute; thể uống khi ăn c&aacute;c m&oacute;n thịt đỏ, cừu, phomai, thức ăn cay,... Kh&ocirc;ng những c&oacute; thể khai vị gi&uacute;p k&iacute;ch th&iacute;ch ti&ecirc;u h&oacute;a, ăn ngon miệng m&agrave; c&ograve;n gi&uacute;p qu&yacute; kh&aacute;ch cảm thấy hưng phấn, thoải m&aacute;i tinh thần.</p>', '<p>Rượu Vang&nbsp;Đỏ Shiraz&nbsp;Fat&nbsp;Bastard&nbsp;nồng độ 13% có vị&nbsp;của nho khô, cam thảo, oliu đen và hương thơm quyến rũ từ anh đào đen và quế,&nbsp;có thể uống khi ăn các món thịt đỏ, cừu, phomai, thức ăn cay,... Không những có thể khai vị giúp kích thích tiêu hóa, ăn ngon miệng mà còn giúp quý khách cảm thấy hưng phấn, thoải mái tinh thần.</p><p>Uống&nbsp;rượu Vang&nbsp;Đỏ Shiraz&nbsp;Fat&nbsp;Bastard&nbsp;điều độ từ 1 -2 ly/ngày rất tốt cho sức khỏe, giúp giảm xơ vữa động mạnh tăng cường chức năng tim mạch, chống lại một số tác nhân gây lão hóa, kéo dài tuổi thọ.</p><p>&nbsp;</p>', '1', '0', '18848', 'hàng nhập khẩu,đặc sản', '1275', '2018-06-02 18:04:42', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('220', 'BÔNG Atiso sấy', 'BONG-Atiso-say', '14', '/UploadedFiles/images/productImages/bong-atiso-say1_large.jpg', '[\"/UploadedFiles/images/productImages/bong-atiso-say1_master.jpg\",\"/UploadedFiles/images/productImages/bong-atiso-say_master.jpg\"]', '120000.00', '105000.00', '65454.54', null, '<p><strong>B&ocirc;ng Atis&ocirc;</strong>&nbsp;l&agrave; đặc sản nổi tiếng của Đ&agrave; Lạt, đ&acirc;y bộ phận chứa nhiều dưỡng chất v&agrave; c&oacute; nhiều t&aacute;c dụng rất tốt cho sức khỏe.&nbsp;B&ocirc;ng Atiso kh&ocirc; để được l&acirc;u, c&aacute;ch chế biến đơn giản, sản phẩm được cung cấp bởi Sunfood&nbsp;</p>', '<p><strong>Bông Atisô</strong><span>&nbsp;là đặc sản nổi tiếng của Đà Lạt, đây bộ phận chứa nhiều dưỡng chất và có nhiều tác dụng rất tốt cho sức khỏe.&nbsp;Bông Atiso khô để được lâu, cách chế biến đơn giản, sản phẩm được cung cấp bởi Sunfood&nbsp;</span></p><p><strong>Công dụng:</strong></p><ul><li>Giải độc mát gan, giảm cholesterol, ngăn ngừa ung thư, trị mụn, đẹp da.</li><li>Bồi bổi sức khoẻ, ngủ ngon, an thần, lọc máu, thông mật, lợi tiểu.</li></ul><p><strong>Hướng dẫn sử dụng:</strong></p><ul><li><strong>Cách dùng:</strong>&nbsp;lấy một nắm tay (khoảng nửa lạng) bông atiso khô, rửa qua và đun với 1-2 lít nước, để sôi khoảng 5-10 phút. Sau đó chắt nước ra để nguội là có thể dùng cho cả nhà trong ngày.</li><li>Cho thêm một ít đường phèn khi đun nếu uống ngọt (còn bản thân nước atiso đã có mùi thơm, ngọt bùi của hoa). Nếu uống liên tục, mỗi tháng nên tạm ngưng 3-5 ngày.</li></ul><p><strong>Bảo quản:</strong></p><ul><li>Để nơi khô ráo thoáng mát, uống đến đâu thì lấy rửa và đun đến đấy.<br></li></ul>', '1', '0', '10165', 'dản phẩm khô,đặc sản,hàng nội địa,thực phẩm đóng hộp', '1281', '2018-06-02 18:05:30', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('221', 'Cabernet Sauvignon Fat', 'cabernet-sauvignon-fat-', '14', '/UploadedFiles/images/productImages/cabernet_sauvignon_fat_bastard_red_7ee56bce1b634edd935f3e5044a056f8_large.jpg', '[\"/UploadedFiles/images/productImages/cabernet_sauvignon_fat_bastard_red_7ee56bce1b634edd935f3e5044a056f8_master.jpg\"]', '320000.00', '280000.00', '232727.27', null, '<p>Fat Bastard Cabernet Sauvignon hương vị mạnh mẽ v&agrave; &ecirc;m &aacute;i, đ&acirc;y l&agrave; loại rượu đậm với dư vị cam thảo v&agrave; ớt đỏ. Ngon nhất khi d&ugrave;ng chung với c&aacute;c m&oacute;n thịt nướng v&agrave; c&agrave; ri cừu.</p>', '<p>Fat Bastard Cabernet Sauvignon hương vị mạnh mẽ và êm ái, đây là loại rượu đậm với dư vị cam thảo và ớt đỏ. Ngon nhất khi dùng chung với các món thịt nướng và cà ri cừu.<br><br></p><p>Các giống nho: Cabernet Sauvignon 100%</p><p>Nồng độ cồn: 13 độ</p><p>Dung tích: 750mlx12</p><p>SKU: 449GMFR<br></p>', '1', '0', '4780', 'dản phẩm khô,đặc sản,hàng nội địa,thực phẩm đóng hộp', '1287', '2018-06-02 18:05:31', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('222', 'Chardonnay Fat Bastard', 'chardonnay-fat-bastard-', '14', '/UploadedFiles/images/productImages/chardonnay_fat_bastard_white_a432bd31d5e445d18d8dc8b441c07312_large.jpg', '[\"/UploadedFiles/images/productImages/chardonnay_fat_bastard_white_a432bd31d5e445d18d8dc8b441c07312_master.jpg\"]', '320000.00', '280000.00', '290909.09', null, '<p>Rượu Vang&nbsp;Trắng&nbsp;Chardonnay Fat&nbsp;Bastard&nbsp;nồng độ 13% c&oacute; vị&nbsp;hoa keo&nbsp;v&agrave;&nbsp;m&ugrave;i hương cam, qu&yacute;t quyến rũ&nbsp;c&oacute; thể uống khi ăn c&aacute;c m&oacute;n phomai, thịt g&agrave;, vịt, x&agrave; l&aacute;ch, xốt pasta,... Kh&ocirc;ng những c&oacute; thể khai vị gi&uacute;p k&iacute;ch th&iacute;ch ti&ecirc;u h&oacute;a, ăn ngon miệng m&agrave; c&ograve;n gi&uacute;p qu&yacute; kh&aacute;ch cảm thấy hưng phấn, thoải m&aacute;i tinh thần.</p>', '<p>Rượu Vang&nbsp;Trắng&nbsp;Chardonnay Fat&nbsp;Bastard&nbsp;nồng độ 13% có vị&nbsp;hoa keo&nbsp;và&nbsp;mùi hương cam, quýt quyến rũ&nbsp;có thể uống khi ăn các món phomai, thịt gà, vịt, xà lách, xốt pasta,... Không những có thể khai vị giúp kích thích tiêu hóa, ăn ngon miệng mà còn giúp quý khách cảm thấy hưng phấn, thoải mái tinh thần.</p><p>Uống&nbsp;rượu Vang&nbsp;Trắng&nbsp;Chardonnay Fat&nbsp;Bastard&nbsp;điều độ từ 1 -2 ly/ngày rất tốt cho sức khỏe, giúp giảm xơ vữa động mạnh tăng cường chức năng tim mạch, chống lại một số tác nhân gây lão hóa, kéo dài tuổi thọ.</p>', '1', '0', '18848', 'dản phẩm khô,đặc sản,hàng nội địa,thực phẩm đóng hộp', '1293', '2018-06-02 18:05:31', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('223', 'COLLAGEN YOUNGCARE (Hộp)', 'collagen-youngcare-hop-', '14', '/UploadedFiles/images/productImages/youngcare-box_large.jpg', '[\"/UploadedFiles/images/productImages/youngcare-box_master.jpg\",\"/UploadedFiles/images/productImages/collagen_youngcare_master.jpg\"]', '570000.00', '498750.00', '518181.81', null, '<p>Collagen Youngcare&nbsp;thủy ph&acirc;n&nbsp;dạng bột h&ograve;a tan&nbsp;cung cấp c&aacute;c ph&acirc;n tử&nbsp;Collagen dạng bột&nbsp;si&ecirc;u nhỏ chỉ 0,2 KiloDalton(KD) v&agrave; chỉ bằng 1/1000 c&aacute;c sản phẩm&nbsp;Collagen dạng bột&nbsp;tự nhi&ecirc;n c&oacute; tr&ecirc;n thị trường c&ograve;n gọi l&agrave; Bioactive Collagen Peptides. Điều n&agrave;y gi&uacute;p sản phẩm được hấp thụ v&agrave;o da nhanh đến 95% sau 1 giờ , do đ&oacute; ph&aacute;t huy t&aacute;c dụng tối ưu hơn để c&oacute; một l&agrave;n da trẻ trung khỏe mạnh , gi&uacute;p da săn chắc , giảm nếp nhăn , tăng độ đ&agrave;n hồi , chống chảy xệ v&agrave; kh&ocirc; da . Sản phẩm&nbsp;Collagen dạng bột YOUNG CARE&nbsp;tiện &iacute;ch cho c&aacute;c bạn th&iacute;ch uống nước tr&aacute;i c&acirc;y, cafe, sữa ..., c&oacute; thể h&ograve;a tan bột v&agrave;o uống chung.</p>\n<p>Collagen Youngcare&nbsp;l&agrave; dạng&nbsp;Collagen thủy ph&acirc;n&nbsp;th&agrave;nh c&aacute;c ph&acirc;n tử nhỏ gi&uacute;p việc ti&ecirc;u h&oacute;a được dễ d&agrave;ng hơn. C&ocirc;ng nghệ&nbsp;thủy ph&acirc;n&nbsp;gi&uacute;p chia nhỏ c&aacute;c ph&acirc;n tử collagen để dễ d&agrave;ng hấp thụ v&agrave;o trong cơ thể con người. Qu&aacute; tr&igrave;nh&nbsp;thủy ph&acirc;n&nbsp;ch&iacute;nh l&agrave; ph&aacute; vỡ c&aacute;c mối li&ecirc;n kết ph&acirc;n tử giữa c&aacute;c chuỗi collagen bằng c&aacute;ch sử dụng nhiệt, axit hoặc alkali. Collagen sau khi thủy ph&acirc;n c&oacute; độ tập trung dưỡng chất cao v&agrave; tinh khiết hơn.&nbsp;Collagen thủy ph&acirc;n&nbsp;l&agrave; hợp chất c&ugrave;ng kelatin cung cấp cho l&agrave;n da sự chắc khỏe, dẻo dai v&agrave; khả năng hồi phục. Khi c&agrave;ng về gi&agrave; collagen mất dần đi, dẫn đến c&aacute;c nguy&ecirc;n nh&acirc;n g&acirc;y nếp nhăn, chảy xệ. Do đ&oacute;&nbsp;Collagen thủy ph&acirc;n dạng bột Youngcare&nbsp;rất quan trọng trong việc chống lại c&aacute;c dấu hiệu l&atilde;o h&oacute;a của da.</p>\n<p>Sản phẩm đ&atilde; được Cục quản l&yacute; thực phẩm v&agrave; Dược phẩm Mỹ (FDA) x&aacute;c nhận đạt chuẩn an to&agrave;n chung (GRAS) kh&ocirc;ng c&oacute; t&aacute;c dụng phụ cho cơ thể v&agrave; được khuyến kh&iacute;ch sử dụng l&acirc;u d&agrave;i.</p>\n<p>&nbsp;</p>', '<p>Collagen Youngcare&nbsp;thủy phân&nbsp;dạng bột hòa tan&nbsp;cung cấp các phân tử&nbsp;Collagen dạng bột&nbsp;siêu nhỏ chỉ 0,2 KiloDalton(KD) và chỉ bằng 1/1000 các sản phẩm&nbsp;Collagen dạng bột&nbsp;tự nhiên có trên thị trường còn gọi là Bioactive Collagen Peptides. Điều này giúp sản phẩm được hấp thụ vào da nhanh đến 95% sau 1 giờ , do đó phát huy tác dụng tối ưu hơn để có một làn da trẻ trung khỏe mạnh , giúp da săn chắc , giảm nếp nhăn , tăng độ đàn hồi , chống chảy xệ và khô da . Sản phẩm&nbsp;Collagen dạng bột YOUNG CARE&nbsp;tiện ích cho các bạn thích uống nước trái cây, cafe, sữa ..., có thể hòa tan bột vào uống chung.<br></p><p>Collagen Youngcare&nbsp;là dạng&nbsp;Collagen thủy phân&nbsp;thành các phân tử nhỏ giúp việc tiêu hóa được dễ dàng hơn. Công nghệ&nbsp;thủy phân&nbsp;giúp chia nhỏ các phân tử collagen để dễ dàng hấp thụ vào trong cơ thể con người. Quá trình&nbsp;thủy phân&nbsp;chính là phá vỡ các mối liên kết phân tử giữa các chuỗi collagen bằng cách sử dụng nhiệt, axit hoặc alkali. Collagen sau khi thủy phân có độ tập trung dưỡng chất cao và tinh khiết hơn.&nbsp;Collagen thủy phân&nbsp;là hợp chất cùng kelatin cung cấp cho làn da sự chắc khỏe, dẻo dai và khả năng hồi phục. Khi càng về già collagen mất dần đi, dẫn đến các nguyên nhân gây nếp nhăn, chảy xệ. Do đó&nbsp;Collagen thủy phân dạng bột Youngcare&nbsp;rất quan trọng trong việc chống lại các dấu hiệu lão hóa của da.<br></p><p>Sản phẩm đã được Cục quản lý thực phẩm và Dược phẩm Mỹ (FDA) xác nhận đạt chuẩn an toàn chung (GRAS) không có tác dụng phụ cho cơ thể và được khuyến khích sử dụng lâu dài.</p><p>&nbsp;</p>', '1', '0', '4780', 'dản phẩm khô,đặc sản,hàng nội địa,thực phẩm đóng hộp', '1299', '2018-06-02 18:05:31', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('224', 'Croix Du Pin Cabernet ', 'croix-du-pin-cabernet-', '14', '/UploadedFiles/images/productImages/croix_du_pin_cabernet_sauvignon_red_1d55337d1c924cc28d0774be286f7820_large.jpg', '[\"/UploadedFiles/images/productImages/croix_du_pin_cabernet_sauvignon_red_1d55337d1c924cc28d0774be286f7820_master.jpg\"]', '250000.00', '218750.00', '159090.90', null, '<p>Rượu vang đỏ La Croix du Pin Cabernet Sauvignon tr&ograve;n trịa, pha lẫn nhiều hương vị với một ch&uacute;t ch&aacute;t nhẹ. Hương vị hoa quả h&ograve;a quyện với oliu, ớt v&agrave; thảo mộc. Tuyệt vời khi d&ugrave;ng với c&aacute;c m&oacute;n g&agrave; quay, thịt nướng, ức vịt nướng, hoặc ph&ocirc; mai đậm.</p>\n<p>&nbsp;</p>', '<p>Rượu vang đỏ La Croix du Pin Cabernet Sauvignon tròn trịa, pha lẫn nhiều hương vị với một chút chát nhẹ. Hương vị hoa quả hòa quyện với oliu, ớt và thảo mộc. Tuyệt vời khi dùng với các món gà quay, thịt nướng, ức vịt nướng, hoặc phô mai đậm.</p><p>&nbsp;</p><p>Các giống nho: Cabernet Sauvignon 100%</p><p>Nồng độ cồn: 12,5 độ</p><p>Dung tích: 750mlx6</p><p>SKU: 438FDFR</p>', '1', '0', '2215', 'dản phẩm khô,đặc sản,hàng nội địa,thực phẩm đóng hộp', '1304', '2018-06-02 18:05:32', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('225', 'Croix Du Pin Sauvignon', 'croix-du-pin-sauvignon-', '14', '/UploadedFiles/images/productImages/croix_du_pin_sauvignon_white_309f840c12b54137b1a25c890369ddb8_large.jpg', '[\"/UploadedFiles/images/productImages/croix_du_pin_sauvignon_white_309f840c12b54137b1a25c890369ddb8_master.jpg\"]', '250000.00', '218750.00', '159090.90', null, '<p>Rượu vang trắng La Croix du Pin Sauvignon Blanc ng&agrave;o ngạt hương hoa cỏ, với hậu vị tươi m&aacute;t, tinh tế. Tuyệt vời khi d&ugrave;ng chung với c&aacute;c m&oacute;n hải sản, s&ograve; nướng, c&aacute; m&ograve;i nướng hoặc với s&uacute;p c&aacute;.</p>', '<p>Rượu vang trắng La Croix du Pin Sauvignon Blanc ngào ngạt hương hoa cỏ, với hậu vị tươi mát, tinh tế. Tuyệt vời khi dùng chung với các món hải sản, sò nướng, cá mòi nướng hoặc với súp cá.</p><p>Các giống nho: Sauvignon Blanc 100%</p><p>Nồng độ cồn: 12 độ</p><p>Dung tích: 750mlx6</p><p>SKU: 437FDFR</p>', '1', '0', '15641', 'dản phẩm khô,đặc sản,hàng nội địa,thực phẩm đóng hộp', '1310', '2018-06-02 18:05:32', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('226', 'Esprit De Tursan Aoc Red', 'Esprit-De-Tursan-Aoc-Red', '14', '/UploadedFiles/images/productImages/esprit_de_tursan_aoc_red_7fcc552712764672a276ec445b16300a_large.jpg', '[\"/UploadedFiles/images/productImages/esprit_de_tursan_aoc_red_7fcc552712764672a276ec445b16300a_master.jpg\"]', '290000.00', '253750.00', '105454.54', null, '<p>Esprit đỏ tr&ograve;n trịa, phong ph&uacute; trong hương vị với vị ch&aacute;t mượt m&agrave; v&agrave; dư vị cam thảo. L&agrave; sự kết hợp ho&agrave;n hảo với c&aacute;c m&oacute;n thịt chi&ecirc;n, nướng, c&agrave; ri cay v&agrave; c&aacute;c bữa tiệu Buffet kiểu Ch&acirc;u &Aacute;.&nbsp;</p>', '<p>Esprit đỏ tròn trịa, phong phú trong hương vị với vị chát mượt mà và dư vị cam thảo. Là sự kết hợp hoàn hảo với các món thịt chiên, nướng, cà ri cay và các bữa tiệu Buffet kiểu Châu Á.&nbsp;<br><br></p><p>Các giống nho: Cabernet Franc 60%, Tannat 35%, Fer Servadou 5%</p><p>Nồng độ cồn: 12.5 độ</p><p>Dung tích: 750mlx6</p><p>SKU: 430TSFR</p>', '1', '0', '2215', 'dản phẩm khô,đặc sản,hàng nội địa,thực phẩm đóng hộp', '1316', '2018-06-02 18:05:32', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('227', 'Esprit De Tursan Aoc Rose', 'Esprit-De-Tursan-Aoc-Rose', '14', '/UploadedFiles/images/productImages/esprit_de_tursan_aoc_rose_f8c25f7c634143a895e4906afd5b8055_large.png', '[\"/UploadedFiles/images/productImages/esprit_de_tursan_aoc_rose_f8c25f7c634143a895e4906afd5b8055_master.png\"]', '290000.00', '253750.00', '263636.36', null, '<p>Rượu vang Esprit l&agrave; d&ograve;ng rượu đặc trưng từ nh&agrave; sản xuất Tursan AOC, ra đời năm 1958 tại &ldquo;Les Landes&rdquo;-khu rừng lớn nhất Ch&acirc;u &Acirc;u, ph&iacute;a Nam Bordeaux. A.O.C (Appellation d&rsquo;Origine Contr&ocirc;l&eacute;e) chỉ ra nguồn gốc địa l&yacute;, chất lượng v&agrave; phong c&aacute;ch của c&aacute;c sản phẩm rượu. AOC l&agrave; ti&ecirc;u chuẩn cao nhất của rượu vang. Nhờ vậy, Esprit de Tursan l&agrave; sự lựa chọn l&yacute; tưởng cho ẩm thực kết hợp, được b&igrave;nh chọn bởi c&aacute;c đầu bếp t&agrave;i năng, những chuy&ecirc;n gia thử rượu v&agrave; c&aacute;c nh&agrave; h&agrave;ng đạt chuẩn Michelin.</p>', '<p>Rượu vang Esprit là dòng rượu đặc trưng từ nhà sản xuất Tursan AOC, ra đời năm 1958 tại “Les Landes”-khu rừng lớn nhất Châu Âu, phía Nam Bordeaux. A.O.C (Appellation d’Origine Contrôlée) chỉ ra nguồn gốc địa lý, chất lượng và phong cách của các sản phẩm rượu. AOC là tiêu chuẩn cao nhất của rượu vang. Nhờ vậy, Esprit de Tursan là sự lựa chọn lý tưởng cho ẩm thực kết hợp, được bình chọn bởi các đầu bếp tài năng, những chuyên gia thử rượu và các nhà hàng đạt chuẩn Michelin.</p><p>Rượu Vang Hồng - Pháp - hiệu Esprit de Tursan AOC ROSE&nbsp; nồng độ 12% có vị nho và hương trái cây và hương thảo dược có thể uống khi ăn các món Nhật, Thái, Việt, tiệc buffet hoặc dùng chung với các món nướng, cuốn, salad, hải sản, các món thịt nướng và gà nướng...</p><p>Sản phẩm giúp kích thích tiêu hóa, ăn ngon miệng mà còn mang đến hưng phấn, thoải mái tinh thần.</p><p>Uống rượu Vang Đỏ Esprit de Tursan điều độ từ 1 -2 ly/ngày rất tốt cho sức khỏe, giúp giảm xơ vữa động mạnh tăng cường chức năng tim mạch, chống lại một số tác nhân gây lão hóa, kéo dài tuổi thọ.</p><p>Các giống nho: Cabernet Franc 60%, Tannat 30%, Fer Servadou 5%, Sauvignon Blanc 5%&nbsp;</p><p>Nồng độ cồn: 12 độ</p><p>&nbsp;</p>', '1', '0', '2996', 'dản phẩm khô,đặc sản,hàng nội địa,thực phẩm đóng hộp', '1322', '2018-06-02 18:05:32', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('228', 'Esprit De Tursan Aoc W', 'esprit-de-tursan-aoc-w-', '14', '/UploadedFiles/images/productImages/esprit_de_tursan_aoc_white_7385e6a704534191aa2b6429fedbf849_large.jpg', '[\"/UploadedFiles/images/productImages/esprit_de_tursan_aoc_white_7385e6a704534191aa2b6429fedbf849_master.jpg\"]', '290000.00', '253750.00', '105454.54', null, '<p>Rượu vang Esprit l&agrave; d&ograve;ng rượu đặc trưng từ nh&agrave; sản xuất Tursan AOC, ra đời năm 1958 tại &ldquo;Les Landes&rdquo;-khu rừng lớn nhất Ch&acirc;u &Acirc;u, ph&iacute;a Nam Bordeaux. A.O.C (Appellation d&rsquo;Origine Contr&ocirc;l&eacute;e) chỉ ra nguồn gốc địa l&yacute;, chất lượng v&agrave; phong c&aacute;ch của c&aacute;c sản phẩm rượu. AOC l&agrave; ti&ecirc;u chuẩn cao nhất của rượu vang. Nhờ vậy, Esprit de Tursan l&agrave; sự lựa chọn l&yacute; tưởng cho ẩm thực kết hợp, được b&igrave;nh chọn bởi c&aacute;c đầu bếp t&agrave;i năng, những chuy&ecirc;n gia thử rượu v&agrave; c&aacute;c nh&agrave; h&agrave;ng đạt chuẩn Michelin.</p>', '<p>Rượu vang Esprit là dòng rượu đặc trưng từ nhà sản xuất Tursan AOC, ra đời năm 1958 tại “Les Landes”-khu rừng lớn nhất Châu Âu, phía Nam Bordeaux. A.O.C (Appellation d’Origine Contrôlée) chỉ ra nguồn gốc địa lý, chất lượng và phong cách của các sản phẩm rượu. AOC là tiêu chuẩn cao nhất của rượu vang. Nhờ vậy, Esprit de Tursan là sự lựa chọn lý tưởng cho ẩm thực kết hợp, được bình chọn bởi các đầu bếp tài năng, những chuyên gia thử rượu và các nhà hàng đạt chuẩn Michelin.</p><p>Rượu Vang Trắng Esprit de Tursan AOC White&nbsp; nồng độ 12% có vị nho mang đến sự cô đọng và tươi mát. Rượu càng tăng hương vị khi kết hợp hoàn hảo với các món Sushi, Sashimi, hải sản tươi sống và hải sản nướng.</p><p>Sản phẩm giúp kích thích tiêu hóa, ăn ngon miệng mà còn mang đến hưng phấn, thoải mái tinh thần.</p><p>Rượu Vang Trắng Esprit de Tursan AOC White&nbsp;điều độ từ 1 -2 ly/ngày rất tốt cho sức khỏe, giúp giảm xơ vữa động mạnh tăng cường chức năng tim mạch, chống lại một số tác nhân gây lão hóa, kéo dài tuổi thọ.</p><p>&nbsp;</p><p>Các giống nho: Baroque 35%, Sauvignon Blanc 35%, Manseng 30%</p><p>Nồng độ cồn: 12 độ</p><p>&nbsp;</p>', '1', '0', '19827', 'dản phẩm khô,đặc sản,hàng nội địa,thực phẩm đóng hộp', '1328', '2018-06-02 18:05:32', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('229', 'Hạt Giống Hoa', 'Hat-Giong-Hoa', '14', '/UploadedFiles/images/productImages/hat_giong_hoa_large.jpg', '[\"/UploadedFiles/images/productImages/hat_giong_hoa_master.jpg\",\"/UploadedFiles/images/productImages/63d1dd0372149e4ac705_master.jpg\",\"/UploadedFiles/images/productImages/ab0792cf3dd8d18688c9_25a6c3bd1c4548e1b22e7f1b8d3a9eb5_master.jpg\"]', '20000.00', '17500.00', '5454.54', null, '<p>Hạt giống hoa Sao Việt, sản phẩm được cung cấp bởi thực phẩm an to&agrave;n Sunfood.</p>', '<p>Hạt giống hoa Sao Việt, sản phẩm được cung cấp bởi thực phẩm an toàn Sunfood.</p>', '1', '0', '2996', 'dản phẩm khô,đặc sản,hàng nội địa,thực phẩm đóng hộp', '1334', '2018-06-02 18:05:32', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('230', 'Hạt Giống Rau', 'Hat-Giong-Rau', '14', '/UploadedFiles/images/productImages/hat_giong_rau_large.jpg', '[\"/UploadedFiles/images/productImages/hat_giong_rau_master.jpg\",\"/UploadedFiles/images/productImages/ab0792cf3dd8d18688c9_master.jpg\",\"/UploadedFiles/images/productImages/hatgiong1_master.jpg\",\"/UploadedFiles/images/productImages/hatgiong2_master.jpg\"]', '15000.00', '13125.00', '12272.72', null, '<p>Hạt giống rau Sao Việt- Sản phẩm được cung cấp bởi thực phẩm an to&agrave;n Sunfood</p>', '<p>Hạt giống rau Sao Việt- Sản phẩm được cung cấp bởi thực phẩm an toàn Sunfood</p>', '1', '0', '10165', 'dản phẩm khô,đặc sản,hàng nội địa,thực phẩm đóng hộp', '1339', '2018-06-02 18:05:33', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('231', 'Hoa Hướng Dương', 'Hoa-Huong-Duong', '14', '/UploadedFiles/images/productImages/hoa_huong_duong_3_large.jpg', '[\"/UploadedFiles/images/productImages/hoa_huong_duong_3_master.jpg\"]', '62459.00', '54651.62', '17034.27', null, '<p>Hoa Hướng Dương Đ&agrave; Lạt - được cung cấp bởi Sunfood</p>', '<p>Hoa Hướng Dương luôn hướng về phía mặt trời nên thường là biểu tượng của lòng trung thành, chung thủy sâu sắc, sự kiên định đó cũng biểu thị cho sức mạnh, uy quyền, sự ấm áp, nuôi dưỡng (tất cả những thuộc tính của mặt trời) và cả sự kiêu kỳ, vẻ đẹp hào nhoáng bên ngoài hay một tình yêu bất hạnh. Những cây hoa Hướng Dương thấp tượng trưng cho sự đam mê trong ngôn ngữ của loài hoa.</p>', '1', '0', '19823', 'dản phẩm khô,đặc sản,hàng nội địa,thực phẩm đóng hộp', '1345', '2018-06-02 18:05:34', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('232', 'Lạp Xưởng Tươi', 'Lap-Xuong-Tuoi', '14', '/UploadedFiles/images/productImages/lap_xuong_tuoi_large.jpg', '[\"/UploadedFiles/images/productImages/lap_xuong_tuoi_master.jpg\"]', '129000.00', '112875.00', '35181.81', null, '<p>Lạp Xưởng Tươi</p>\n<p>Sản phẩm được cung cấp bởi Thực phẩm an to&agrave;n Sunfood.</p>', '<p>Lạp Xưởng Tươi</p><p>Sản phẩm được cung cấp bởi Thực phẩm an toàn Sunfood.</p>', '1', '0', '2996', 'dản phẩm khô,đặc sản,hàng nội địa,thực phẩm đóng hộp', '1351', '2018-06-02 18:05:47', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('233', 'Mật ong Tam đảo chai 6', 'mat-ong-tam-dao-chai-6-', '14', '/UploadedFiles/images/productImages/mat-ong-tam-dao_large.jpg', '[\"/UploadedFiles/images/productImages/mat-ong-tam-dao_master.jpg\",\"/UploadedFiles/images/productImages/mat_ong__2__master.jpg\",\"/UploadedFiles/images/productImages/mat_ong_tam_dao_master.jpg\"]', '76000.00', '66500.00', '20727.27', null, '<ul>\n<li>Mật ong Tam Đảo được chế biến từ mật ong rừng nguy&ecirc;n chất rất tốt cho sức khỏe.</li>\n<li>Gi&uacute;p tăng cường sinh lực, tăng sức đề kh&aacute;ng v&agrave; k&eacute;o d&agrave;i tuổi thọ, bồi bổ cơ thể, l&agrave;m đẹp da, chữa nhiều bệnh thường gặp&hellip;</li>\n<li>D&ugrave;ng ng&acirc;m thuốc, chữa bệnh hoặc pha nước uống l&uacute;c mệt mỏi, căng thẳng, suy nhược. V&agrave; c&oacute; thể d&ugrave;ng thay thế cho đường.</li>\n<li>Mẫu m&atilde; đẹp, trang nh&atilde; th&iacute;ch hợp l&agrave;m qu&agrave; tặng cho nhiều đối tượng.</li>\n<li>Trọng lượng: 650ml/ chai</li>\n<li>Xuất xứ: Việt Nam</li>\n</ul>', '<p>Mật ong là sản phẩm tuyệt vời được sản xuất trong một dây chuyền công nghiệp hiện đại nhất của thế giới côn trùng.</p><p>Sử dụng mật ong mang lại rất nhiều tác dụng có lợi với sức khỏe.</p><p>Tìm hiểu Quy trình tạo ra mật ong tự nhiên <a href=\"http://sunfood.com.vn/blogs/news/mat-ong-tu-nhien-duoc-tao-ra-nhu-the-nao\" title=\"mật ong rừng tự nhiên được tạo ra như thế nào\">tại đây</a>.</p>', '1', '0', '2996', 'dản phẩm khô,đặc sản,hàng nội địa,thực phẩm đóng hộp', '1357', '2018-06-02 18:05:48', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('234', 'Nha Đam', 'Nha-Dam', '14', '/UploadedFiles/images/productImages/nha_dam_73b31bcaa38343c69fff611f290a7dc6_large.jpg', '[\"/UploadedFiles/images/productImages/nha_dam_73b31bcaa38343c69fff611f290a7dc6_master.jpg\",\"/UploadedFiles/images/productImages/nha_dam12_master.jpg\",\"/UploadedFiles/images/productImages/nha_dam1_master.jpg\",\"/UploadedFiles/images/productImages/nha_dam_master.jpg\"]', '13000.00', '11375.00', '5909.09', null, '', '<p>Nha đam do Sunfood cung cấp, đảm bảo an toàn</p>', '1', '0', '16338', 'dản phẩm khô,đặc sản,hàng nội địa,thực phẩm đóng hộp', '1363', '2018-06-02 18:05:48', null, null, null, null, null, '1');
