INSERT INTO `products` VALUES ('236', 'Pía Sen Hộp 600g', 'Pia-Sen-Hop-600g', '14', '/UploadedFiles/images/productImages/bia_sen_large.jpg', '[\"/UploadedFiles/images/productImages/bia_sen_master.jpg\"]', '77000.00', '67375.00', '70000.00', null, '<p>P&iacute;a Sen Hộp 600g</p>\n<p>Sản phẩm được cung cấp bởi Thực phẩm an to&agrave;n Sunfood.</p>', '<p>Pía Sen Hộp 600g</p><p>Sản phẩm được cung cấp bởi Thực phẩm an toàn Sunfood.</p>', '1', '0', '4431', 'dản phẩm khô,đặc sản,hàng nội địa,thực phẩm đóng hộp', '1374', '2018-06-02 18:05:49', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('237', 'Sauvignon Blanc Fat Ba', 'sauvignon-blanc-fat-ba-', '14', '/UploadedFiles/images/productImages/sauvignonblancfatbastardwhite_b76fca79a575480e88b6e50f8453e6b9_large.jpg', '[\"/UploadedFiles/images/productImages/sauvignonblancfatbastardwhite_b76fca79a575480e88b6e50f8453e6b9_master.jpg\"]', '320000.00', '280000.00', '290909.09', null, '<p>Fat Bastard Sauvignon Blanc sự h&ograve;a quyện tuyệt vời giữa vị chua của cam qu&yacute;t v&agrave; quả bưởi, dư vị đọng lại v&agrave; tan dần trong v&ograve;m miệng. D&ugrave;ng chung với rượu khai vị v&agrave; ho&agrave;n hảo nhất khi d&ugrave;ng với cả c&aacute;c loại s&ograve; v&agrave; tr&aacute;i c&acirc;y tươi.</p>', '<p>Fat Bastard Sauvignon Blanc sự hòa quyện tuyệt vời giữa vị chua của cam quýt và quả bưởi, dư vị đọng lại và tan dần trong vòm miệng. Dùng chung với rượu khai vị và hoàn hảo nhất khi dùng với cả các loại sò và trái cây tươi.</p><p>Các giống nho:<span>&nbsp;</span><span>Sauvignon Blanc</span>&nbsp;100%</p><p>Nồng độ cồn: 13 độ</p><p>Dung tích: 750mlx12</p><p>SKU: 447GMFR</p>', '1', '0', '17318', 'dản phẩm khô,đặc sản,hàng nội địa,thực phẩm đóng hộp', '1380', '2018-06-02 18:05:50', null, null, null, null, null, '1');
INSERT INTO `products` VALUES ('238', 'Shiraz Fat Bastard Red', 'Shiraz-Fat-Bastard-Red', '14', '/UploadedFiles/images/productImages/shiraz_fat_bastard_red_large.jpeg', '[\"/UploadedFiles/images/productImages/shiraz_fat_bastard_red_master.jpeg\"]', '320000.00', '280000.00', '232727.27', null, '<p>Rượu Vang&nbsp;Đỏ Shiraz&nbsp;Fat&nbsp;Bastard&nbsp;nồng độ 13% c&oacute; vị&nbsp;của nho kh&ocirc;, cam thảo, oliu đen v&agrave; hương thơm quyến rũ từ anh đ&agrave;o đen v&agrave; quế,&nbsp;c&oacute; thể uống khi ăn c&aacute;c m&oacute;n thịt đỏ, cừu, phomai, thức ăn cay,... Kh&ocirc;ng những c&oacute; thể khai vị gi&uacute;p k&iacute;ch th&iacute;ch ti&ecirc;u h&oacute;a, ăn ngon miệng m&agrave; c&ograve;n gi&uacute;p qu&yacute; kh&aacute;ch cảm thấy hưng phấn, thoải m&aacute;i tinh thần.</p>\n', '<p>Rượu Vang&nbsp;Đỏ Shiraz&nbsp;Fat&nbsp;Bastard&nbsp;nồng độ 13% c&oacute; vị&nbsp;của nho kh&ocirc;, cam thảo, oliu đen v&agrave; hương thơm quyến rũ từ anh đ&agrave;o đen v&agrave; quế,&nbsp;c&oacute; thể uống khi ăn c&aacute;c m&oacute;n thịt đỏ, cừu, phomai, thức ăn cay,... Kh&ocirc;ng những c&oacute; thể khai vị gi&uacute;p k&iacute;ch th&iacute;ch ti&ecirc;u h&oacute;a, ăn ngon miệng m&agrave; c&ograve;n gi&uacute;p qu&yacute; kh&aacute;ch cảm thấy hưng phấn, thoải m&aacute;i tinh thần.</p>\n\n<p>Uống&nbsp;rượu Vang&nbsp;Đỏ Shiraz&nbsp;Fat&nbsp;Bastard&nbsp;điều độ từ 1 -2 ly/ng&agrave;y rất tốt cho sức khỏe, gi&uacute;p giảm xơ vữa động mạnh tăng cường chức năng tim mạch, chống lại một số t&aacute;c nh&acirc;n g&acirc;y l&atilde;o h&oacute;a, k&eacute;o d&agrave;i tuổi thọ.</p>\n\n<p>&nbsp;</p>\n', '1', '0', '4435', 'dản phẩm khô,đặc sản,hàng nội địa,thực phẩm đóng hộp', '1386', '2018-06-02 18:05:50', null, '2018-06-05 20:35:39', 'tedu', null, null, '1');
